<p>Whilst the service provides a notion of <code>subscribe()</code> and <code>unsubscribe()</code>, what is the best practice to handle the cleanup in the situation when a client dies or the channel faults? Currently, when a client subscribes I attach to handlers to the current <code>InstanceContext</code>''s <code>Closed</code> and <code>Faulted</code> events (the service users an PerSession instance context mode and netTcpBinding):</p>

<pre><code>_communicationObject = OperationContext.Current.InstanceContext;
_communicationObject.Closed += OnClientLost;
_communicationObject.Faulted += OnClientLost;
</code></pre>

<p>The <code>OnClientLost</code> handler simply unsubscribes the client, however:</p>

<ol>
<li>Is the above a good practice and alone robust enough to catch all situations when a client drops off the duplex communication? Or should the service just handle exceptions encountered at the point it attempts to communicate with the client and handle cleanup then?</li>
<li>Aside from just unsubscribing the client call back handler, should any further cleanup be performed especially in the case of a fault?</li>
</ol>

<p><a href="http://stackoverflow.com/questions/1427926/detecting-client-death-in-wcf-duplex-contracts">This question</a> poses a similar question but ultimately does not provide answers to the cases outside of the client calling subscribe and/or unsubscribe</p>

<p>Thanks</p>
',2823,NULL,NULL,NULL,112196,NULL,'2011-01-04T22:26:31.060',0,2,4749739,12,NULL,'Handling dropped clients in a duplex binding WCF application',1,112196,'<.net><wcf><duplex><publish-subscribe>','2011-01-01T01:05:32.163',5,4572864,'2011-01-20T16:28:06.727');

<p>The reasons you mentioned are exception details not the exception itself. If an operation fails (here, web method is going to do something, for example registering the user), there''s only one exception (i.e <code>RegistrationFailedException</code>). All other things are it''s information.</p>

<p>An <code>Exception</code> when occurs (I mean unhandled exceptions of course), no more exceptions can occur, so you should return the first and only unhandled exception with it''s related information (event args).</p>

<p>Designing an <code>Exception Schema</code> is a good idea. Envelop exception and it''s information in a single message according to your exception schema and return it to the user.</p>
