<p>You check <code>L &lt; R &amp;&amp; B &lt; T</code>, but it seems like the condition for an empty rectangle should be:</p>

<p><code>L &gt; R || B &lt; T</code>.</p>

<p>By the way, you can make your code a little simpler and easier to read by using <code>Min</code> and <code>Max</code> functions. You have a lot of this pattern:</p>

<pre><code>if (x &lt; y)
    a = x;
else
    a = y;
</code></pre>

<p>Which can be written simply as</p>

<pre><code>a = Min(x, y);
</code></pre>

<p><strong>Edit</strong></p>

<p>Another mistake is that you take the maximum bottom and the minimum top. You should be taking the minimum bottom and the maximum top. (Assuming the rectangles correspond to screen coordinates, where the top actuallly has lower <em>y</em> values.</p>
