<pre><code>squish([])                 --&gt; [].
squish([(0'',),(0'' )|Rest]) --&gt; [0'',], spaces, !, squish(Rest).
squish([L|Ls])             --&gt; [L], squish(Ls).

spaces --&gt; [0'' ], spaces.
spaces --&gt; [].
</code></pre>

<p>Example query:</p>

<pre><code>?- phrase(squish(Ls), "a,   b,c"), format("~s", [Ls]).
a, b, c
</code></pre>

<p>So, first focus on a clear declarative description of the relation between character sequences and the desired "clean" string. You can then use SWI-Prolog''s library(pio) to read from files via these grammar rules. To remove all spaces preceding commas, you only have to add a single rule to the DCG above (to squish//1), which I leave as exercise to you. A corner case of course is if a comma is followed by another comma, in which case the requirements are contradictory :-)</p>
