<p>If you just want to write off some previous commits (units of work) mixed up with good ones then use <code>git rebase -i HEAD~10</code>... increase "10" to be far enough back and remove the commits that are junk.</p>

<p>If you want to revert a single file to an older version, do <code>git checkout HEAD~10 -- Node.js</code> to pull that into the current workspace and then commit that, saying you''re reverting all the changes since... you get the idea.</p>

<p>If you just want to remove a bunch of recent commits, you can <code>git reset --hard HEAD~10</code> or whatever to revert back to that old version.</p>
