<p>One way to do this is to add a tag to the tip of your current branch and then use <code>git-reset --hard</code> to back your project out to the very beginning and then continue from there.</p>

<p>I prefer to use tags in this case because as long as you have a tag the commits will be rooted and won''t be garbage collected. Also, if you use branches a lot, then you aren''t always distracted by the dead branch as tags don''t show up in branch lists.</p>
