<p>PHP needs to set aside a chunk of memory to store that data so it can be accessed later.  When your array gets too big you''re out of memory.  In plain english, you''re telling PHP</p>

<blockquote>
  <p>Take all 5000 rows of data and store them in memory, I''m going to do something with them later.</p>
</blockquote>

<p>You need to think of a different way to approach your problem.  The below items are two quick thoughts on the problem.</p>

<p>You could not store the items in memory and just take whatever actions you wanted to in the loop, allowing php to discard the items as need be</p>

<pre><code>foreach ($data as $key =&gt; $report) {
    $object = unserialize($report[''serialized_values'']);        
    //do stuff with $object here
}
</code></pre>

<p>You could also only store the information you need from the unserialized object, rather than storing the entire object</p>

<pre><code>foreach ($data as $key =&gt; $report) {
    $object             = unserialize($report[''serialized_values'']);        
    $data               = array();
    $data[''foo'']        = $object-&gt;foo;
    $data[$key][''data''] = $data;
}
</code></pre>

<p>Long story short: you''re hitting memory limits because you''re actually using too much memory.  There''s no magic solution here. Storing serialized data and attempting to load it all in a single program is a memory intensive approach, irrespective of language/platform.</p>
