<p>Despite the fact that you have only one method named <code>X</code>, the compiler rules are built for the case when there are multiple.</p>

<p>In addition, since delegates don''t have to match the method signature exactly, the complexity is further increased.  On top of that, any given method can be converted to an unlimited number of different delegate types with identical signatures.</p>

<p>Your particular case looks straightforward enough, but the general case is very very hard, so the language doesn''t allow it.</p>

<p>If you do part of the work by hand, you''ll solve the problem.  e.g. </p>

<pre><code>Func&lt;string&gt; d = X;
Foo(d);
</code></pre>

<p>should compile just fine.</p>
