<pre><code>google.setOnLoadCallback(function(){

    //Run the Initialize Function
    initialize(function(){
         //Run anything else here like
         alert("My function can run here :)")  
    });
});
</code></pre>

<p>and then just modify your initialize function.</p>

<p>f<code>unction initialize() {</code> > <code>function initialize(callback) {</code> so that you no are passing in an anonymous function to the intialize.</p>

<p>and then within the <code>feed.load(function(result) {});</code>  you can just do <code>callback()</code> to activate your callback.</p>

<hr>

<p>you say that anonymous function confuses you, Let me first show you a few ways to write a function</p>

<ul>
<li><code>function hello(){}</code></li>
<li><code>hello = function(){}</code></li>
</ul>

<p>The above are non-anonymous functions</p>

<p>Anonymous functions are functions that are not assigned to a variable, so the parser goes over the function and does not execute it</p>

<pre><code>alert("Start")
function()
{
    alert("Middle")
}
alert("End");
</code></pre>

<p>Running the above will show Start and End in a dialog but Middle will never show as the function has not been executed.</p>

<p>Function the following:</p>

<pre><code>( F )( P )
</code></pre>

<p>Where F is an anonymous function and P Is the param that should be in the scope, you can directly run anonymous functions without ever assigning to the function to a variable liek so:</p>

<pre><code>alert("Start")
(
    function(Doc){
        alert("Middle");
    }
)(document)
alert("End")
</code></pre>

<p>So <code>document</code> gets passed into the anonymous function and becomes Doc in that scope, and Start, Middle and End all will get executed as your using a <a href="http://stackoverflow.com/questions/188663/jquery-javascript-design-self-executing-function-or-object-literal">self executed anonymous function</a></p>

<p>Ok so I might have gone over the top with the explanation so ill just quickly show you how the original method works</p>

<p><a href="http://en.wikipedia.org/wiki/Ajax_(programming" rel="nofollow">http://en.wikipedia.org/wiki/Ajax_(programming</a>)</p>

<p>Ajax is Asynchronously which means that when your calling a server such as google for some information, your javascript will continue to execute which means while your waiting for data your javscript has carried on executing..</p>

<p>This is why we devoted callbacks just like the <code>initialize</code> callback, which the google Javascript library executes when its got the data, when have create our own and were executing when we want to.</p>
