<p>The web server, not PHP, listens on a socket and accepts connections. PHP can get information about the connection from $_SERVER (<a href="http://www.php.net/manual/en/reserved.variables.server.php">http://www.php.net/manual/en/reserved.variables.server.php</a>). Be aware that all you''re checking is from whence the connection came - you can''t learn anything about whether your server is available via other IP addresses from $_SERVER. For example, I can access my local instance of Apache/PHP via any of:</p>

<ul>
<li><a href="http://localhost/">http://localhost/</a> ($_SERVER["SERVER_ADDR"] => ::1)</li>
<li><a href="http://127.0.0.1/">http://127.0.0.1/</a> ($_SERVER["SERVER_ADDR"] => 127.0.0.1)</li>
<li><a href="http://192.168.75.121/">http://192.168.75.121/</a> ($_SERVER["SERVER_ADDR"] => 192.168.75.121)</li>
<li><a href="http://shiva.local/">http://shiva.local/</a> ($_SERVER["SERVER_ADDR"] => fe80::21c:42ff:fe00:8)</li>
</ul>

<p>So, if your plan is that the app is to behave differently upon seeing the "correct" value in $_SERVER["SERVER_ADDR"], you''re probably pretty safe - i.e., it''s unlikely that could be spoofed by a user from a remote client.</p>

<p>Having said all of that, I would not use any of these techniques for either authentication of users or authorization of user privileges/actions on a deployed application that is available over the Internet. The one exception might be if you''ve got an entire app that is only to be available when accessed from localhost - then this technique probably makes decent sense and will be secure enough for a personal app.</p>
