<p>EDIT: Actually, your problem is that inside a template argument list isn''t a legal place to put a class definition, with or without a name, according to the C++ standard.</p>

<p>litb points out that although it fits into the C++0x grammar, defining a type here is forbidden by <code>[dcl.type]</code>:</p>

<blockquote>
  <p>A type-speciﬁer-seq shall not deﬁne a class or enumeration unless it appears in the type-id of an alias-declaration (7.1.3) that is not the declaration of a template-declaration.</p>
</blockquote>

<pre><code>simple-template-id:
    template-name &lt; template-argument-list_opt &gt;

template-argument-list:
    template-argument ..._opt
    template-argument-list , template-argument ..._opt

template-argument:
    constant-expression
    type-id
    id-expression

type-id:
    type-speciﬁer-seq abstract-declarator_opt

type-speciﬁer-seq:
    type-speciﬁer attribute-speciﬁer-seq_opt
    type-speciﬁer type-speciﬁer-seq

type-speciﬁer:
    trailing-type-speciﬁer
    class-speciﬁer
    enum-speciﬁer

class-speciﬁer:
    class-head { member-speciﬁcation_opt }
</code></pre>

<p>For a while I had a question about typedef names, but litb cleared that up.  They are allowed as template arguments via:</p>

<pre><code>trailing-type-speciﬁer:
    simple-type-speciﬁer
    elaborated-type-speciﬁer
    typename-speciﬁer
    cv-qualiﬁer

simple-type-speciﬁer:
    :: opt nested-name-speciﬁer_opt type-name
    :: opt nested-name-speciﬁer template simple-template-id
    char
    char16_t
    char32_t
    wchar_t
    bool
    short
    int
    long
    signed
    unsigned
    float
    double
    void
    auto
    decltype-speciﬁer

type-name:
    class-name
    enum-name
    typedef-name
    simple-template-id
</code></pre>
',NULL,NULL,NULL,NULL,103167,4573090,'2011-01-01T05:35:59.667',13,NULL,NULL,4,NULL,NULL,2,103167,NULL,'2011-01-01T03:35:56.697',NULL,4573103,'2011-01-01T05:35:59.667');

<p>The best you can do it to create a named struct local to main (in C++0x<sup>1</sup>)</p>

<p><sub>1 :  You are not allowed to use a local type as template argument in C++03, however C++0x allows it.</sub></p>

<p>Also check out the Defect Report <a href="http://open-std.org/jtc1/sc22/wg21/docs/cwg_defects.html#62" rel="nofollow">here</a>. The proposed solution mentions </p>

<blockquote>
  <p>The following types shall not be used as a template-argument for a template type-parameter:</p>
  
  <ul>
  <li>a type whose name has no linkage</li>
  <li><strong>an unnamed class or enumeration type that has no name for linkage purposes (7.1.3 [dcl.typedef])</strong></li>
  <li>a cv-qualified version of one of the types in this list</li>
  <li>a type created by application of declarator operators to one of the types in this list</li>
  <li>a function type that uses one of the types in this list</li>
  </ul>
</blockquote>

<hr>

<blockquote>
  <p>The compiler complains when I try to use an anonymous struct as a template parameter.</p>
</blockquote>

<p>Did you mean template argument? Template parameter is different from template argument.</p>

<p>For example</p>

<pre><code>template &lt; typename T &gt; // T is template parameter
class demo {};

int main()
{
   demo &lt;int&gt; x; // int is template argument
}
</code></pre>
