<pre><code>  SELECT timediff(lastFinish + INTERVAL 48 HOUR, now()) FROM cron_status;
</code></pre>

<p>should display the time as <code>hh:mm:ss</code>. Assuming <code>lastFinish</code> is a <code>datetime</code>.</p>

<p>In order to get the answer in hours instead,</p>

<pre><code>  SELECT timestampdiff(HOUR, now(), lastFinish + INTERVAL 48 HOUR) FROM cron_status;
</code></pre>

<p>Note that <code>timediff</code> does <code>arg1 - arg2</code> while <code>timestampdiff</code> does <code>arg2 - arg1</code>.</p>
