<p>and I don''t mean this in jest! They are simple tools - but they have certain advantages to them. They have limitations in what you can track with them, and hence you only track what is important. Take it as the minimalistic approach to project management if you will.</p>

<p>In general, I don''t tend to think you can manage software development by GANTT or PERT and resources. Most software construction is creative and implements things which have not been tried before. Hence, the problems you are to solve have a high risk of failure where you have to retry the attempt. I find that GANTT and friends are best if you have a large number of well-known low-risk tasks to accomplish.</p>

<p>You may not believe this to be true, but then I implore you to at least take my standpoint into consideration when you track the project in detail. Especially if and when you suddenly have to update the GANTT chart due to slips.</p>
