<p>Google will read this and see that the mail is malformed as there''s no boundaries. Lack of correct new lines etc.</p>

<p>I''m not going to bother explaining the whole RFC For the Email Formats but instead point you to a file which I use all the time and works very very well.</p>

<pre><code>&lt;?php
class Mail {
    protected $to;
    protected $from;
    protected $sender;
    protected $subject;
    protected $text;
    protected $html;
    protected $attachments = array();
    public $protocol = ''mail'';
    public $hostname;
    public $username;
    public $password;
    public $port = 25;
    public $timeout = 5;
    public $newline = "\n";
    public $crlf = "\r\n";
    public $verp = FALSE;
    public $parameter = '''';

    public function setTo($to) {
        $this-&gt;to = $to;
    }

    public function setFrom($from) {
        $this-&gt;from = $from;
    }

    public function addheader($header, $value) {
        $this-&gt;headers[$header] = $value;
    }

    public function setSender($sender) {
        $this-&gt;sender = html_entity_decode($sender, ENT_COMPAT, ''UTF-8'');
    }

    public function setSubject($subject) {
        $this-&gt;subject = html_entity_decode($subject, ENT_COMPAT, ''UTF-8'');
    }

    public function setText($text) {
        $this-&gt;text = $text;
    }

    public function setHtml($html) {
        $this-&gt;html = $html;
    }

    public function addAttachment($file, $filename = '''') {
        if (!$filename) {
            $filename = basename($file);
        }

        $this-&gt;attachments[] = array(
            ''filename'' =&gt; $filename,
            ''file''     =&gt; $file
        );
    }

    public function send() {
        if (!$this-&gt;to) {
            exit(''Error: E-Mail to required!'');
        }

        if (!$this-&gt;from) {
            exit(''Error: E-Mail from required!'');
        }

        if (!$this-&gt;sender) {
            exit(''Error: E-Mail sender required!'');
        }

        if (!$this-&gt;subject) {
            exit(''Error: E-Mail subject required!'');
        }

        if ((!$this-&gt;text) &amp;&amp; (!$this-&gt;html)) {
            exit(''Error: E-Mail message required!'');
        }

        if (is_array($this-&gt;to)) {
            $to = implode('','', $this-&gt;to);
        } else {
            $to = $this-&gt;to;
        }

        $boundary = ''----=_NextPart_'' . md5(time());

        $header = '''';

        if ($this-&gt;protocol != ''mail'') {
            $header .= ''To: '' . $to . $this-&gt;newline;
            $header .= ''Subject: '' . $this-&gt;subject . $this-&gt;newline;
        }

        $header .= ''From: '' . $this-&gt;sender . ''&lt;'' . $this-&gt;from . ''&gt;'' . $this-&gt;newline;
        //$header .= ''From: "'' . $this-&gt;sender . ''" &lt;'' . $this-&gt;from . ''&gt;'' . $this-&gt;newline;
        $header .= ''Reply-To: '' . $this-&gt;sender . ''&lt;'' . $this-&gt;from . ''&gt;'' . $this-&gt;newline;
        $header .= ''Return-Path: '' . $this-&gt;from . $this-&gt;newline;
        $header .= ''X-Mailer: PHP/'' . phpversion() . $this-&gt;newline;
        $header .= ''MIME-Version: 1.0'' . $this-&gt;newline;
        $header .= ''Content-Type: multipart/mixed; boundary="'' . $boundary . ''"'' . $this-&gt;newline;

        if (!$this-&gt;html) {
            $message  = ''--'' . $boundary . $this-&gt;newline;
            $message .= ''Content-Type: text/plain; charset="utf-8"'' . $this-&gt;newline;
            $message .= ''Content-Transfer-Encoding: 8bit'' . $this-&gt;newline . $this-&gt;newline;
            $message .= $this-&gt;text . $this-&gt;newline;
        } else {
            $message  = ''--'' . $boundary . $this-&gt;newline;
            $message .= ''Content-Type: multipart/alternative; boundary="'' . $boundary . ''_alt"'' . $this-&gt;newline . $this-&gt;newline;
            $message .= ''--'' . $boundary . ''_alt'' . $this-&gt;newline;
            $message .= ''Content-Type: text/plain; charset="utf-8"'' . $this-&gt;newline;
            $message .= ''Content-Transfer-Encoding: 8bit'' . $this-&gt;newline;

            if ($this-&gt;text) {
                $message .= $this-&gt;text . $this-&gt;newline;
            } else {
                $message .= ''This is a HTML email and your email client software does not support HTML email!'' . $this-&gt;newline;
            }

            $message .= ''--'' . $boundary . ''_alt'' . $this-&gt;newline;
            $message .= ''Content-Type: text/html; charset="utf-8"'' . $this-&gt;newline;
            $message .= ''Content-Transfer-Encoding: 8bit'' . $this-&gt;newline . $this-&gt;newline;
            $message .= $this-&gt;html . $this-&gt;newline;
            $message .= ''--'' . $boundary . ''_alt--'' . $this-&gt;newline;
        }

        foreach ($this-&gt;attachments as $attachment) {
            if (file_exists($attachment[''file''])) {
                $handle = fopen($attachment[''file''], ''r'');
                $content = fread($handle, filesize($attachment[''file'']));

                fclose($handle);

                $message .= ''--'' . $boundary . $this-&gt;newline;
                $message .= ''Content-Type: application/octetstream'' . $this-&gt;newline;
                $message .= ''Content-Transfer-Encoding: base64'' . $this-&gt;newline;
                $message .= ''Content-Disposition: attachment; filename="'' . basename($attachment[''filename'']) . ''"'' . $this-&gt;newline;
                $message .= ''Content-ID: &lt;'' . basename($attachment[''filename'']) . ''&gt;'' . $this-&gt;newline . $this-&gt;newline;
                $message .= chunk_split(base64_encode($content));
            }
        }

        $message .= ''--'' . $boundary . ''--'' . $this-&gt;newline;

        if ($this-&gt;protocol == ''mail'') {
            ini_set(''sendmail_from'', $this-&gt;from);

            if ($this-&gt;parameter) {
                mail($to, $this-&gt;subject, $message, $header, $this-&gt;parameter);
            } else {
                mail($to, $this-&gt;subject, $message, $header);
            }

        } elseif ($this-&gt;protocol == ''smtp'') {
            $handle = fsockopen($this-&gt;hostname, $this-&gt;port, $errno, $errstr, $this-&gt;timeout);

            if (!$handle) {
                error_log(''Error: '' . $errstr . '' ('' . $errno . '')'');
            } else {
                if (substr(PHP_OS, 0, 3) != ''WIN'') {
                    socket_set_timeout($handle, $this-&gt;timeout, 0);
                }

                while ($line = fgets($handle, 515)) {
                    if (substr($line, 3, 1) == '' '') {
                        break;
                    }
                }

                if (substr($this-&gt;hostname, 0, 3) == ''tls'') {
                    fputs($handle, ''STARTTLS'' . $this-&gt;crlf);

                    while ($line = fgets($handle, 515)) {
                        $reply .= $line;

                        if (substr($line, 3, 1) == '' '') {
                            break;
                        }
                    }

                    if (substr($reply, 0, 3) != 220) {
                        error_log(''Error: STARTTLS not accepted from server!'');
                    }
                }

                if (!empty($this-&gt;username)  &amp;&amp; !empty($this-&gt;password)) {
                    fputs($handle, ''EHLO '' . getenv(''SERVER_NAME'') . $this-&gt;crlf);

                    $reply = '''';

                    while ($line = fgets($handle, 515)) {
                        $reply .= $line;

                        if (substr($line, 3, 1) == '' '') {
                            break;
                        }
                    }

                    if (substr($reply, 0, 3) != 250) {
                        error_log(''Error: EHLO not accepted from server!'');
                    }

                    fputs($handle, ''AUTH LOGIN'' . $this-&gt;crlf);

                    $reply = '''';

