<p>I don''t want to start a php process per user as there is no good way to send the chat messages between these php childs.
So I thought about writing an own socket server in either PHP or node.js which should be able to handle more then 1000 connections (chat users). As a purely web developer (php) I''m not much familiar with sockets as I usually let web server care about connections. The chat messages won''t be saved on disk nor in mysql but in RAM as an array or object for best speed.</p>

<p>As far as I know there is no way to handle multiple connections at the same time in a single php process (socket server), however you can accept a great amount of socket connections and process them successive in a loop (read and write; incoming message -> write to all socket connections). The problem is that there will most-likely be a lag with ~1000 users and mysql operations could slow the whole thing down which will then affect all users.</p>

<p>My question is: Can node.js handle a socket server with better performance? Node.js is event-based but I''m not sure if it can process multiple events at the same time (wouldn''t that need multi-threading?) or if there is just an event queue. With an event queue it would be just like php: process user after user.</p>

<p>I could also spawn a php process per chat room (much less users) but afaik there are singlethreaded IRC servers which are also capable to handle thousands of users. (written in c++ or whatever) so maybe it''s also possible in php.</p>

<p>I would prefer PHP over Node.js because then the project would be php-only and not a mixture of programming languages. However if Node can process connections simultaneously I''d probably choose it.</p>
