<pre><code>XMLHttpRequest cannot load http://ax.itunes.apple.com/WebObjects/MZStoreServices.woa/wa/wsLookup?id=s. Origin http://www.bgsisson.com is not allowed by Access-Control-Allow-Origin.
</code></pre>

<p>It says this because the origin of the call is not on the same domain, port, or protocol as the destination. more information about this here -> (<a href="http://developer.yahoo.com/javascript/howto-proxy.html" rel="nofollow">http://developer.yahoo.com/javascript/howto-proxy.html</a>)</p>

<blockquote>
  <p>All modern web browsers impose a security restriction on network connections, which includes calls to XMLHttpRequest. This restriction prevents a script or application from making a connection to any web server other than the one the web page originally came from (Internet Explorer will allow cross-domain requests if the option has been enabled in the preferences). If both your web application and the XML data that application uses come directly from the same server, then you do not run into this restriction.</p>
</blockquote>

<p>What you''ll need to do is use your server(PHP) to make the call to <a href="http://ax.itunes.apple.com/WebObjects/MZStoreServices.woa/wa/wsLookup" rel="nofollow">http://ax.itunes.apple.com/WebObjects/MZStoreServices.woa/wa/wsLookup</a>, then pass that information to the client(JavaScript)</p>

<p>Where are you hosting your code? Are PHP and cURL installed? What OS are you using? I can help you more on this problem with that information.</p>
