<p>The problem is of course, that the main thread must wait until the created thread is finished before calling the getter to get the value of the ''decide'' variable.</p>

<p>Given this, it seems dubious why you would be using a separate thread in the first place to show the dialog.</p>

<p>If you still want to do this, the main thread needs to call Thread.join on the created thread before calling the getter to get the value of ''decide''.</p>
