<p>To get the parameter from the URL, you can use PHP''s <code>$_GET</code> function:</p>

<pre><code>$url = $_GET[''url''];
</code></pre>

<p>If your URL is <a href="http://www.example.com/?url=google.com" rel="nofollow">http://www.example.com/?url=google.com</a>, then you will be able to get the "google.com" using the above code.</p>

<p><a href="http://php.net/manual/en/reserved.variables.get.php" rel="nofollow">http://php.net/manual/en/reserved.variables.get.php</a></p>

<p>To put it together, try:</p>

