<p>That should send them to <code>http://example.com/somepage?ads=0</code> after five seconds. You can use a simple <code>ads=0</code> CGI parameter to tell the server not show the ads or you can do similar things with a flag in a cookie. When <code>/somepage</code> gets hit without the cookie or without <code>?ads=0</code> then show them the ads, if the cookie is set or <code>?ads=0</code> is there then show them the real stuff.</p>

<p>You can also do it in JavaScript by setting a timer and redirecting by assigning to <code>window.location</code>.</p>

<p>This sort of thing can be defeated pretty easily but it should be sufficient for the casual browser.</p>
