<p>Making the data access layer a singleton is a really bad idea, that means that only one thread at a time can access the database. It also means that the methods in the class have to use locks to make sure that only one thread at a time accesses the database, or the code won''t work properly.</p>

<p>Instead, each thread should get their own instance of the data access layer, with their own connection to the database. That way the database takes care of the concurrency issues, and the theads doesn''t have to do any locking at all.</p>
',NULL,NULL,NULL,NULL,NULL,4573196,NULL,2,NULL,NULL,1,NULL,NULL,2,69083,NULL,'2011-01-01T05:31:53.610',NULL,4573263,'2011-01-01T05:31:53.610');

<p>That GetInstance shouldn''t be static ?</p>

<p>the following pseudo code explains how GetInstance operates:</p>

<ol>
<li>LOCK</li>
<li>rval = _mutex</li>
<li>UNLOCK</li>
<li>Return rval</li>
</ol>

<p>_mutex is readonly, refers to a non-null object, so it can''t be changed, why lock ?</p>

<p>If your database provides concurrency management, but in your program you create two thread writing the same data in the same time in your own domain while waiting for the data,
how could your database help ? </p>
