<p>With that in mind, there are a few things that could be happening:</p>

<p>1) Your DNS records do not include the appropriate A Record for the www subdomain.
In this case, you''ll need to setup an A record that points to your web site''s IP address. If you don''t know how to do this, your web host should be able to help.</p>

<p>2) Your server is not configured to handle the www subdomain.
If you''re using the apache web server, it needs to be configured to show your web site when the user enters www before your domain. Again, your web host can set this up for you.</p>

<p>It all comes down to a misconfiguration issue. If you don''t have experience administering web servers, you may want to give your web host a holler.</p>
