<p>If your page(s) load in a decent amount of time and release the connection once the page is loaded, it should be fine. The problem occurs when your script takes some long time to retrieve information from the database or maintains the connections.<br>
Since you are executing INSERT and / or UPDATE operations of millions of rows, so you may have some problem.  </p>

<p>Additionally, if you fail to close connections in your script(s), it is possible that someone will load a page and instead of closing the connection when the page is loaded, it is left open. No one else can then use that connection. <strong>So please make sure that at the end of execution of all the MySQL / SQL queries, the database connection is closed. Also please make sure that your server provides more than 250 connections, since 100 connections is available in almost all the servers generally.</strong>  </p>

<p>Also make sure that you are not using the persistent connections (which is available when using the built-in function "<code>mysql_pconnect()</code>"), since this will lock up the user until the connection is manually closed.</p>

<p>Hope it helps.</p>
