<p>From that point, I would STOP messing with the system Ruby, and instead use <a href="http://rvm.beginrescueend.com" rel="nofollow">RVM</a> to manage and install any new Ruby and gems installations into RVM''s <code>~/.rvm</code> sandbox.</p>
