<p>HTTP is a protocol (language)</p>

<p>Whether you specify HTTP in the browser or not, the browser will always assume the request is being of "http" type and will ussually add http:// for you.</p>

<p>WWW however is just an alternative subdivision of the domain name, the same as in:</p>

<p>www.domain.com</p>

<p>site.domain.com</p>

<p>sub1.domain.com</p>

<p>sub2.domain.com</p>

<p>.....</p>

<p>etc.domain.com</p>

<p>In most cases the WWW subdomain will point to the same "page" as the main domain, which is usually called the "index" page, such as index.html, or index.php and in most cases the index page is hidden in the browser''s address bar, unless you specifically type it in, such as <a href="http://www.yahoo.com/index.html" rel="nofollow">http://www.yahoo.com/index.html</a>, but you have to understand that if you have a full control of your webserver you can modify these, so WWW doesn''t point to the same page or you can call you main page "home.html" instead of "index.html" and instruct your webserver to "point" your browswer to that page by default.</p>

<p>But things like HTTP are not easily changed, since HTTP is the main language of the web and most browswers use that as the primary means to access the webservers.
Peace!</p>
