<blockquote>
  <p>wouldn''t it be easier to just accept JSON object through normal $_POST and then respond in JSON as well</p>
</blockquote>

<p>From the Wikipedia on <a href="http://en.wikipedia.org/wiki/Representational_State_Transfer">REST</a>:</p>

<blockquote>
  <p>RESTful applications maximize the use of the pre-existing, well-defined interface and other built-in capabilities provided by the chosen network protocol, and minimize the addition of new application-specific features on top of it</p>
</blockquote>

<p>From what (little) I''ve seen, I believe this is usually accomplished by maximizing the use of existing HTTP verbs, and designing a URL scheme for your service that is as powerful and self-evident as possible.</p>

<p>Custom data protocols (even if they are built on top of standard ones, such as SOAP or JSON) are discouraged, and should be minimized to best conform to the REST ideology.</p>

<blockquote>
  <p>SOAP RPC over HTTP, on the other hand, encourages each application designer to define a new and arbitrary vocabulary of nouns and verbs (for example getUsers(), savePurchaseOrder(...)), usually overlaid onto the HTTP ''POST'' verb. This disregards many of HTTP''s existing capabilities such as authentication, caching and content type negotiation, and may leave the application designer re-inventing many of these features within the new vocabulary.</p>
</blockquote>

<p>The actual objects you are working with can be in any format.  The idea is to reuse as much of HTTP as possible to expose your operations the user wants to perform on those resource (queries, state management/mutation, deletion).</p>

<p><strong>You asked</strong>:</p>

<blockquote>
  <p>Am I missing something?</p>
</blockquote>

<p>There is a lot more to know about REST and the URI syntax/HTTP verbs themselves.  For example, some of the verbs are idempotent, others aren''t.  I didn''t see anything about this in your question, so I didn''t bother trying to dive into it.  The other answers and Wikipedia both have a lot of good information.</p>

<p>Also, there is a lot to learn about the various network technologies built on top of HTTP that you can take advantage of if you''re using a truly restful API.  I''d start with authentication.</p>
