<p>You suggested using post requests to access JSON, which is a perfectly valid way to access/manipulate data.</p>

<p>REST is a methodology for <strong>meaningful</strong> access of data. When you see a request in REST, it should immediately be apparant what is happening with the data.</p>

<p>For example:</p>

<pre><code>GET: /cars/make/chevrolet
</code></pre>

<p>is likely going to return a list of chevy cars. <del>A good REST api might even incorporate some output options in the querystring like <code>?output=json</code> or <code>?output=html</code> which would allow the accessor to decide what format the information should be encoded in.</del></p>

<p>After a bit of thinking about how to reasonably incorporate data typing into a REST API, I''ve concluded that the best way to specify the type of data explicitly would be via the already existing file extension such as <code>.js</code>, <code>.json</code>, <code>.html</code>, or <code>.xml</code>. A missing file extension would default to whatever format is default (such as JSON); a file extension that''s not supported could return a <a href="http://www.w3.org/Protocols/rfc2616/rfc2616-sec10.html#sec10.5.2"><code>501 Not Implemented</code> status code</a>.</p>

<p>Another example:</p>

<pre><code>POST: /cars/
{ make:chevrolet, model:malibu, colors:[red, green, blue, grey] }
</code></pre>

<p>is likely going to create a new chevy malibu in the db with the associated colors. I say <strong>likely</strong> as the REST api does not need to be directly related to the database structure. It is just a masking interface so that the true data is protected (think of it like accessors and mutators for a database structure).</p>

<p>Now we need to move onto the issue of <a href="http://en.wikipedia.org/wiki/Idempotence">idempotence</a>. Usually REST implements <a href="http://en.wikipedia.org/wiki/Create,_read,_update_and_delete">CRUD</a> over HTTP. HTTP uses <code>GET</code>, <code>PUT</code>, <code>POST</code> and <code>DELETE</code> for the requests.</p>

<p>A very simplistic implementation of REST <em>could</em> use the following CRUD mapping:</p>

<pre><code>Create -&gt; Post
Read   -&gt; Get
Update -&gt; Put
Delete -&gt; Delete
</code></pre>

<p>There is an issue with this implementation: Post is defined as a non-idempotent method. This means that subsequent calls of the same Post method will result in <strong>different</strong> server states. Get, Put, and Delete, are idempotent; which means that calling them multiple times should result in an identical server state.</p>

<p>This means that a request such as:</p>

<pre><code>Delete: /cars/oldest
</code></pre>

<p>could actually be implemented as:</p>

<pre><code>Post: /cars/oldest?action=delete
</code></pre>

<p>Whereas</p>

<pre><code>Delete: /cars/id/123456
</code></pre>

<p>will result in the same server state if you call it once, or if you call it 1000 times.</p>

<p>A better way of handling the removal of the <code>oldest</code> item would be to request:</p>

<pre><code>Get: /cars/oldest
</code></pre>

<p>and use the <code>ID</code> from the resulting data to make a <code>delete</code> request:</p>

<pre><code>Delete: /cars/id/[oldest id]
</code></pre>

<p>An issue with this method would be if another <code>/cars</code> item was added between when <code>/oldest</code> was requested and when the <code>delete</code> was issued.</p>
