<p>I assume you have a declared property named <code>tableView</code> and also an instance variable named <code>tableView</code>, the latter being either explicitly declared in the interface or automatically created when synthesizing the property. In that case, if you define a method that takes a parameter named <code>tableView</code> or declares a local variable named <code>tableView</code>, this local declaration will hide the <em>instance variable</em> named <code>tableView</code> (but not the property).</p>

<p>In the case of <code>UITableViewController</code>, there is no instance variable named <code>tableView</code>. There is a declared property named <code>tableView</code> which, because it’s in a different namespace, won’t be hidden by a local (variable) declaration.</p>

<p>One easy fix to avoid the compiler warnings is to give a different name to the instance variable. For instance, the instance variable can be named <code>_tableView</code>, and the property would still be named <code>tableView</code> but synthesized as <code>@synthesize tableView = _tableView</code>.</p>
