<p>First, have you mapped the IIS default web site to the folder containing your site? </p>

<p>Second, check your basic apppool settings, and make sure it''s set to use .Net 2.0.  It''ll be 2.0 even if you''re using a later version, like 4.0.</p>

<p>Barring that, make a new folder in wwwroot and map the default web site to that. Do not mess with the permissions. Then, make a new apppool, don''t fiddle with it''s settings, and assign that to the default web site. Point here is that you shouldn''t have to mess with any of those settings: IIS  will take care of that and the permissions.</p>

<p>Final thought, if that doesn''t help: check your isapi filter mappings to make sure it knows what to do with .aspx. That should have been set up by default as well, but it''s worth a look at that point. </p>
