<p>Check out <a href="http://docs.djangoproject.com/en/dev/ref/contrib/admin/#overriding-admin-templates">the Django docs regarding overriding admin templates</a> for more information.</p>

<p>It''s the <a href="http://code.djangoproject.com/browser/django/trunk/django/contrib/admin/templates/admin/change_form.html">admin/change_form.html template</a> which you would need to alter in some way (since this template renders the page shown when you add a new instance or edit an existing one). The existing templates already apply a <code>required</code> class to the appropriate labels, so I would create a new template which looks like this:</p>

<pre><code>{% extends "admin/change_form.html" %}

{% block extrastyle %}
    {{ block.super }}
    &lt;style type="text/css"&gt;
        /* add an asterisk using CSS */
        .required:after {
            content: " *";
        }
    &lt;/style&gt;
{% endblock %}
</code></pre>

<h3>Apply to a Single Model</h3>

<p>You should use a <a href="http://docs.djangoproject.com/en/dev/ref/contrib/admin/#modeladmin-objects">model admin class</a> if you want this template to be used for specific models, setting the <code>change_form_template</code> attribute, as described in <a href="http://docs.djangoproject.com/en/dev/ref/contrib/admin/#other-methods">this section of the docs</a> to the location of the template file you have created.</p>

<h3>Apply to a Single App</h3>

<p>If you want template to apply to models in an entire app create a <code>templates</code> folder inside the root of the app. Django will <a href="http://docs.djangoproject.com/en/dev/ref/templates/api/#loader-types">automatically look for templates there</a>, so if you create a folder called <code>admin</code> and place a file in there called <code>change_form.html</code> it will automatically override the default Django template of that name (<code>admin/change_form.html</code>).</p>

<h3>Project Wide</h3>

<p>In order to apply this template project wide create a folder somewhere (not inside an app) called <code>templates</code>. Again place your new template in this directory at <code>admin/change_form.html</code>.</p>

<p>Next <a href="http://docs.djangoproject.com/en/dev/ref/templates/api/#the-template-dirs-setting">edit the template directories Django setting</a> specifying the location of this directory in order to allow Django to find the template and override the default templates in the same way as before only project wide and not just app wide.</p>

<hr>

<p>This is quite a complex set of things to do, especially for such a simple change and you may find it tricky if you have not worked with admin templates before (or even if you have).</p>

<p>Hopefully you now understand what is required to change an admin template, its actually fairly elagant (as is Django) but in my opinion not worth the effort just to change to some asterisks.</p>
