<blockquote>
  <p>int fflush(FILE *ostream);</p>
  
  <p>ostream points to an output stream or
  an update stream in which the most
  recent operation was not input, the
  fflush function causes any unwritten
  data for that stream to be delivered
  to the host environment to be written
  to the file; otherwise, the behavior
  is undefined.</p>
</blockquote>

<p>To properly flush the input stream do something like the following:</p>

<pre><code>int main(void)
{
  int   ch;
  char  buf[BUFSIZ];

  puts("Flushing input");

  while ((ch = getchar()) != ''\n'' &amp;&amp; ch != EOF);

  printf ("Enter some text: ");

  if (fgets(buf, sizeof(buf), stdin))
  {
    printf ("You entered: %s", buf);
  }

  return 0;
}
</code></pre>

<p>See <a href="http://faq.cprogramming.com/cgi-bin/smartfaq.cgi?answer=1052863818&amp;id=1043284351" rel="nofollow">Why fflush(stdin) is wrong</a> and <a href="http://faq.cprogramming.com/cgi-bin/smartfaq.cgi?answer=1044873249&amp;id=1043284392" rel="nofollow">Flush the input buffer</a>.</p>
