<p>Also, you can return false rather than the string ''exists'' in the function, not that it makes much difference.</p>

<p>Checking the error number isn''t bad, I''m sure that''s why it''s an included feature.  If you really wanted to do something different, you could check if there already is a user by that name by selecting the username.  If no result exists, then insert the user, otherwise, give the error.</p>

<p>One thing I like to do with error handling on forms is save all the error strings into an array like $error[''username''], $error[''email''], etc., and then have it run through the error checking on each input individually to set all the error strings, and then have a function that does something like this:</p>

<pre><code>function error($field)
{
     global $error;
     if(isset($error[$field]))
     {
          echo $error[$field];
     }
}
</code></pre>

<p>and then call that after each field in the form to give error reporting on the form.  Of course, the form page must submit to itself, but you could have all the error checking logic in a separate file and do an include if $_POST[''whatever''] is set.  If your form is formatted in a table or whatever, you could even do something like <code>echo ''&lt;tr&gt;&lt;td class="error"&gt;'' . $error[$field] . ''&lt;/td&gt;&lt;/tr&gt;</code>, and automatically insert another row directly below the field to hold the error if there is one.</p>

<p>Also, always remember to filter your inputs, even if it should be filtered automatically.  Never pass post info directly into a DB without checking it out.  I''d also suggest using the specific superglobal variable for the action, like $_POST rather than $_REQUEST, because $_REQUEST contains $_GET, $_POST, and $_COOKIE variables, and someone could feasibly do something strange like submit to the page with ?username=whatever after the page, and then you have both $_POST[''username''] and $_GET[''username''], and I''m not sure how $_REQUEST would handle that.  Probably would make there be a $_REQUEST[''username''][0] and $_REQUEST[''username''][1].</p>

<p>Also, a bit about the page titles.  Don''t know if you have it set up like this but you can do something like this in your header:</p>

<pre><code>$pageTitle = "My Website";
if(isset($gPageTitle))
{
    $pageTitle .= "- $gPageTitle";
}
echo "&lt;title&gt;$pageTitle&lt;/title&gt;";
</code></pre>

<p>Which would make the page load normally with "My Website" as the title, and append "- Username already exists" or whatever for "My Website - Username already exists" as the title when $gPageTitle is set.</p>
