',13863,NULL,NULL,NULL,30453,NULL,'2011-01-01T10:28:37.800',3,4,4573532,10,NULL,'Netbeans Shortcut to Open File',1,292291,'<netbeans><keyboard-shortcuts><screenshot><openfiledialog><classname>','2011-01-01T07:44:17.597',8,4573483,'2013-09-17T20:20:25.540');

<pre><code>const char **cpp;
char *p;
const char c = ''A'';
cpp = &amp;p;  // constraint violation
*cpp = &amp;c; // valid
*p = 0;    // valid by itself, but would clobber c
</code></pre>

<p>It might seem reasonable that <code>cpp</code>, which promises not to modify any <code>char</code>s, might be assigned a pointer to an object pointing at non-qualified <code>char</code>s. After all, that''s allowed for single-indirect pointers, which is why, e.g.,  you can pass a mutable object to the second parameter of <code>strcpy(3)</code>, the first parameter to <code>strchr(3)</code>, and many other parameters that are declared with <code>const</code>.</p>

<p>But with the indirect pointer, at the next level, assignment from a qualified pointer is allowed, and now a perfectly unqualified pointer assignment will clobber a qualified object. </p>

<p>I don''t immediately see how a 2-D array could lead to this situation, but in any case it hits the same constraint in the standard. </p>

<p>Since in your case, you aren''t actually tricking it into clobbering a const, the right thing for <em>your</em> code would seem to be inserting the cast.</p>

<hr>

<p><strong>Update:</strong> OK guys, as it happens this issue is <strong><a href="http://c-faq.com/ansi/constmismatch.html">in the C faq</a></strong>, and this entire discussion has also taken place several times <strong><a href="http://gcc.gnu.org/bugzilla/show_bug.cgi?id=20230">on the gcc bug list</a></strong> and on the gcc mailing list. </p>

<ul>
<li>Gcc bug list: <strong><a href="http://gcc.gnu.org/bugzilla/show_bug.cgi?id=20230">http://gcc.gnu.org/bugzilla/show_bug.cgi?id=20230</a></strong>.</li>
<li>C FAQ: it''s question 11.10: <strong><a href="http://c-faq.com/ansi/constmismatch.html">http://c-faq.com/ansi/constmismatch.html</a></strong></li>
</ul>

<p>The lesson: you can pass a <code>T *x</code> when <code>const T *x</code> is expected, by explicit exception, but <code>T *x</code> and <code>const T *x</code> are still distinct types, so you can''t pass a pointer to either one to a pointer to the other.</p>
',NULL,NULL,NULL,NULL,140740,4573349,'2011-01-01T20:26:31.273',8,NULL,NULL,12,NULL,NULL,2,140740,NULL,'2011-01-01T07:44:29.907',NULL,4573484,'2011-01-01T20:26:31.273');

<p>You''re passing an argument that is essentially a non-const pointer, and the function is declared to accept a const pointer as an argument. These two are, in fact, incompatible. It is not a real problem because the compiler is still supposed to work as long as you can assign the value of the first type to the variable of the second type. Hence a warning but not an error.</p>

<p>EDIT: looks like gcc does not complain about other con-const to const conversions, e.g. passing char* where a const char* is expected. In this case, I''m inclined to agree that Joseph Myers from Bugzilla is correct.</p>
