<p>This seems a little nonsensical at first, but I have an API which is:</p>

<pre><code>template&lt;typename InputIterator, typename OutputIterator&gt;
void foo(
    InputIterator input_begin,
    InputIterator input_end,
    OutputIterator output_begin,
    OutputIterator output_end
);
</code></pre>

<p><code>foo</code> performs some operation on the input sequence, generating an output sequence. (Who''s length is known to <code>foo</code> but may or may not be equal to the input sequence''s length.)</p>

<p>The taking of the <code>output_end</code> parameter is the odd part: <code>std::copy</code> doesn''t do this, for example, and assumes you''re not going to pass it garbage. <code>foo</code> does it to provide range checking: if you pass a range too small, it throws an exception, in the name of defensive programming. (Instead of potentially overwriting random bits in memory.)</p>

<p>Now, say I want to pass <code>foo</code> a back inserter, specifically one from a <code>std::vector</code> which has no limit outside of memory constraints. I still need a "end" iterator - in this case, something that will never compare equal. (Or, if I had a <code>std::vector</code> but with a restriction on length, perhaps it might sometimes compare equal?)</p>

<p>How do I go about doing this? I do have the ability to change <code>foo</code>''s API - is it better to not check the range, and instead provide an alternate means to get the required output range? (Which would be needed anyways for raw arrays, but not required for back inserters into a vector.) This would seem less robust, but I''m struggling to make the "robust" (above) work.</p>
',540,NULL,NULL,NULL,151292,NULL,'2011-01-01T08:07:28.163',0,3,4573509,5,NULL,'"end()" iterator for back inserters?',1,101999,'<c++><stl><iterator>','2011-01-01T07:50:47.520',NULL,4573496,'2011-01-03T02:51:18.123');

