<p>A <code>foo</code> with the <code>std::copy</code>-like signature <code>foo(InIt, InIt, OutIt)</code> is, in my opinion, your best option.  It isn''t really "not robust."  For most algorithms, you only want to do this kind of range checking in debug builds for performance reasons, and a decent Standard Library implementation (like the Visual C++ Standard Library) will already provide a lot of range checking in debug builds.</p>

<p>Alternatively, you could create a <code>back_inserting_foo(InIt, InIt, Container)</code>, though creating a special case for this would be a bit unusual and places a greater burden upon users of the function to know which overload they need to use for different types of iterators.</p>
