<p>To change a Start Date and an End Date (A date range if you will) into an array of individual dates, I used this:</p>

<pre><code>function createDateRangeArray($strDateFrom,$strDateTo) //Changes a Range of Dates to Specific Dates
    {
    static $aryRange = array(); //Creates an Array

    $iDateFrom = mktime(1,0,0,substr($strDateFrom,5,2),     substr($strDateFrom,8,2),substr($strDateFrom,0,4));
    $iDateTo = mktime(1,0,0,substr($strDateTo,5,2),     substr($strDateTo,8,2),substr($strDateTo,0,4));

    if ($iDateTo &gt;= $iDateFrom)
        {
        array_push($aryRange,date(''Y-m-d'',$iDateFrom)); // first entry

        while ($iDateFrom&lt;$iDateTo)
            {
          $iDateFrom += 86400; // add 24 hours
          array_push($aryRange,date(''Y-m-d'',$iDateFrom));
            }
        }

    return $aryRange; //Returns to step 1 and adds another value into the array
    }
</code></pre>

<p>To get every date from my SQL Database and push them into a single array, this was used:</p>

<pre><code>$query = "SELECT startdate, enddate FROM classdetails";  
$results = mysql_query($query);

while ($arrays = mysql_fetch_array($results))
    {
    $aryDates = createDateRangeArray($arrays[''startdate''],$arrays[''enddate'']);
    echo "&lt;br /&gt;";
    }
</code></pre>

