<pre><code>function getMaxValues( $array, $total ) {
    arsort( $array );
    $count = 0;
    $return = array();   
    $total++;
    foreach ($array as $key =&gt; $value)  {
        if ( !in_array( $value, $return ) )
            $count++;        
        $return[ $key ] = $value;
        if ( $count == $total ) {
            array_pop($return);
            return $return;
        }
    }        
}
