The <code>this</code> inside the <code>success</code> handler is <strong>not</strong> the same <code>this</code> as your <code>click</code> handler.</p>

<p>I like to call it <code>self</code> - you can call it whatever you like.</p>

<p>Also, in your <code>success</code> handler, you should only perform a subsequent animation once the previous one has finished, so I modified that code to chain the fade sequence one after another.</p>

<pre><code>$(".action_button").click(function() {
  var id = $(this).attr("id");
  var self = this;
  var dataString = ''id=''+ id ;
  var parent = $(this).parent().parent();
  $.ajax({
      type: "POST",
      url: "action.php",
      data: dataString,
      cache: false,
      success: function()
      {
          if(id % 2)
          {
              parent.fadeOut(''fast'', function() {
                 $(self).fadeOut(''normal'', function() { 
                    $(self).fadeIn();
                 }); 
              });
          }
          else
          {
              parent.fadeOut(''fast'', function() { 
                 $(self).fadeIn(''normal'', function() { 
                    $(self).fadeOut();
                 }); 
              });
          }
       }
   });
});
</code></pre>
