<p>Any constructor method that accepts a parameter corresponding to a property should do nothing more than set that property to the specified value.</p>

<p>Quoting from <a href="http://rads.stackoverflow.com/amzn/click/0321246756" rel="nofollow"><em>Framework Design Guidelines</em> by Cwalina and Abrams</a>:</p>

<blockquote>
  <p><strong>Do</strong> use constructor parameters as shortcuts for setting main properties.</p>
  
  <p>There should be no difference in semantics between using the empty constructor followed by some property sets, and using a constructor with multiple arguments. The following three code samples are equivalent:</p>
</blockquote>

<pre><code>//1
EventLog applicationLog = new EventLog();
applicationLog.MachineName = "BillingServer";
applicationLog.Log = "Application";

//2
EventLog applicationLog = new EventLog("Application");
applicationLog.MachineName = "BillingServer";

//3
EventLog applicationLog = new EventLog("Application", "BillingServer");
</code></pre>

<p>Similar guidelines concerning constructors are also available online from MSDN <a href="http://msdn.microsoft.com/en-us/library/ms229060.aspx" rel="nofollow">here</a>.</p>
