<p>This is true whenever you close a disposable object and try and do something with it afterwards. For example writing to a file that''s closed, or executing a sql statement on a closed database connection. </p>

<p>To address this you have three options. </p>

<ol>
<li><p>Don''t make the Srv_LoginChannelFactory a field. Instead make it local to the button click. If this is the only place you are using it, this probably makes sense to do because it shortens the amount of time you are using an unmanaged resource.</p></li>
<li><p>Implement IDisposable (you are supposed do this whenever you have field that is Disposable) don''t close Srv_LoginChannelFactory except in Login.Dispose.</p></li>
<li><p>Change the button click to check the State of Srv_LoginChannelFactory before you try and create a channel with it. You still need to implement IDisposable in case the button click doesn''t happen. </p></li>
</ol>

<p><strong><em>Note</em></strong>: <a href="http://msdn.microsoft.com/en-us/library/system.servicemodel.channelfactory.ensureopened.aspx" rel="nofollow">EnsureOpened</a> looks like it could be used to check the state, but it only works before its opened. Once its been closed it will throw.</p>

<p>Regarding Close() being the same as Dispose. </p>

<p>From the section ''Customizing a Dispose Method Name'' in <a href="http://msdn.microsoft.com/en-us/library/b1yfkh5e.aspx" rel="nofollow">Implementing Finalize and Dispose to Clean Up Unmanaged Resources</a> in the Design Guidelines for Developing Class Libraries</p>

<blockquote>
  <p>Occasionally a domain-specific name is
  more appropriate than Dispose. For
  example, a file encapsulation might
  want to use the method name Close. In
  this case, implement Dispose privately
  and create a public Close method that
  calls Dispose. The following code
  example illustrates this pattern. You
  can replace Close with a method name
  appropriate to your domain. This
  example requires the System namespace.</p>
</blockquote>

<p>The idea here is to give parity to the Open method. Personally I think it causes a lot of confusion, but I can''t think of anything better (CloseAndDispose?)</p>
