<p>A real life example. For my testing utilities I''d like to create a structure like this:</p>

<pre><code>getTime(1000) {
  // Stuff I want to repeat 1000 times.
} after { (n, t) =&gt; 
  println("Average time: " + t / n)
}
</code></pre>

<p><strong>EDIT</strong>:</p>

<p>Finally I came up with this solution:</p>

<pre><code>object MyTimer {
  def getTime(count: Int)(action : =&gt; Unit): MyTimer = {
    val start = System.currentTimeMillis()
    for(i &lt;- 1 to count) { action }
    val time = System.currentTimeMillis() - start
    new MyTimer(count, time)
  }
}

class MyTimer(val count: Int, val time: Long) {
  def after(action: (Int, Long) =&gt; Unit) = {
    action(count, time)
  }
}

// Test
import MyTimer._

var i = 1
getTime(100) {
  println(i)
  i += 1
  Thread.sleep(10)
} after { (n, t) =&gt; 
  println("Average time: " + t.toDouble / n)
}
</code></pre>

<p>The output is:</p>

<pre><code>1
2
3
...
99
100
Average time: 10.23
</code></pre>

<p>It is mostly based on the answer by <strong>Thomas Lockney</strong>, I just added the companion object to be able to <code>import MyTimer._</code></p>

<p>Thank you all, guys.</p>
