<p>Compare this to a chef in a kitchen. If he is writing a cookbook, he cannot simply say "John''s Special Chili" - he must write down what ingredients are used, what procedure is used to cook or prepare the various ingredients, what quantities to use, etc.</p>

<p>Likewise, a computer scientist must take an abstract problem, and break it down into instructions that a machine can use to arrive at the correct output, given an input of the problem. This act of breaking a larger problem, often down into smaller problems before finally arriving at code, is a fundamental skill for any programmer, and quite possibly the hardest skill to teach, as it relies on the problem-solving abilities of an individual.</p>

<p>Algorithms are essentially the result of solving a problem: an algorithm, as defined by Wiktionary, is "A precise step-by-step plan for a computational procedure that begins with an input value and yields an output value in a finite number of steps." It''s the method by which you go from an input to an output, and it''s typically what programmers must figure out. Some problems are of course already solved: sorting, being an example typically given to early students, has a known algorithm: typically you''re just implementing this in a particular language.</p>

<p>Once the basics have been passed, often the problem is unique. It is then up to the programmer to work out the algorithm. Common advice given is to "break the problem down into smaller, easier to solve sub-problems" - often two (or more) smaller problems are equivalent to your larger problem. If we wanted to solve the problem of "flip a image file upside down", I might break it into:</p>

<ol>
<li>Load the image</li>
<li>Flip the rows of pixels in the image</li>
<li>Write the resulting image back into a file</li>
</ol>

<p>Each of those are still very abstract, and would need to be fleshed out further, but the idea is the same: keep breaking it apart, until the idea is simple enough to translate into code. Depending on what language you''re using, the human form of the problem will translate differently. I would not write the same code in C or C++ as I would in Python, or Java, etc.</p>

<p>(PS: The question is difficult to understand, so if this doesn''t answer what you''re asking, or if something in it is unclear, please comment as such.)</p>
