<p>but I can''t see any evidence that you''re using any formatting at all - and indeed you <em>shouldn''t</em>. A <code>DateTime</code> doesn''t have any inherent format, any more than a number does. Just as you can view the same number in hex or decimal, you can view the same date and time in various ways.</p>

<p>You''re already passing the <code>DateTime</code> to the database directly rather than in a particular format, which is correct (normally questions about date/time formatting and databases are about people not using parameterized queries). You shouldn''t need to worry about the formatting at all.</p>

<p>Possibilities:</p>

<ul>
<li>Your data is getting corrupt elsewhere, and you''ve actually got a date before 1753</li>
<li>Your SQL statement is using the wrong value</li>
<li>There''s something wrong with your database driver (you haven''t said which database you''re using; is it SQL Server?)</li>
</ul>
