<p>Also, I saw a reference to that in an issues about this in a <a href="http://www.ruby-forum.com/topic/187997#955009" rel="nofollow">ruby forum thread</a>, especially towards the bottom. If you are just getting started, then there probably isn''t a need to support the newest version of Ruby, which has some issues with libraries compiled with previous versions of Ruby.</p>

<blockquote>
  <p>You can define a gem to be targeted at one version of Ruby (using gem
  spec required_ruby_version attribute), however, you can''t generate a
  binary gem that target both 1.8.x and 1.9.x series of Ruby.</p>
  
  <p>There are binary differences between 1.8.x and 1.9.x (different C-API,
  different VM, etc) that made these pre-compiled extensions
  incompatible.**</p>
