<p>This selects all businesses that are in either one of the categories. To select only those in both categories, you could append a</p>

<pre><code>HAVING COUNT(*) = 2
</code></pre>

<p>The method you are using (three tables to represent a m:n relationship) is the standard way to solve this task, you can keep that.</p>

<p>Personally, I would not use "hungarian notation" for table names (i.e. no "tbl") and I would not use plural table names (i.e. not "Tags"), especially when the other tables are not plural either.</p>

<hr>

<p><em>Answering the first comment below:</em></p>

<p>For larger data sets, the performance of this query relies on indexes. All the primary keys need an index, naturally. In <code>tblBusinessTagLink</code> you should have a composite index covering both fields and one additional index for the field that does not come first in the composite index.</p>

<p>The <code>WHERE keywords LIKE ''%technology%''</code> idea is a bad one, mostly because for any LIKE conditions other than start-of-field searches an index cannot be used (i.e. performance will degrade rapidly as your data set grows) and partly because it should be <code>WHERE '',''+keywords+'','' LIKE ''%,technology,%''</code> to begin with or you will get partial matches/false positives.</p>

<p>Also, it might be a bit more efficient to query by <code>TagId</code>. This way you can remove one table from the JOIN entirely: </p>

<pre><code>FROM 
  tblBusiness AS b 
  INNER JOIN tblBusinessTagLink AS l ON l.BusinessId = b.BusinessId 
WHERE 
  l.TagId IN (1, 2)
</code></pre>

<p>If you intend to query by <code>TagName</code> however, an index on this field will be absolutely necessary as well.</p>
