<p>However to make your life easier when you have a 64-bit system (on 32-bit system this won''t work in your particular scenario) it makes sense to employ memory-mapped file. With file API you need to copy the tail in a tricky way. With MMF you do the following: 
1. Create a file mapping and map the file to memory
2. Move the tail further by moving the memory block using memmove or similar function which cares for overlapping blocks. 
3. put your bytes in the middle. </p>

<p>With this approach memory manager will do most work for you. </p>
