<p>Generally it''s a bad practise to restrict implementation of dependencies this way, you should use interface (<code>EmployeeDao</code>) when declaring dependencies instead. If you follow that way, you also don''t need <code>proxy-target-class = "true"</code> on <code>&lt;tx:annotation-driven&gt;</code>.</p>

<p>Alternative solution is to enable target class proxying for <code>PersistenceExceptionTranslationPostProcessor</code>.</p>

