<pre><code>var vTimer:Timer; new Timer(10)
</code></pre>

<p>There are two statements there: the first says there''s going to be a Timer named vTimer, the second creates a new Timer with a 10ms interval. I expect you meant for there to be a single statement which would create the Timer and assign it to vTimer. So it should be:</p>

<pre><code>var vTimer:Timer = new Timer(10);
</code></pre>

<p><strike>I haven''t looked closely at the rest of the code but I hope this gets you on track.</strike></p>

<p><strong>edit:</strong> Looking more closely at the rest of your code I see quite a few issues. </p>

<p>Given the timer setup, <code>vTimer</code> will call <code>MovementTimer</code> every 10ms. 100 times a second. Inside each call to <code>MovementTimer</code> you''re adding a new listener for <code>KEY_DOWN</code>, so after 1 second there will be 100 calls to <code>Acceleration</code> when you press a key.</p>

<p>You should move your key handler functions and listener assigments outside of your timer function. It looks like you''re trying to implement a pattern where the key listeners set a flag (<code>vLeft</code> etc) and the timer applies acceleration on each tick. That''s a good pattern but you have quite a few corrections to make before it will work.</p>

<p>Here''s the basic structure I''d use for the listeners and key flags:</p>

<pre><code>var left:Boolean = false;
var right:Boolean = false;

stage.addEventListener(KeyboardEvent.KEY_DOWN, onKeyDown);
stage.addEventListener(KeyboardEvent.KEY_UP, onKeyUp);

function onKeyDown(event:KeyboardEvent):void {
  if (event.keyCode == Keyboard.LEFT) {
    left = true;
  }
  else if (event.keyCode == Keyboard.RIGHT) {
    right = true;
  }
}
function onKeyUp(event:KeyboardEvent):void {
  if (event.keyCode == Keyboard.LEFT) {
    left = false;
  }
  else if (event.keyCode == Keyboard.RIGHT) {
    right = false;
  }
}

var timer:Timer = new Timer(10);
timer.addListener(TimerEvent.TIMER, onTimer);

function onTimer(event:TimerEvent):void {
  if (left) {
    // do left acceleration things
  }
  else {
    // deceleration things
  }
  if (right) {
    // do right acceleration things
  }
  else {
    // deceleration things
  }
  // apply movements
}
</code></pre>

<p>I haven''t tested this code but hopefully it''s clear how it differs from your own code. After you have this working you should be able to tune your acceleration/deceleration with meaningful values again.</p>

<p>A couple of other things to note / think about:</p>

<ul>
<li>Assigning a value to itself doesn''t do anything, so you can remove the part where you say <code>vMove = vMove</code></li>
<li>You use a lot of unnecessary blocks (the parts between <code>{</code> and <code>}</code>) around simple statements. In actionscript (and javascript) these don''t change the scope of variables except in classes and class functions, so you can remove them unless they''re needed for if/else statements.</li>
<li>your key up handler sets <code>vLeft</code> and <code>vRight</code> both to false. What happens if I press both the left key and the right key but I only release one of them?</li>
</ul>

<p>Once you''re happy with your code you should look around for a library to handle the key polling for you. A quick Google search suggests <a href="http://code.google.com/p/bigroom/wiki/KeyPoll" rel="nofollow">http://code.google.com/p/bigroom/wiki/KeyPoll</a> would help you avoid spaghetti code when you want to support other key presses in the same way.</p>
',NULL,NULL,NULL,NULL,216397,4573653,'2011-01-02T06:07:15.910',2,NULL,NULL,2,NULL,NULL,2,216397,NULL,'2011-01-01T09:25:25.823',NULL,4573661,'2011-01-02T06:07:15.910');

