<ul>
<li>You need to initialise <code>@rowno</code> by adding <code>set @rowno = 0</code> before the query.</li>
<li>You''re missing an <code>as</code> in <code>@rowno:=@rowno+1 <code>rn</code></code>.</li>
<li>The <code>(SELECT @rownum:=0) r</code> is superfluous, unless you meant this to be the initialisation for <code>@rowno</code> in which case you misspelt it.</li>
</ul>

<p>This should work:</p>

<pre><code>SET @rowno = 0;
SELECT @rowno:=@rowno+1 as `rn`, `id`, `title`, `topic` 
FROM stories 
