<p>This assume there is a maximum of 30 possible groups, as bit-0 is specific, and bit-31 is reserved.</p>

<p>The security is coded on an <code>unsigned int</code>, meaning 32 bits, of which bit0 to bit31 have a special meaning.</p>

<ul>
<li>the LSb, bit0, if set to <code>1</code> allows any friend the read access.</li>
<li>if bit0 is <code>0</code>, it means that the next 30 bits, bit1 to 30, are checked to see if the group <code>i</code> (from bit <code>i</code>) has read access (bit set to <code>1</code>) or no (bit set to <code>0</code>).</li>
</ul>

<p>An <code>unsigned int</code> can be represented as</p>

<pre><code>  bit 31                     bit 0
  v                              v
  bbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbb
</code></pre>

<p>for instance the decimal value of 11 (0...01011, or 8+3) is represented as</p>

<pre><code>  00000000000000000000000000001011
</code></pre>

<p>where bit 0, 1 and 3 are set to 1, the others are set to 0.</p>

<p>So, to check if a <em>friend</em> has access to a journal, take the journal access bits, for instance</p>

<pre><code>  11000000000000000000000000001011
</code></pre>

<p>you see that the first bit is 1, so all groups (all friends) are authorized.</p>

<p>If the access would be</p>

<pre><code>  11000000000000000000000000001010
</code></pre>

<p>the first bit is 0, so you have to check the group number against the access above. Say the group number is 1, you check against the access above</p>

<pre><code>  11000000000000000000000000001010
                                1
                                ^
                        group one
</code></pre>

<p>and you see that the group 1 is authorized. If you would have</p>

<pre><code>  11000000000000000000000000001000
</code></pre>

<p>the group 1 is <em>not</em> authorized.</p>

<p>For groups 3 and 30, the access is also authorized:</p>

<pre><code>  11000000000000000000000000001000
   *                          *
</code></pre>

<p>(The MSb. bit31 is set to <code>1</code>, but its value is reserved, so you shouldn''t bother its value)</p>
