<p><em>You</em> know it''s a <code>double[4][4]</code>, but the compiler sees <code>double(*)[4]</code> in the function paramter list, which notably has no array size constraint. It turns your 2D array of 4 by 4 objects into a pointer to a 1D array of 4 objects, and the pointer can be validly indexed as if it were an array of 4 objects.</p>

<p>I would pass all <code>mat4</code> objects by pointer:</p>

<pre><code>void mprod4(mat4 *r, const mat4 *a, const mat4 *b);
// and, if you don''t want to hairy your syntax
#define mprod4(r, a, b) (mprod4)(&amp;r, (const mat4 *)&amp;a, (const mat4 *)&amp;b)
</code></pre>

<p>This will (I believe) ensure const correctness <em>and</em> array size correctness. It may make <code>mprod4</code> a bit harder to write, and still involves some hairy casts, but it''ll (IMHO) be worth it (especially after the macro above):</p>

<pre><code>void mprod4(mat4 *r, const mat4 *a, const mat4 *b)
{
    // all indexing of the matricies must be done after dereference
    for(int i = 0; i &lt; 4; i++) for(int j = 0; j &lt; 4; j++)
      {
        (*r)[i][j] = (*a)[i][j] * (*b)[i][j];
        // you could make it easier on yourself if you like:
        #define idx(a, i, j) ((*a)[i][j])
        idx(r, i, j) = idx(a, i, j) * idx(b, i, j)
      }
}
</code></pre>

<p>It may look a bit bad when you write it, but I think it''ll be cleaner type-wise. (Maybe I''ve been thinking C++ too much...)</p>
