<p>I haven''t got a C99 compiler handy but I remember reading something in the C99 specification regarding qualifiers within the <code>[]</code> for arrays as arguments. You can also put <code>static</code> in there (e.g. <code>ma[static 4]</code>) but of course that means something else.</p>

<h3>Edit</h3>

<p>Here it is, section 6.7.3.5 paragraph 7.</p>

<blockquote>
  <p>A declaration of a parameter as &ldquo;array of type&rdquo; shall be adjusted to &ldquo;qualified pointer to type&rdquo;, where the type qualifiers (if any) are those specified within the <code>[</code> and <code>]</code> of the array type derivation. If the keyword <code>static</code> also appears within the <code>[</code> and <code>]</code> of the array type derivation, then for each call to the function, the value of the corresponding actual argument shall provide access to the first element of an array with at least as many elements as specified by the size expression.</p>
</blockquote>
