<pre><code>Graphics g = image.getGraphics();
g.setClip(shape);
</code></pre>

<p>You can then apply the filter on the whole graphics (image) but it will only be applied to the clipping area.</p>

<hr>

<p>The code below will produce this image:</p>

<p><img src="http://i.stack.imgur.com/Nkv5d.png" alt="Examples of clips"></p>

<pre><code>public static void main(String[] args) throws Exception {

    BufferedImage image = new BufferedImage(400, 400, BufferedImage.TYPE_INT_ARGB);
    Graphics2D g = (Graphics2D) image.getGraphics();

    // set "user defined" clip
    g.setClip(new Polygon(
            new int[] { 50, 100, 50 }, 
            new int[] { 50, 50, 100 },
            3));
    g.fillRect(0, 0, 400, 400);

    // set an ellipse
    g.setClip(new Ellipse2D.Double(100, 100, 200, 200));
    g.fillRect(0, 0, 400, 400);

    // set an rectangle
    g.setClip(new Rectangle(300, 300, 50, 50));
    g.fillRect(0, 0, 400, 400);

    g.dispose();
    ImageIO.write(image, "png", new File("test.png"));
}
</code></pre>
