<p>What you need to do is first replace every print statement with a call to a function that does the same thing:</p>

<pre><code>import sys
def _print(*args, **kw):
    sep = kw.get(''sep'', '' '')
    end = kw.get(''end'', ''\n'')
    file = kw.get(''file'', sys.stdout)
    file.write(sep.join(args))
    file.write(end)

def foo():
   # print "whatever","you","want"
   _print("whatever","you","want")
</code></pre>

<p>Then the second step is to stop using the _print function directly and make it a keyword argument:</p>

<pre><code>def foo(_print=_print):
    ...
</code></pre>

<p>and make sure to change all internal function calls to pass the _print function around.</p>

<p>Now all the existing code will continue to work and will use print, but you can pass in whatever _print function you want.</p>

<p>Note that the signature of _print is exactly that of the print function in more recent versions of Python, so as soon as you  upgrade you can just change it to use <code>print()</code>. Also you may get away with using 2to3 to migrate the print statements in the existing code which should reduce the editing required.</p>
