<pre><code>0xD800 == 0b1101_1000_0000_0000
0xDBFF == 0b1101_1011_1111_1111
</code></pre>

<p>What this test really does is to mask out the lower ten bits. This is usually written as</p>

<pre><code>onlyHighBits = x &amp;~ 0x03FF
</code></pre>

<p>After this operation ("and not") the lower ten bits of <code>onlyHighBits</code> are guaranteed to be zero. That means that if this number equals the lower range of the interval now, it has been somewhere in the interval before.</p>

<p>This trick works in all cases where the lower and the higher limit of the interval start with the same digits in binary, and at some point the lower limit has only zeroes while the higher limit has only ones. In your example this is at the tenth position from the right.</p>
