<p>As far as I can tell, the only chance you have is to use the <code>pg_advisory_lock()</code> function. <br/>
<a href="http://www.postgresql.org/docs/current/static/functions-admin.html#FUNCTIONS-ADVISORY-LOCKS" rel="nofollow">http://www.postgresql.org/docs/current/static/functions-admin.html#FUNCTIONS-ADVISORY-LOCKS</a></p>

<p>But this requires a "manual" release of the locks obtained through it. You won''t get an automatic unlocking with that.</p>

<p>To lock the rows you would need something like this: </p>

<pre>
select pg_advisory_lock(id), * 
from 
( 
  select * table1 order by id limit 5
) t
</pre>

<p>(Note the use of the derived table for the LIMIT part. See the manual link I posted for an explanation)</p>

<p>Then you need to store the retrieved IDs and later call <code>pg_advisory_unlock()</code> for each ID.<br/></p>

<p>If each process is always releasing <strong>all</strong> IDs at once, you could simply use <code>pg_advisory_unlock_all()</code> instead. Then you will not need to store the retrieved IDs.</p>

<p>Note that this will <strong>not</strong> prevent others from reading the rows using "normal" selects. It will only work if every process that accesses that table uses the same pattern of obtaining the locks.</p>
