<p>Adding a WHERE won''t help usually for <code>select *</code> query too.</p>

<p>What you can check is index and statistics maintenance. Do you do any? Here''s a <a href="http://www.google.co.uk/search?q=sql+server+index+maintenance+best+practice" rel="nofollow">Google search</a></p>

<p>Or change how you use the data...</p>

<p>Edit:</p>

<p>Why a WHERE clause usually won''t help...</p>

<p>If you add a WHERE that is not the PK..</p>

<ul>
<li>you''ll still need to scan the table unless you add an index on the searched column</li>
<li>then you''ll need a key/bookmark lookup unless you make it covering</li>
<li>with SELECT * you need to add all columns to the index to make it covering</li>
<li>for a many hits, the index will probably be ignored to avoid key/bookmark lookups.</li>
</ul>

<p>Unless there is a network issue or such, the issue is reading all columns <em>not</em> lack of WHERE</p>

<p>If you did <code>SELECT col13 FROM MyTable</code> and had an index on <code>col13</code>, the index will probably be used.</p>

<p>A <code>SELECT * FROM MyTable WHERE DateCol &lt; ''20090101''</code> with an index on <code>DateCol</code> but matched 40% of the table, it will probably be ignored or you''d have expensive key/bookmark lookups</p>
