<p>Personally I would write an HTML helper for this task to avoid the tag soup in the views:</p>

<pre><code>public static MvcHtmlString Comment(this HtmlHelper&lt;YourModelType&gt; htmlHelper)
{
    var model = htmlHelper.ViewData.Model;
    if (model.CountryId == 1)
    {
        return MvcHtmlString.Create(model.LocalComment);
    } 
    else if (model.CountryId == 2)
    {
        return MvcHtmlString.Create(model.IntComment);
    }
    return MvcHtmlString.Empty;
}
</code></pre>

<p>And then in your view simply:</p>

<pre><code>&lt;%= Html.Comment() %&gt;
</code></pre>
