don''t / can''t give a solution I would be grateful for tips. For example,
I know that there is a correlation between the ordered represantions of the
sum of an integer and ordered set partitions but that alone does not help me in
finding the solution. So here is the description of the function I need:</p>

<p><br></p>

<h2>The Task</h2>

<p>Create an efficient* function</p>

<pre><code>List&lt;int[]&gt; createOrderedPartitions(int n_1, int n_2,..., int n_k)
</code></pre>

<p>that returns a list of arrays of all set partions of the set 
<code>{0,...,n_1+n_2+...+n_k-1}</code> in <code>number of arguments</code> blocks of size (in this 
order) <code>n_1,n_2,...,n_k</code> (e.g. <code>n_1=2, n_2=1, n_3=1 -&gt; ({0,1},{3},{2}),...</code>).</p>

<p>Here is a usage example:</p>

<pre><code>int[] partition = createOrderedPartitions(2,1,1).get(0);
partition[0]; // -&gt; 0
partition[1]; // -&gt; 1
partition[2]; // -&gt; 3
partition[3]; // -&gt; 2
</code></pre>

<p>Note that the number of elements in the list is
<code>(n_1+n_2+...+n_n choose n_1) * (n_2+n_3+...+n_n choose n_2) * ... *
(n_k choose n_k)</code>. Also, <code>createOrderedPartitions(1,1,1)</code> would create the 
permutations of <code>{0,1,2}</code> and thus there would be <code>3! = 6</code> elements in the
list.</p>

<p>
* by efficient I mean that you should not initially create a bigger list
like all partitions and then filter out results. You should do it directly.
</p>

<h3>Extra Requirements</h3>

<p>If an argument is 0 treat it as if it was not there, e.g.
<code>createOrderedPartitions(2,0,1,1)</code> should yield the same result as
<code>createOrderedPartitions(2,1,1)</code>. But at least one argument must not be 0.
Of course all arguments must be >= 0.</p>

<h3>Remarks</h3>

<p>The provided pseudo code is quasi Java but the language of the solution 
doesn''t matter. In fact, as long as the solution is fairly general and can 
be reproduced in other languages it is ideal.</p>

<p>Actually, even better would be a return type of <code>List&lt;Tuple&lt;Set&gt;&gt;</code> (e.g. when
creating such a function in Python). However, then the arguments wich have
a value of 0 must not be ignored. <code>createOrderedPartitions(2,0,2)</code> would then
create </p>

<pre><code>[({0,1},{},{2,3}),({0,2},{},{1,3}),({0,3},{},{1,2}),({1,2},{},{0,3}),...]
</code></pre>

<p><br></p>

<h2>Background</h2>

<p>I need this function to make my mastermind-variation bot more efficient and
most of all the code more "beautiful". Take a look at the <code>filterCandidates</code>
function in <a href="https://github.com/eugenkiss/Mastermind/blob/fc25378f7692d91eaa6c40d1ebce2493c4be59cc/strategies/eugen.lua#L65" rel="nofollow">my source code</a>. There are unnecessary
/ duplicate queries because I''m simply using permutations instead of
specifically ordered partitions. Also, I''m just interested in how to write
this function.</p>

<p><br></p>

<h2>My ideas for (ugly) "solutions"</h2>

<p>Create the powerset of <code>{0,...,n_1+...+n_k}</code>, filter out the subsets of size 
<code>n_1, n_2</code> etc. and create the  cartesian product of the n subsets. However 
this won''t actually work because there would be duplicates, e.g. 
<code>({1,2},{1})...</code></p>

<p>First choose <code>n_1</code> of <code>x = {0,...,n_1+n_2+...+n_n-1}</code> and put them in the
first set. Then choose <code>n_2</code> of <code>x without the n_1 chosen elements
beforehand</code> and so on. You then get for example <code>({0,2},{},{1,3},{4})</code>. Of
course, every possible combination must be created so <code>({0,4},{},{1,3},{2})</code>,
too, and so on. Seems rather hard to implement but might be possible.</p>

<p><br></p>

<h2>Research</h2>

<p>I guess <a href="http://www.codecogs.com/code/maths/discrete/combinatorics/permutations/partition.php" rel="nofollow">this</a> 
goes in the direction I want however I don''t see how I can utilize it for my
specific scenario.</p>

<p><a href="http://rosettacode.org/wiki/Combinations" rel="nofollow">http://rosettacode.org/wiki/Combinations</a></p>
',403,NULL,NULL,NULL,283607,NULL,'2011-01-02T12:47:48.330',1,1,4578820,0,NULL,'(Ordered) Set Partitions in fixed-size Blocks',1,283607,'<language-agnostic><math><recursion><combinatorics>','2011-01-01T11:12:03.187',1,4573871,'2011-01-03T18:41:34.190');

<p><a href="http://ocw.mit.edu/courses/electrical-engineering-and-computer-science/6-042j-mathematics-for-computer-science-fall-2005/lecture-notes/" rel="nofollow">http://ocw.mit.edu/courses/electrical-engineering-and-computer-science/6-042j-mathematics-for-computer-science-fall-2005/lecture-notes/</a></p>

<p>I would say that you at least need everything mentioned in the 1st course "mathematics for computer science" (week 12-14). These topics have been very important for me for Algorithm Analysis, and will be the foundation if you want to learn the more advanced stuff in the 2nd course (as well as some calculus).
The second course I wouldnt say you necessarily need, it depends on which direction you want to go, e.g. you will probably need it if you want to get into machine learning. (I am myself at the level where I need to learn a lot of the stuff from the 2nd course, so I don''t know much about it''s applicability beyond what I wrote)</p>

<p>As to actually learning it, I''ve used Kenneth Rosen''s book "Discrete Mathematics and it''s applications", which is a nice book because it has a lot of exercises, with answers in the back for half of them. Exercises are really what''s needed to learn this material, reading will only get you halfway. </p>

<p>The book "Algorithm Design" by Jon Kleinberg and Eva Tardos is a nice book after having learnt some of it, to actually try and apply it in computer science. It has a chapter on randomized algorithms where probability theory is used extensively. Another suggestion for this would be "Introduction to Algorithms" by Leiserson, Cormen, Rivest and Stein.</p>

<p>As for the more advanced probability theory, I''m currently reading "Probability and Statistics for Computer Science" by James L. Johnson, but I''m not completely sold on that book yet (I have only read the 1st 100 pages so far).</p>
