<p>Assume it is possible to generate a non-biased integer from 1-k inclusive in O(1) time. Also assume that O(1) element access/mutation is possible, and that it is possible to create a new list of size k in O(k) time.</p>

<p>In particular, I would be interested in a ''generative'' algorithm. That is, I would be interested in an algorithm that has O(1) initial overhead, and then produces a new element for each slot in the list, taking O(1) time per slot.</p>

<p>If no solution exists to the problem as described, I would still like to know about solutions that do not meet my constraints in one or more of the following ways (and/or in other ways if necessary):</p>

<ul>
<li>the time complexity is worse than O(n).</li>
<li>the algorithm is biased with regards to the final positions of the symbols.</li>
<li>the algorithm is not generative.</li>
</ul>

<p>I should add that this problem appears to be the same as the problem of randomly sorting the integers from 1-k, since we can sort the list of integers from 1-k and then for each integer <em>i</em> in the new list, we can produce the symbol ai.</p>
',134,NULL,NULL,NULL,NULL,NULL,NULL,4,2,4573915,4,NULL,'Randomly sorting an array',1,2045611,'<language-agnostic><sorting><random>','2011-01-01T11:30:44.437',3,4573911,'2011-01-01T11:52:27.793');

<ul>
<li>Since you are using double quotes for the regex,
you need to escape the <code>$</code> using two <code>\</code> as <code>\\$</code>.
Alternatively you can just use single
quote and use <code>\$</code>.</li>
<li>You are using <code>$1</code> in the replacement
but you are not having any group in
the regex. So have <code>(  )</code> around
<code>\$\w+</code></li>
</ul>

<p>So try:</p>

<pre><code>$str = preg_replace(''/(\$\w+)/'', "&lt;span&gt;$1&lt;/span&gt;", $str);
</code></pre>

<p>or</p>

<pre><code>$str = preg_replace("/(\\$\w+)/", "&lt;span&gt;$1&lt;/span&gt;", $str);
</code></pre>

