<p>Whether <code>*~</code> is some special bash pattern is not relevant for most makefiles, as /bin/sh is used by default to execute make recipes. Only if SHELL is set in the makefile will a different shell be used.</p>

<p>An easy way to see make''s implicit rules is to run <code>make -p</code> in a directory without a makefile. You will get an error saying no targets specified, but make will also print out the implicit rules it is using. If you grep this output for a tilde, you''ll see there are no implicit rules that name files with it.</p>
