<p>You can think of <code>&lt;%= yield %&gt;</code> as a placeholder for rendered view content in a layout file. If you render just the layout, there''s nothing to be put in there.</p>

<p><a href="http://guides.rubyonrails.org/layouts_and_rendering.html#understanding-yield" rel="nofollow">http://guides.rubyonrails.org/layouts_and_rendering.html#understanding-yield</a></p>

<p><strong>Alternative solution</strong></p>

<p>Add this to top of your controller to disable layouts for ajax requests:</p>

<pre><code>layout Proc.new { |controller| controller.request.xhr? ? false : ''application'' }
</code></pre>

<p>This will make all links inside of <code>#header</code> load with ajax and place the result to <code>#content</code> div:</p>

<pre><code>$(function() {
    $(''#header a'').live(''click'', function() {
        $(''#content'').load(this.href);
        return false;
    });
});
</code></pre>

<p>Remove js format from your controller actions because that''s not needed anymore.</p>
