<pre>
pcap_t *handle = pcap_open_live(...);
</pre>

<p>using <code>&amp;handle</code> will be of type <code>pcap_t **</code>, but your thread function casts it back (the cast by the way is also pointless/redundant) to <code>pcap_t *</code>, which leads to undefined behavior when using it, and is usually going to go wrong. Better:</p>

<pre>
static void *pcap_looper(void *arg)
{
        pcap_t *handle = arg;

        /* etc. */

        return NULL;
}

int main(void)
{
        pcap_t *handle;
        pthread_t tid;
        int ret;

        handle = pcap_open_live(...);
        ret = pthread_create(&tid, NULL, pcap_looper, handle);
        ...
        pthread_join(tid, NULL);
        return EXIT_SUCCESS;
}
</pre>
