<p>The problem is that you have to be extremely careful to avoid race conditions and other synchronisation problems. For instance, your GUI framework library is probably not expecting to be called from multiple threads, and so your <code>//show packets here</code> routine may confuse it a lot.</p>

<p>Instead I would suggest, if possible, reading the packets from the main thread. You don''t say which GUI framework you''re using; since you''re using C++ I''ll assume Qt since that''s quite common, but all other frameworks have similar functionality.</p>

<p>What you need to do is:</p>

<ul>
<li>Call pcap_setnonblock() to put the capture descriptor in non-blocking mode</li>
<li>Call pcap_get_selectable_fd() to get a file descriptor to monitor for events</li>
<li>Use a <a href="http://doc.qt.nokia.com/4.6/qsocketnotifier.html" rel="nofollow">QSocketNotifier</a> object (passing the file descriptor from the previous step as the socket parameter) to monitor the file descriptor for events</li>
<li>When the event fires, call pcap_dispatch() to dispatch packets</li>
<li>For maximum portability, also call pcap_dispatch() on a timer, because select() doesn''t work well on pcap sockets on some OSs.</li>
</ul>

<p>(As to why your code is currently crashing - note that you probably want to pass <code>handler</code> rather than <code>&amp;handler</code> as the parameter to <code>pthread_create()</code>. But just fixing that may lead to strange unreliability later - so going single-threaded is almost certainly the way forward!)</p>
