<pre><code>a.cc:41: error: declaration of ‘class L’
a.cc:26: error:  shadows template parm ‘class L’
</code></pre>

<p>This means that in line 41, you introduce a template parameter L; in my copy, this refers to </p>

<pre><code>template &lt;class L&gt; friend ostream &amp; operator&lt;&lt;(ostream&amp; os,
               const LinkedList&lt;L&gt; listToprint);//error two
</code></pre>

<p>And that declaration shadows the template parameter in line 26:</p>

<pre><code>template &lt;class L&gt;//error one
class LinkedList
</code></pre>

<p>You need to rename the template parameter in the friend declaration.</p>

<p><strong>Edit</strong>: The relevant language specification is 14.6.1/7</p>

<blockquote>
  <p>A template-parameter shall not be
  redeclared within its scope (including
  nested scopes). A template-parameter
  shall not have the same name as the
  template name.</p>
</blockquote>

<p>When you refer to <code>L</code> in <code>const LinkedList&lt;L&gt; listToprint</code>, it''s not clear whether you mean the L of the friend or the L of the class. So write</p>

<pre><code>template &lt;class L1&gt; friend ostream &amp; operator&lt;&lt;(ostream&amp; os,
    const LinkedList&lt;L1&gt; listToprint);
</code></pre>
