',1428,NULL,NULL,NULL,220819,NULL,'2011-01-03T04:06:43.740',0,3,NULL,3,NULL,'Problems with variadic macros in C',1,559751,'<c><preprocessor>','2011-01-01T12:00:54.340',2,4573981,'2011-01-03T04:06:43.740');

<p>You are having tight loops somewhere in your code.  Despite low priority (if you used it) - if you have a loop that doesn''t release the control back to the kernel thread scheduler it will consume all of the CPU until control is TAKEN from it.  For example you can have:</p>

<pre><code>while (!_shouldStop)
{
    DoProcessing();
}
</code></pre>

<p>This really <em>IS</em> bad, because it will certainly use all of your CPU.</p>

<p>To solve this, easiest way is to use either Sleep(100) or Sleep(0) inside your loop, something like:</p>

<pre><code>while (!_shouldStop)
{
    DoProcessing();
    Thread.Sleep(0);
}
</code></pre>

<p>There are also better (and somehow more complicated ways) to do this - events for example - but for start, your app will behave much better with that here.</p>
