<p>Change the ''x'' to ''wpf'' for instance and you will see that you need to change all the ''x:'' prefixes in your code to ''wpf:'' to make it compile.</p>

<p>The ''c:'' prefix references code of your own. Say you have a class library that compiles to MyLib.dll. This library contains a class named MyData. To be able to reference the MyData class you need something like:</p>

<pre><code>xmlns:c="clr-namespace:MyClasses;assembly=MyLib"
</code></pre>

<p>in your XAML header.</p>

<p>You can then reference the MyData class in you XAML with c:MyData. But you are entirely free to change the ''c'' to ''myfabulousclasses'' or anything else you fancy.</p>

<p>The purpose of this? To distinguish classes or members that have the same name, but belong to different dll''s.</p>
