',NULL,NULL,NULL,NULL,NULL,4573952,NULL,2,NULL,NULL,3,NULL,NULL,2,23388,NULL,'2011-01-01T12:07:40.380',NULL,4573993,'2011-01-01T12:07:40.380');

<p>The problem with this is that <code>CALL</code> is a macro, and you <strong>cannot</strong> nest variadic macro invocations within a <code>##__VA_ARGS__</code> list.</p>

<p>The reason why it works when the inner macro is passed as a named argument is because the preprocessor will parse named arguments for inner macros, but not <code>##__VA_ARGS__</code> lists, where there is just simple token substitution.</p>

<p>One way to solve this is to assign the result of the inner <code>CALL</code> to a placeholder variable and then pass that along to the macro.</p>

<pre><code>int main() {
   CALL(func2, CALL(func1, false), false);

   bool result = CALL(func1, false);
   CALL(func2, false, result);
}
</code></pre>

<p>Another way to solve this is to just use <code>__VA_ARGS__</code> as the only argument to the <code>func</code> function, and that would allow you to pass in nested macro invocations, like so:</p>

<pre><code>#define CALL(func, ...) func(__VA_ARGS__)

int main() {
   CALL(func2, false, CALL(func2, false, false));
}
</code></pre>

<hr>

<p>Let''s analyze your dilemma in a bit more detail:</p>

<pre><code>CALL(func2, false, CALL(func1, false))
</code></pre>

<p>In this particular macro invocation, <code>CALL</code> is now <code>("func2", "tmp", CALL(func1, false))</code>
So it tries to invoke <code>func1</code>, passing in <code>tmp</code>, and, well, <code>CALL(func1, false)</code>.</p>

<p><em><strong>This is where the line is drawn between the preprocessor and the actual C compiler.</em></strong></p>

<p>The preprocessor, once it starts doing substitution, it''s done parsing, so the compiler receives <code>CALL(func1, false)</code> as an actual C function, not a macro, because the compiler doesn''t <em>know</em> about macros, only the preprocessor does.</p>
',NULL,NULL,NULL,NULL,220819,4573981,'2011-01-01T13:56:51.437',1,NULL,NULL,13,NULL,NULL,2,220819,NULL,'2011-01-01T12:07:42.397',NULL,4573994,'2011-01-01T13:56:51.437');

