<pre><code>CREATE TRIGGER trg_MemberUpdated
ON dbo.Member AFTER UPDATE 
AS BEGIN
   IF UPDATE(memberName)
          dbo.MemberLastChanged(memberID, memberName, dateEntered)
          SELECT
             d.MemberID, d.MemberName, GETDATE()
          FROM 
             Deleted d
END
</code></pre>

<p>Basically, this trigger checks to see whether the <code>memberName</code> property was updated; if so, a row with the old values (which are available in the <code>Deleted</code> pseudo table inside the <code>UPDATE</code> trigger) is inserted into <code>MemberLastChanged</code></p>
