<p>In your scenario, <code>D</code> == <code>1</code>, <code>I</code> == <code>2</code> and <code>G</code> == <code>3</code>.  After rebasing, <code>3</code> maintains its relationship to <code>1</code> just like <code>G''</code> maintained its relationship to <code>D</code>.  This is because <code>D</code> is <em>not</em> an ancestor of <code>I</code> and:</p>

<blockquote>
  <p>Note: Rebase drops a parent relationship only if the parent is an ancestor of target.</p>
</blockquote>

<p>You really want to remove that relationship, then, according to the docs, you need a <em>development version</em> to get the <code>--detach</code> option:</p>

<blockquote>
  <p>Using a development version is available the new --detach option that drops this relationship.</p>
  
  <p><img src="http://i.stack.imgur.com/CdQZQ.png" alt="new --detach option"></p>
</blockquote>
