<p>Two strings which are ''the same'' in that they contain the same characters may not reference the same memory, which can be inefficient if you''re using strings for, say, hashes.</p>

<p>So, symbols can be useful for reducing memory overhead. However - they are a memory leak waiting to happen, because symbols cannot be garbage collected once created. Creating thousands and thousands of symbols would allocate the memory and not be recoverable. Yikes!</p>
