<pre><code>int i;
....
for(i=0; i&lt;9; i++)
    /* no-op */;

/* inline block with no relation to for-loop */
{  
    System.out.println ("Please enter a number:");  
    Num[i] = keyboard.nextDouble();  
    Sum += Num[i];      
    Product *= Num[i];      
} 
</code></pre>

<p>Remove the <code>;</code> to get your intended behavior.</p>

<hr>

<p>If you don''t need the <code>i</code> outside of the loop, you could move its declaration within the <code>for</code> statement.</p>

<pre><code>for(int i=0; i&lt;9; i++)
{
   // `i` is only usable here now
}
// `i` is now out of scope and not usable
</code></pre>

<p>Using this syntax when the erroneous semicolon <code>;</code> was present would have produced a compile error that would alerted you to the erroneous <code>;</code> earlier. THe compiler would see this:</p>

<pre><code>for(int i=0; i&lt;9; i++)
    /* no-op */;

/* inline block with no relation to for-loop */
{  
    System.out.println ("Please enter a number:");  
    Num[i] = keyboard.nextDouble();     // compile error now - `i` is out-of-scope
    Sum += Num[i];      
    Product *= Num[i];      
} 
</code></pre>

<p>This would be an example why it is good practice to limit the scope of variables when possible.</p>
