<p>Spring JdbcTemplate can be more easily used with exotic database schemas and a stored procedure focus. Using JPA you need to make sure that database schema maps correctly to the domain model.</p>

<p>Both technologies need developers knowing relational databases, SQL and transactions. With JPA you get more hidden complexity though.</p>

<p>JPA is to my knowledge more easily pluggable to data caching layers, since the object oriented focus makes cache entry identification, update and invalidation easier.</p>

<p>You can fine tune JdbcTemplate based backends better, but there is for most cases more code involved.</p>

<p>Some other aspect to consider is that although with JPA you get a domain model for your database schema you will often need to use additional DTO classes. Using JdbcTemplate you can directly operate with DTO classes.</p>
