<p>It all depends really. Some have well known disadvantages, you have to really look at the combination cipher/concatenation and the specifics of how you use it. </p>

<p>For "casual use" you can argue that the block cipher mode is not the most sensitive part of the crypographic system. </p>

<p>Some are useful only if you wanna turn a block cipher into a stream cipher, e.g.:</p>

<ul>
<li>CTR</li>
<li>CFB</li>
<li>OFB</li>
</ul>

<p>So unless you need a to do that, those are not useful for you. </p>

<p>ECB is the simplest one, main disadvantage is that equal plaintext blocks will result into identical ciphertext. There is little reason to use that these days.</p>

<p>Adressing your points:</p>

<ol>
<li><p>Does not really depend on the block cipher mode. You might wanna use <a href="http://en.wikipedia.org/wiki/Salt_%28cryptography%29" rel="nofollow">salt</a> or encrypt the password N times to avoid pre-computed table attacks.</p></li>
<li><p>It doesn''t happen. input is padded prior to encryption</p></li>
<li><p>Not sure what you mean...</p></li>
</ol>

<p>Edit: I agree with Eugene, don''t reinvent the wheel if you don''t need to!</p>
