<p>Third: hashes are used for this. I.e. you include a hash of your original data (or of some additional data) with your encrypted data. After decryption the hash is re-calculated and compared with stored hash. Note, that timing attack is possible on comparison, so comparison must be implemented properly.</p>

<p>In general - you are trying to reinvent the wheel. If you need to just encrypt the data using a secure key (or even a password), take OpenPGP. It solves all questions you''ve asked and would ask while reinventing strong encryption. OpenPGP lets you use plain passphrases for encryption. </p>
