<p>Template of function pointer is illegal in C++. Be it inside a class, or simply outside a class. You cannot write this (not even outside a class):</p>

<pre><code>template &lt;class X&gt;
void (*PtrToFunction) (X);
</code></pre>

<p>See this sample : <a href="http://www.ideone.com/smh73" rel="nofollow">http://www.ideone.com/smh73</a></p>

<p>The C++ Standard says in $14/1,</p>

<blockquote>
  <p>A template defines a family of <strong>classes</strong>
  or <strong>functions</strong>.</p>
</blockquote>

<p>Please note that it does NOT say "A template defines a family of <em>classes</em>, <em>functions</em> <strong><em>or function pointers</em></strong>". So what you''re trying to do is, defining "a family of function pointers" using template, which isn''t allowed. </p>

<p>Generic Functors from <a href="http://loki-lib.sourceforge.net/" rel="nofollow">Loki</a> library would be an elegant solution to the kind of problem you''re having. :-)</p>
