<p>inside the function, the local variables of <code>$db</code> is not defined</p>

<p>ugly fix is to use global like</p>

<pre><code>function getem($q)
{
  global $db;
  $r=$db-&gt;Execute($q);
  return $r-&gt;RecordCount();
} 
</code></pre>

<p>Or you can consider wrap the adodb as static class like</p>

<pre><code>class db
{
  protected static $db;

  public static function execute($query)
  {
    if (!self::$db)  // or check object instance type
    {
      self::$db = ADONewConnection(''mysql://user:pass@localhost/db'');
    }

    return self::$db-&gt;execute($query);
  }
}

function getem($q)
{
  $r=db::execute($q);
  return $r-&gt;RecordCount();
}
</code></pre>
