<p>You need to create a new instance of the <code>Item</code> for every line in the file and add it to the list as shown below.</p>

<p>Fix:</p>

<pre><code>List&lt;Item&gt; items = new ArrayList&lt;Item&gt;();

String line = null;
while ((line = reader.readLine()) != null) {
    String[] split = line.split(",");

    Item item = new Item(); // New Item is created for every line
    item.name = split[0];
    item.quantity = Integer.valueOf(split[1]);
    item.price = Double.valueOf(split[2]);
    item.total = item.quantity * item.price;

    items.add(item);
}
</code></pre>
