<p>With a little bit of effort you can construct macros that may react on the number of arguments they receive and do the right replacement. <a href="http://www.google.com/url?sa=t&amp;source=web&amp;cd=1&amp;ved=0CBYQFjAA&amp;url=http%3A%2F%2Fp99.gforge.inria.fr%2Fp99-html%2Fgroup__preprocessor__conditionals_gaa17218fd8b2331a7fabaf57be6e10bae.html&amp;rct=j&amp;q=P99_IF_EQ_2&amp;ei=oS4fTe-EOYmy8gPUzYmuBQ&amp;usg=AFQjCNEUp_-FKqyiWLKpZGIfC7jSyZ35YA&amp;sig2=EKqHH9VvhYuDeOkPGb6Lzw&amp;cad=rja" rel="nofollow">P99</a> provides helpers for that:</p>

<pre><code>#define CALL(...) P99_IF_EQ_2(P99_NARG(__VA_ARGS__))(dosomethingwithtwo(__VA_ARGS__))(dosomethingwithmore(__VA_ARGS__))
