<p><a href="http://www.thewebsqueeze.com/web-design-articles/learning-javascript-or-simply-the-js-frameworks.html"><strong>Learning Javascript or Simply the JS Frameworks?</strong></a> </p>

<p>Quoting main reasons from above article:</p>

<ul>
<li><strong>Frameworks don’t do it all.</strong></li>
</ul>

<blockquote>
  <p>Whereas frameworks and code libraries
  often take a lot of the heavy lifting
  when coding up sites, they can’t do it
  all. If you come along and think “I
  need to do this” and your framework
  does not provide such a function,
  you’re stuck up a creek without one
  very handy paddle.</p>
</blockquote>

<ul>
<li><strong>Employment</strong></li>
</ul>

<blockquote>
  <p>Imagine you’ve spent 9 years working
  with jQuery but never took the time,
  for whatever reason, to fully learn
  Javascript. Then you see the perfect
  job vacancy, javascript developer at a
  well respected company with very good
  pay. You’re thinking to yourself that
  they HAVE to pick you, you’ve worked
  with javascript for so long, but when
  you arrive and they ask you about your
  knowledge of javascript, you’re in
  trouble.</p>
</blockquote>

<ul>
<li><strong>Easier to pick up the framework</strong></li>
</ul>

<blockquote>
  <p>If you’ve spent a period of time with
  javascript, the syntax that jQuery
  (and most other javascript frameworks)
  uses is going to be a lot easier to
  pick up and a lot easier to master.</p>
</blockquote>

<ul>
<li><strong>Edit the Source and Plug In!</strong></li>
</ul>

<blockquote>
  <p>It’s always great fun to dive into the
  code and edit the library to suit
  yourself, you can add your own
  functions when you find a gap in the
  library</p>
</blockquote>

<p><br />
<strong>It is also discussed before:</strong></p>

<p><a href="http://stackoverflow.com/questions/668642/is-it-a-good-idea-to-learn-javascript-before-learning-jquery">Is it a good idea to learn JavaScript before learning jQuery?</a></p>
',NULL,NULL,NULL,NULL,149206,4574192,'2011-01-01T15:54:14.920',0,NULL,NULL,13,NULL,NULL,2,149206,NULL,'2011-01-01T13:48:03.610',NULL,4574236,'2011-01-01T15:54:14.920');

