<p>Doing this will require writing your own "iterator adaptor" to provide an "enhanced" output iterator that can test for whether it''s at the end of its valid range.  Then you would rightfully change the template typenames from <code>OutputIterator</code> to <code>SafeOutputIterator</code> -- even though this just serves as documentation because it''s something that can''t be enforced in C++.  We distinguish between "bounded" and "unbounded" iterator pairs: for the latter, no two iterators will ever compare equal, and in fact the 2nd iterator will never be needed for anything besides its type.</p>

<pre><code>/* Metafunction for determining whether the range has a fixed endpoint.
 * Assume all iterators are bounded except for OutputIterators. */
template &lt;typename Tag&gt;
struct helper {
    static bool value = true;
};

template &lt;&gt;
struct helper&lt;output_iterator_tag&gt; {
    static bool value = false;
};

template &lt;typename It&gt;
struct is_bounded {
    static bool value = helper&lt;typename iterator_traits&lt;It&gt;::iterator_category&gt;::value;
};

/* Wraps an output iterator. */
template&lt;typename It, bool BOUNDED = is_bounded&lt;It&gt;::value&gt;
class safe_output_iterator {
    typedef typename iterator_traits&lt;It&gt;::value_type value_type;

public:
    explicit safe_output_iterator(It iter, size_t limit = 0) : iter_(iter), limit_(limit) {}

    safe_output_iterator&amp; operator++() {  /* Preinc */
        ++iter_;
        return *this;
    }

    safe_output_iterator operator++(int) {  /* Postinc */
        safe_output_iterator temp(*this);
        ++iter_;
        return temp;
    }

    /* Trick: Deferencing returns the same object, so that operator=() works */
    safe_output_iterator&amp; operator*() {
        return *this;
    }

    /* Will be called despite "dereferencing" this iterator object */
    safe_output_iterator&amp; operator=() {
        /* Insert check for limit == 0 here if you want */
        --limit_;
        return *_iter;
    }

    /* Addition to the OutputIterator concept. */
    bool operator==(safe_output_iterator const&amp; x) {
        return BOUNDED &amp;&amp; limit_ == x.limit_;
    }

    bool operator!=(safe_output_iterator const&amp; x) {
        return !(*this == x);
    }

private:
    It iter_;
    size_t limit_;
};

/* Helper function templates to avoid typing out long typenames */

/* Handle iterators */
template &lt;typename It&gt;
safe_output_iterator&lt;It&gt; soi_begin(It it, size_t limit = 0) {
    return safe_output_iterator&lt;It&gt;(it, limit);
}

template &lt;typename It&gt;
safe_output_iterator&lt;It&gt; soi_end(It it, size_t limit = 0) {
    return safe_output_iterator&lt;It&gt;(it, limit);
}

/* Handle STL containers like vector and list */
template &lt;typename C&gt;
safe_output_iterator&lt;It&gt; soi_begin_cont(C cont) {
    return safe_output_iterator&lt;typename C::iterator&gt;(cont.begin(), cont.size());
}

template &lt;typename C&gt;
safe_output_iterator&lt;It&gt; soi_end_cont(C cont) {
    /* Actually the iterator supplied (here cont.end()) is unimportant... */
    return safe_output_iterator&lt;typename C::iterator&gt;(cont.end());
}
</code></pre>

<p>You can now write code like:</p>

<pre><code>vector&lt;int&gt; u(10, 42), v(ENOUGH_SPACE), w, x(ENOUGH_SPACE);

// Explicit iterator pair; bounded
foo(u.begin(), u.end(), soi_begin(v.begin(), ENOUGH_SPACE), soi_end(v));

// Explicit iterator pair; unbounded (2nd iterator ignored, but we need the type)
foo(u.begin(), u.end(), soi_begin(w.back_inserter()), soi_end(w.back_inserter()));

// Use whole container
foo(u.begin(), u.end(), soi_begin_cont(x), soi_end_cont(x));
</code></pre>

<p>You can either have <code>foo()</code> check <code>curr_output_iter != output_end</code> before each write through <code>*curr_output_iter</code>, or alternatively insert the check in <code>safe_output_iterator::operator=()</code>.  The latter seems preferable as you then cannot forget to perform the check whenever a pair of <code>safe_output_iterator</code>s are passed to any arbitrary algorithm (presumably this is similar to how debug versions of the STL work).  You could also write overloads of <code>soi_begin_cont()</code> and <code>soi_end_cont()</code> for fixed-size arrays.</p>

<p>All this would be much less cumbersome if <a href="http://www.boost.org/doc/libs/1_35_0/libs/range/index.html" rel="nofollow">ranges</a> were used by STL algorithms instead of iterator pairs -- that way a single function template could return an appropriate range spanning an entire array, for example.</p>
