<p>There are very different techniques. Most websites, AFAIK, use the technique to just put the databse primary key (maybe in some encoded) form in the URL at some position where it can be parsed by a regular expression and just enhancing the rest with keywords.</p>

<p>Example from Amazon: <code>http://www.amazon.de/Bauknecht-WA-PLUS-614-Waschmaschine/dp/B003V1JDU8/</code></p>

<p>You can enter anything in place of the name of the product, only the id at the end is important.</p>

<p>However you may want to keep your links clean and check if it''s correct and do 301 forwarding to the real URL or put a canonical URL if a wrong URL turns up.</p>

<p>However:</p>

<p>If you want to do something like <a href="http://en.wikipedia.org/wiki/TinyURL" rel="nofollow">TinyURL</a>, my answer is a definite no.</p>

<p>It''s not good enough.</p>

<p>Well it depends.</p>

<p>It''s not "secure". It would be pretty easy to guess URLs. A better approach would be using some cryptographic function like SHA-1/MD5.</p>

<p>When it comes to collisions I can''t really tell. GUID was designed to have no collisions, but you are only using the first 6 characters. I don''t know what exactly they represent in the algorithm. But it''s definitely not optimal.</p>

<p>Why, however, don''t you just use the database auto incrementing primary key? If security is important you also definitely have go to with more than 6 characters.</p>

<p>On a project I did I used something like </p>

<p>/database-primary-key/hash-of-primary-key-with-some-token-or-client-information/</p>

<p>This way I could directly look up the primary key in the database which was the fastest possible way but also could verify that the link was not found out by brute forced by the hash. In my case the hash was the SHA-1 sum of the client''s secret token and the primary key.</p>
