<pre><code>sort []      =   []
sort (p:xs)  =   sort [x | x&lt;- xs, x &lt;= p]
              ++ [p]
              ++ sort [x | x &lt;- xs, x &gt; p]
</code></pre>

<p>See, e.g., <a href="http://c2.com/cgi/wiki?QuickSortInHaskell" rel="nofollow">c2.com</a> or <a href="http://en.literateprograms.org/Quicksort_%28Haskell%29" rel="nofollow">LiteratePrograms.org</a>. <a href="http://www.codecodex.com/wiki/Merge_sort#Haskell" rel="nofollow">Merge sort</a> isn''t much harder to write and more reliable in practice. The same can be done in Scheme with:</p>

<pre><code>(define (sort xs)
  (if (null? xs)
    ''()
    (let* ((p (car xs)) (xs (cdr xs)))
      (call-with-values (lambda () (partition (lambda (x) (&lt;= x p)) xs))
                        (lambda (l r)
                          (append (sort l) (list p) (sort r)))))))
</code></pre>

<p>with <a href="http://srfi.schemers.org/srfi-1/srfi-1.html#partition" rel="nofollow"><code>partition</code> from SRFI-1</a> (untested code). See also <a href="http://www.r6rs.org/final/html/r6rs-lib/r6rs-lib-Z-H-5.html#node_chap_4" rel="nofollow">chapter 4 of R6RS libraries</a>.</p>
