<p>Personally I would take a different approach. I would use an iterator block to make it easy to return an <code>IEnumerable&lt;string&gt;</code>, and <em>internally</em> just keep an integer counter. Then you just need to write a method to convert a counter value and "alphabet of digits" into a string. Something like this:</p>

<pre><code>public static IEnumerable&lt;string&gt; Counter(string digits, int digitCount)
{
    long max = (long) Math.Pow(digits.Length, digitCount);
    for (long i = 0; i &lt; max; i++)
    {
        yield return ConvertToString(i, digits, digitCount);
    }
}
</code></pre>

<p>Another alternative is to do the same thing with LINQ, if a range of <code>int</code> is enough:</p>

<pre><code>public static IEnumerable&lt;string&gt; Counter(string digits, int digitCount)
{
    int max = (int) Math.Pow(digits.Length, digitCount);
    return Enumerable.Range(0, max)
                     .Select(i =&gt; ConvertToString(i, digits, digitCount));
}
</code></pre>

<p>In either case, you just iterate over the returned sequence to get appropriate counter values.</p>

<p>With those in place, you just need to implement <code>ConvertToString</code> - which would probably be something like this:</p>

<pre><code>public static string ConvertToString(long value, string digits, int digitCount)
{
    char[] chars = new char[digitCount];
    for (int i = digitCount - 1 ; i &gt;= 0; i--)
    {
        chars[i] = digits[(int)(value % digits.Length)];
        value = value / digits.Length;
    }
    return new string(chars);
}
</code></pre>

<p>Here''s a test program showing it all working:</p>

<pre><code>using System;
using System.Collections.Generic;
using System.Linq;

class Test
{
    static void Main()
    {
        // Show the first 10 values
        foreach (string value in Counter("ABCD", 3).Take(10))
        {
            Console.WriteLine(value);
        }
    }

    public static IEnumerable&lt;string&gt; Counter(string digits, int digitCount)
    {
        long max = (long) Math.Pow(digits.Length, digitCount);
        for (long i = 0; i &lt; max; i++)
        {
            yield return ConvertToString(i, digits, digitCount);
        }
    }

    public static string ConvertToString(long value,
                                         string digits,
                                         int digitCount)
    {
        char[] chars = new char[digitCount];
        for (int i = digitCount - 1 ; i &gt;= 0; i--)
        {
            chars[i] = digits[(int)(value % digits.Length)];
            value = value / digits.Length;
        }
        return new string(chars);
    }
}
</code></pre>

<p>Output:</p>

<pre><code>AAA
AAB
AAC
AAD
ABA
ABB
ABC
ABD
ACA
ACB
</code></pre>
