<pre><code>#(?&lt;=v=)[a-zA-Z0-9-]+(?=&amp;)|(?&lt;=[0-9]/)[^&amp;\n]+|(?&lt;=v=)[^&amp;\n]+#
</code></pre>

<p>boils down to three alternative parts:</p>

<pre><code>(?&lt;=v=)[a-zA-Z0-9-]+(?=&amp;)
(?&lt;=[0-9]/)[^&amp;\n]+
(?&lt;=v=)[^&amp;\n]+
</code></pre>

<p>The <code>(?&lt;=...)</code> is called a lookbehind assertion and in two of these parts you see it looks for <code>v=</code>.</p>

<p>In the first alternative, it looks for <code>[a-zA-Z0-9-]+</code> followed by <code>&amp;</code>. (which is a lookahead assertion: <code>(?=...)</code>)</p>

<p>The second alternative doesn''t apply in this case.</p>

<p>In the third alternative, it looks for anything until hitting <code>&amp;</code> or <code>\n</code>.</p>

<p>Your example doesn''t fit correctly on any of those. The easiest fix would be to change the last part:</p>

<pre><code>(?&lt;=v=)[^&amp;\n]+
</code></pre>

<p>to</p>

<pre><code>(?&lt;=v=)[^&amp;\s]+
</code></pre>

<p>so it will stop matching on <code>&amp;</code> or any whitespace (<code>\s</code>).</p>

<p>Or a better advice: just rewrite the whole thing to really parse the url in a normal way, saving some headaches in the future.</p>
