<p>That''s an optimization, space and time for x86 code, space for x64 code.  Space because it can omit the exception filter code, which is modest btw.  Time because on x86 it can avoid registering the exception filter upon entering the try {} block.  Very modest btw.  x64 uses a different way to find exception filters, it is table-based.</p>

<p>The key phrase in the first paragraph is "might throw a C++ exception".  On Windows there are other sources of exceptions.  Like the "a" in /EHa, asynchronous exceptions that are raised by the hardware.  Things like floating point exceptions, division by zero, and the all-mighty access violation exception.  But also notably the kind of exceptions that are raised by code that you might interop with.  Like managed code, basically anything that runs in a VM.</p>

<p>When you want to make your objects safe for these kind of exceptions as well then you''ll need to use /EHa, that tells the compiler to <em>always</em> register the exception filter.  </p>

<p>Beware of a nasty side-effect of /EHa, it makes catch(...) swallow <em>all</em> exceptions.  Including the ones you should never catch, like AV and SO.  Look at <code>__try/__except</code> and _set_se_translator() if that''s important to you.</p>
