<li><a href="http://en.literateprograms.org/Counting_sort_%28Haskell%29">Counting sort</a>, although the article says it is doubtful the implementation qualifies as counting sort.</li>
</ul>

<p>Merge sort is often the best choice for sorting linked lists. Functional languages usually operates on lists although I have little knowledge on how most functional languages implements lists. In Common Lisp they are implemented as linked lists and I presume most functional languages do as well. </p>

<p>While quicksort can be written for linked lists it will suffer from poor pivot selection because of random access. While this does not matter on completely random input, on partially or completely sorted input pivot selection becomes very important. Other sorting algorithms may also suffer from the slow random-access performance of linked lists. </p>

<p>Merge sort on the other hand works well with linked lists and it is possible to implement the algorithm such that it only requires some constant of extra space with linked lists.</p>
