<p>The point of ORM is to abstract away the fact that your data is in a DB at all, as much as possible.  When you use ORM properly, all persistence operations are dealt with in one (hopefully) thin layer.  Your model objects will have little to no persistence code; the fact that you are using ORM should be invisible to your model.</p>

<p>Because of this, ORM is very good at making your life easy for certain types of operations, namely simple CRUD operations.  You can load your model objects, present them, update them, delete them quite easily.  It makes your life easier because when you access your data, you get model objects back, on which you can write business logic.  If you use JDBC, you will have to ''hydrate'' your object instances from the data, which can be complicated and error-prone.</p>

<p>ORM is not always the best choice.  JPA is a tool for a job, if the tool is not sufficient for the job you will want to find a better tool.  For example, I had a scenario where I had to copy an entire object graph and save a new copy of those objects.  If I had used ORM (like I tried to do), I had to load all the objects out of the DB, then copy them, then save the new objects.  I took way too long.</p>

<p>The better solution was simply to use jdbc based operations and ''insert via select'' sql calls to create the new rows.  It was fast, the code was simpler. </p>

<p>The other thing to consider is that you are confortable with JDBC, and have deadlines, you don''t have to jump on the ORM bandwagon.  The Spring JdbcTemplate classes are extremely powerful and helpful.  Sometimes the best tool for the job is the one you know.  You should familiarize yourself with ORM, but not necessarily for a project with high expectations.  There is a lot to learn and its not trivial -- really you are trading one set of complexities with another in the choice to use jdbc vs orm.  </p>
