<pre><code>  ini_set(''session.gc_maxlifetime'', 30*60); // expires in 30 minutes
</code></pre>

<p>or set it in your <code>php.ini</code> file.</p>

<p>To set the session cookie lifetime, client side, either let it as it is (0, will die when the browser is closed), or</p>

<pre><code>  ini_set(''session.cookie_lifetime'', 30*60); // 30 minutes
</code></pre>

<p>or in the <code>php.ini</code>.</p>

<p>If you choose to use <code>set_ini()</code>, be sure to place the commands <em>before</em> <code>session_start()</code> is called.</p>

<p>Note that <code>set_ini</code> works only during the script lifetime.</p>

<p>Regarding the checkbox and having a dynamic setting of the session lifetime, you could </p>

<ul>
<li>use <a href="http://php.net/manual/en/book.apc.php" rel="nofollow">APC</a> to store a setting shared by all PHP processes, that will last until the PHP server is down</li>
<li>write a value in a file somewhere that you load at the start of scripts (expensive) and set the value </li>
</ul>

<p>(each script will have to <code>set_ini()</code> once before <code>session_start()</code>)</p>
