<p>My personal feeling is that any sort of silly trick to simplify code only acts to encourage terrible coding behavior, like lack of cohesion, unclear intention and poor or incomplete coding standards.</p>

<p>One programmer told me that code regions helped encourage coding standards by making it clear where another programmer should put his or her contributions. </p>

<p>But, to be blunt, this sounds like a load of horse manure to me. If you have a standard, it is the programmer''s job to understand what that standard is... you should''t need to define it in every single class file.</p>

<p>And, nothing is more annoying than having all of your code collapsed when you open a file. I know that cntrl + M, L will open everything up, but then you have the hideous "hash region definition" open and closing lines to read.</p>

<p>They''re just irritating.</p>

<p>My most stead fast coding philosophy is that all programmer should strive to create clear, concise and cohesive code. Region tags just serve to create noise and redundant intentions. </p>

<p><strong>Region tags would be moot in a well thought out and intentioned class.</strong></p>

<p>The only place they seem to make sense to me, is in automatically generated code, because you should never have to read that outside of personal curiosity.</p>
',866,NULL,'2011-01-01T14:54:03.980',NULL,NULL,NULL,NULL,9,6,4574374,2,NULL,'Who likes #regions in Visual Studio?',1,453084,'<visual-studio><coding-style><region>','2011-01-01T14:32:19.657',NULL,4574357,'2011-01-01T15:03:35.607');

<p>Consider for example merge sorting... first you write a function that given two already sorted lists returns a single sorted list with the elements of both in it. For example:</p>

<pre><code>def merge(a, b):
    if len(a) == 0:
        return b
    elif len(b) == 0:
        return a
    elif a[0] &lt; b[0]:
        return [a[0]] + merge(a[1:], b)
    else:
        return [b[0]] + merge(a, b[1:])
</code></pre>

<p>then you can write a function that sorts a list by merging the resulting of sorting first and second half of the list.</p>

<pre><code>def mergesort(x):
    if len(x) &lt; 2:
        return x
    else:
        h = len(x) // 2
        return merge(mergesort(x[:h]), mergesort(x[h:]))
</code></pre>

<p>About Python syntax:</p>

<ul>
<li><code>L[0]</code> is the first element of list <code>L</code></li>
<li><code>L[1:]</code> is the list of all remaining elements</li>
<li>More generally <code>L[:n]</code> is the list of up to the n-th element, <code>L[n:]</code> the rest</li>
<li><code>A + B</code> if <code>A</code> and <code>B</code> are both lists is the list obtained by concatenation</li>
<li><code>[x]</code> is a list containing just the single element <code>x</code></li>
</ul>

<p>PS: Note that python code above is just to show the concept... in Python this is NOT a reasonable approach. I used Python because I think it''s the easiest to read if you know any other common imperative language.</p>
