<blockquote>
  <p>SA1124: DoNotUseRegions</p>
  
  <p><strong>Cause</strong></p>
  
  <p>The C# code contains a region.</p>
  
  <p><strong>Rule Description</strong></p>
  
  <p>A violation of this rule occurs whenever a region is placed anywhere within the code. In many editors, including Visual Studio, the region will appear collapsed by default, hiding the code within the region. It is generally a bad practice to hide code, as this can lead to bad decisions as the code is maintained over time.</p>
  
  <p><strong>How to Fix Violations</strong></p>
  
  <p>To fix a violation of this rule, remove the region from the code.</p>
</blockquote>

<p>There is <a href="http://stackoverflow.com/questions/2430198/stylecop-sa1124-donotuseregions-is-reasonable">some discussion</a> about whether or not this is a reasonable rule.</p>

<p>The consensus seems to be that some people like regions and some people don''t - it is up to individual teams to decide. The most important thing is to use a consistent style throughout your project.</p>

<p>One place where regions might be acceptable is to group all the methods that implement a particular interface. It is worth noting that Visual Studio automatically adds a region if you use the code generation feature to provide method stubs for implementing an interface.</p>

<blockquote>
  <p>The only place they seem to make sense to me, is in automatically generated code, because you should never have to read that outside of personal curiosity.</p>
</blockquote>

<p>The <a href="http://msdn.microsoft.com/en-us/library/wa80x488.aspx">partial class feature</a> is better for separating automatically generated code from manually generated code within the same class.</p>

<blockquote>
  <p>When working with automatically generated source, code can be added to the class without having to recreate the source file. Visual Studio uses this approach when it creates Windows Forms, Web service wrapper code, and so on. You can create code that uses these classes without having to modify the file created by Visual Studio.</p>
</blockquote>
',NULL,NULL,NULL,NULL,61974,4574357,'2011-01-01T14:49:10.080',3,NULL,NULL,6,NULL,NULL,2,61974,NULL,'2011-01-01T14:37:56.833',NULL,4574374,'2011-01-01T14:49:10.080');

<p>With a plugin <a href="http://hg-git.github.com/" rel="nofollow">like <strong>Hg-Git</strong></a>, you can at least push to and pull from a Git server repository from Mercurial, allowing you to pull from the GitHub repo to your local Mercurial repo.  </p>

<p><img src="http://i.stack.imgur.com/BOsBY.png" alt="alt text"></p>

<p>From that local (Mercurial) repo, you can then work as usual with the bitbucket remote repo.</p>

<hr>

<p>The OP adds:</p>

<blockquote>
  <p>It didn''t work for me so i tried to transfer git repo to hg repo and from this repo pull to my working repo with changes - but it says that: abort: <strong>repository is unrelated</strong> - but I merged a lot from it. Any help here? </p>
</blockquote>

<p>That makes senses, if both repos have been developed separately, you cannot push/pull 2 (mercurial) repos one into another.<br>
This is confirmed at the bottom of the page "<a href="http://mercurial.selenic.com/wiki/UnderstandingMercurial#What_Mercurial_can.27t_do" rel="nofollow">Understanding Mercurial</a>", and detailed in the blog post: "<a href="http://kevin-berridge.blogspot.com/2009/05/what-mercurial-cant-do-subtree-repos.html" rel="nofollow">What Mercurial Can''t Do: Subtree Repos</a>".</p>

<p>The more practical solution would be to make one <em>extra</em> repository (a "parent one") with your two repos declared in it as <strong><a href="http://mercurial.selenic.com/wiki/Subrepository?action=show&amp;redirect=subrepos" rel="nofollow">nested repository</a></strong>.<br>
It would keep both repos independent, allowing to push back to the GitHub repo from your second mercurial repo.</p>

<p>If you don''t have to push back to GitHub, but really want to have one repo in which you merge common files, then you can look in "<a href="http://stackoverflow.com/questions/1368080/merge-tip-from-an-unrelated-repository-with-mercurial">Merge tip from an unrelated repository with Mercurial</a>", but that is much more complex.</p>

<p>I would rather:</p>

<ul>
<li>keep both repos separate</li>
<li>delete from the first one the common files you need to merge in the second one.</li>
<li>report and merge those common files in the second one.</li>
</ul>
