<p>There may be a mismatch between your version of Rails and the i18n gem that is breaking string interpolations in your locale file e.g. ''en.yml''.</p>

<p>The first thing I would do to try and fix this problem is to update to the latest version of the 2.3.x series of Rails (which is 2.3.9), and then check that your <strong>i18n gem</strong> is also at the latest version (<strong>0.5.0</strong>); because those versions of Rails and i18n have been tested together. </p>

<p><strong>Background information</strong></p>

<p>The interpolation syntax "{{foo}}" was deprecated since 0.4.0 version of the i18n gem, and <a href="https://github.com/svenfuchs/i18n/commit/2d43846d2b2a2e596f30fa58ea1c9ddb2243bb64" rel="nofollow">was removed in version 0.5.0</a>.</p>

<p>The Rails codebase <a href="https://github.com/rails/rails/commit/5ed6a8447b1c9191feb431e1387f28abde7eba44#diff-3" rel="nofollow">mirrored this change in interpolation syntax in version 2.3.9</a>.</p>
