<pre><code>UPDATE chars
SET data=DATE_ADD(data, INVERVAL 30 SECOND)
WHERE id=$id
</code></pre>

<p>Of course, this assumes you''ve made <code>data</code> a datetime type field. If it''s just an int, then why bother with all the date math, and just do <code>data=data+30</code>.</p>

<p>As well, you''re generating your time value in a highly inefficient manner. You format the current date as a string, convert that string to a number, and add 30 to it. Why not just do</p>

<pre><code>$data = time() + 30;
</code></pre>

<p>instead? time returns the current date/time as a single integer (a unix timestamp), saving you the round trip through String Land.</p>
