<h2>Explanation:</h2>

<p>If you look at <code>NSLocalizedString</code> macro definition you will find that it actually calls <code>-[NSBundle localizedStringForKey:value:table:]</code> method in which the last parameter is the localization file (ie: Localizable.strings). You can get available localizations with<code>-[NSBundle localizations];</code> method.</p>

<p>This means that you could use it to directly access a localization file like this:</p>

<pre><code>// This gets the localized string found in Japanese.strings for the key @"key"
NSString *locString = [thisBundle localizedStringForKey:@"key"
                                                  value:@"No translation"
                                                  table:@"Japanese"];
</code></pre>

<p>Or use the macro (Which is almost equivalent)</p>

<pre><code>NSString *locString = NSLocalizedStringFromTable(@"key", @"Japanese", @"comment for key");
</code></pre>

<p>The difference is what happens when the given key is not available:</p>

<ul>
<li>the former returns <code>@"No translation"</code></li>
<li>the latter returns the default localization for <code>@"key"</code></li>
</ul>

<p>Please see <a href="https://developer.apple.com/library/mac/#documentation/Cocoa/Reference/Foundation/Classes/NSBundle_Class/Reference/Reference.html" rel="nofollow">NSBundle class reference</a> for more details</p>

<p>Hope it helps</p>
