<p>In general:</p>

<ul>
<li>watch the <code>focus</code> and <code>blur</code> events on the input and change the value (and optionally classes) based on the existing value/''helpful'' value.</li>
<li>watch the <code>focus</code> and <code>blur</code> of the comment box and change the CSS class of another element to show and hide it.</li>
</ul>

<p>This is all a good bit easier if you use something like <a href="http://jquery.com/" rel="nofollow">jQuery</a>, since it already includes cross-browser code and even plugins to handle the self-describing part. If you''re open to using jQuery, let me know and I''ll give you an updated answer using that.</p>

<p><strong>Edit</strong>: OK, I''ve added a <a href="http://phrogz.net/js/self-describing-inputs-jquery.html" rel="nofollow">jQuery version of the example</a>. I decided not to use a plugin for the self-description since it is only 8 lines. I also changed that particular example to use the <code>title</code> attribute to hold the default text to display.</p>

<p><strong>Edit #2</strong>: Based on the problem @Meke pointed out, I''ve made a minor update to the scripts to handle the case where FireFox reloads the page and leaves the default text in place, and then (previously) didn''t properly add the class to indicate that this was default text.</p>

<p>I should also note that neither of my examples include a <code>submit</code> event handler for the form to remove the value for inputs that happen to still be showing the default value. This (rather trivial code) is something you would want to add.</p>

<p>Also note that by actually changing the <code>value</code> of the input/textarea code like this may break form validation not prepared to understand it.</p>
