<ol>
<li>Show text <code>text</code> and: 
<ul>
<li>save time in <code>time_pressed</code></li>
<li>start the <code>progressbar</code> and update it until <code>time_notallow</code> expires.</li>
</ul></li>
<li>If a user presses <code>&lt;Next&gt;</code> see if seconds specified in <code>time_notallow</code> have passed,
and if not, don''t allow the display of the next <code>text</code>.</li>
</ol>

<p>Basically, I want to prevent users form calling a method bind to the <code>&lt;Right&gt;</code> key until <code>time_notallow</code> passes, and show a progressbar to inform them how long they''ll have to wait. Since I use <code>bind</code>, such as...</p>

<pre><code>    self.master.bind(''&lt;Right&gt;'', self.text_next)
</code></pre>

<p>...I don''t have <code>.after()</code>, as in widgets. </p>

<h3>What I''ve tried</h3>

<ol>
<li><code>master.after()</code> to set <code>bind</code> to <code>None</code> and after <code>time_notallow</code> to <code>bind</code> to <code>self.text_next</code>, but it didn''t work.</li>
<li>Created a <code>thread</code> which looped with <code>while True</code> to check constantly if <code>time_notallow</code> is passed or not, but the application crashes.     </li>
</ol>

<p>Any help appreciated.</p>

<h3>Edit: A Solution. Using <code>lambda()</code> in <code>.after</code> to count seconds (thanks to  Bryan Oakley)</h3>

<pre><code>"""

Stripped-down version to figue out time/event/threading stuff.

What this has to do:

1. Show the window and some text.
2. User presses Next arrow and new text shows. Paint the label red.
3. Prevent user form pressing again (unbind all keys), until 2 seconds passed 
   (time_wait).
4. Make notice of passed time and after 2 seconds bind the keys again and
   paint the label green.
5. Loop the steps 2-4.

"""

import sys
import tkinter as tk
from tkinter import W, E, S, N

class Test(tk.Frame):

    def __init__(self, master=None):
        """Draw the GUI"""
        tk.Frame.__init__(self, master)
        self.draw_widgets()
        self.grid()
        self.time_wait = 2
        self.locked = False
        self.bind_keys()
        self.counter = 0

    def draw_widgets(self):
        """Draw all the widgets on the frame."""
        text = ''Just a sample sentence.''
        #Label with the sentence
        self.lbl_text = tk.Label(self, anchor="center", relief=''groove'')
        self.lbl_text[''text''] = text
        self.lbl_text[''font''] = (''Helvetica'', 27)
        self.lbl_text.grid(column=0, row=0, sticky=W+E+S+N)
        self.lbl_note = tk.Label(self, anchor="center", relief=''groove'',
            bg=''green'')
        self.lbl_note.grid(column=0, row=1, sticky=W+E+S+N)

    def text_next(self, event):
        """Get next text"""
        if not self.locked:
            self.counter += 1
            self.lbl_text[''text''] = ''The text number %s!'' % self.counter
            self.bind_tonone()
            self.lock(self.time_wait)

    def text_previous(self, event):
        """Get previous text"""
        if not self.locked:
            self.counter -= 1
            self.lbl_text[''text''] = ''The text number %s!'' % self.counter
            self.bind_tonone()
            self.lock(self.time_wait)

    def bind_keys(self):
        """Bind the keys"""
        self.master.bind(''&lt;Left&gt;'', self.text_previous)
        self.master.bind(''&lt;Right&gt;'', self.text_next)
        self.master.bind(''&lt;Escape&gt;'', self.exit)
        self.lbl_note[''bg''] = ''green''

    def bind_tonone(self):
        """Unbind the keys"""
        self.master.bind(''&lt;Left&gt;'', None)
        self.master.bind(''&lt;Right&gt;'', None)
        self.master.bind(''&lt;Escape&gt;'', None)
        self.lbl_note[''bg''] = ''red''

    def lock(self, n):
        if n == 0:
            self.locked = False
            self.lbl_note[''text''] = ''''
            self.lbl_note[''bg''] = ''green''

        else:
            self.locked = True
            self.lbl_note[''text''] = ''Locked for %s more seconds'' % n
            self.lbl_note.after(1000, lambda n = n - 1: self.lock(n))

    def exit(self, event):
        """Exit the program."""
        sys.exit()

def start():
    """Start the gui part."""
    root = tk.Tk()
    app = Test(master=root)
    app.mainloop()

if __name__ == ''__main__'':
    start()
