<p>Otherwise keep them as private fields and simply don''t provide a getter/setter.</p>

<p>There are various reasons why this is a best practice:</p>

<ol>
<li>If clients are using your field directly and later something needs to change regarding that, you''re stuck. With a getter you can do a whole lot of things before the field is accessed.</li>
<li>There is something called the JavaBeans specification that requires you to use getter/setters. Without them your class (then called bean) won''t interoperate with that. JSP and JSF''s EL is one example of something that required your class to comply with JavaBeans standards.</li>
</ol>

<p><sub>
(p.s. unrelated to your question, but you''d better not declare backPack as an ArrayList. Declare as List; code to interface, not to implementation)
</sub></p>
