<h3>The reason for integrating this filter comes from Spring security FAQs:</h3>

<p><a href="http://static.springsource.org/spring-security/site/faq.html#faq-tomcat-https-session" rel="nofollow">I''m using Tomcat (or some other servlet container) and have enabled HTTPS for my login page, switching back to HTTP afterwards. It doesn''t work - I just end up back at the login page after authenticating.</a><br>
This happens because sessions created under HTTPS, for which the session cookie is marked as “secure”, cannot subsequently be used under HTTP. The browser will not send the cookie back to the server and any session state will be lost (including the security context information). Starting a session in HTTP first should work as the session cookie won''t be marked as secure.</p>

<h3>Solution:</h3>

<p>As it turned out the culprit was:</p>

<pre><code> @RequestMapping(value="/captcha.html", method = RequestMethod.GET)
 public ModelMap processCaptcha(HttpServletRequest request, HttpServletResponse response) throws Exception
</code></pre>

<p>Simple change of the return type of the method from ModalMap to void fixed the problem.
Thank you @BalusC </p>
