<p>Attributes should only correspond the <em>implementation</em> of a given version of the class. In this way, the class developer may unilaterally change the implementation, hence the field, without breaking his/her commitment to maintain the interfaces.</p>

<p>Here is an example. Consider a class called Point. If you decide that a Point has x and y public attributes, then you may never change this. In contrast, if you have get/set X/Y methods, subsequent versions of the class may use various internal representations: rectangular coordinates (x, y), but also polar (r, theta), etc. All this without modifying the public interface.</p>
',NULL,NULL,NULL,NULL,NULL,4574479,NULL,1,NULL,NULL,1,NULL,NULL,2,529237,NULL,'2011-01-01T15:27:48.110',NULL,4574514,'2011-01-01T15:27:48.110');
&gt;&gt;&gt; re.sub(r''([a-z])\1+'', r''\1'', ''ffffffbbbbbbbqqq'')
''fbq''
</code></pre>

<p>The <code>()</code> around the <code>[a-z]</code> specify a <em>capture group</em>, and then the <code>\1</code> (a <em>backreference</em>) in both the pattern and the replacement refer to the contents of the first capture group.</p>

<p>Thus, the regex reads "find a letter, followed by one or more occurrences of that same letter" and then entire found portion is replaced with a single occurrence of the found letter.</p>

<h3>On side note...</h3>

<p>Your example code for just <code>a</code> is actually buggy:</p>

<pre><code>&gt;&gt;&gt; re.sub(''a*'', ''a'', ''aaabbbccc'')
''abababacacaca''
</code></pre>

<p>You really would want to use <code>''a+''</code> for your regex instead of <code>''a*''</code>, since the <code>*</code> operator matches "0 or more" occurrences, and thus will match empty strings in between two non-<code>a</code> characters, whereas the <code>+</code> operator matches "1 or more".</p>
',NULL,NULL,NULL,NULL,148870,4574509,'2011-01-01T21:32:40.287',1,NULL,NULL,25,NULL,NULL,2,148870,NULL,'2011-01-01T15:28:27.923',NULL,4574516,'2011-01-01T21:32:40.287');

