<pre><code>private int width;
public int get(){
    return width;
}
public void set(int w){
    if (w &lt; 0) throw new RuntimeException();
    else width = w;
}
</code></pre>

<p>This would be a good use of getters and setters. Otherwise, they hurt your performance if the only thing they do is assign or get the value without anything else. </p>

<p>So to make a long story short:</p>

<p>Use getters and setters when doing anything other than retrieving or assigning a value. Else, just use public fields.</p>

<p>i.e.</p>

<p>BAD:</p>

<pre><code>private int width;
public int get(){
    return width;
}
public void set(int w){
    width = w;
}
</code></pre>

<p>GOOD:</p>

<pre><code>private int width;
public int get(){
    return width;
}
public void set(int w){
    if (w &lt; 0) throw new RuntimeException();
    else width = w;
}
</code></pre>

<p>GOOD if you don''t want anything other than getting or setting:</p>

<pre><code>public int width;
</code></pre>
