<p>When encapsulation is done well, the object''s state can only be affected from the outside world through the interfaces provided by the object, such as methods the object has.</p>

<p>I think your code is already starting to use encapsulation.</p>

<p><strong>Let''s take a look at the code</strong></p>

<p>Let''s take a look at the <code>beDamaged</code> method.</p>

<pre><code>public void beDamaged(double damage)
{
    this.health -= damage;

    if (this.health &lt; 0)
    {
        this.health = 0;
    }
}
</code></pre>

<p>Here''s we can see that this method will be called by the outside world, and the player''s health will be affected. It also contains logic, so the health cannot be a negative number. The player''s <code>beDamaged</code> method that you wrote is keeping the state of the object within the parameters that you defined as being the valid state.</p>

<p><strong>Let''s infer something about the player</strong></p>

<p>Now, from the above, I think I can infer the following about the player object:</p>

<blockquote>
  <p>A player''s <code>health</code> cannot be a negative number.</p>
</blockquote>

<p><strong>Is what we inferred always true?</strong></p>

<p>Let''s see if this can always be true from the code you''ve provided.</p>

<p>Aha! We have a little problem here:</p>

<pre><code>public double health;
</code></pre>

<p>With the <code>health</code> field being <code>public</code>, the outside world can directly manipulate the field in order to place the player object''s state into one that is probably not desired, by some code like the following:</p>

<pre><code>Player player = new Player();
player.health = -100
</code></pre>

<p>I''m going to guess that the player shouldn''t be in a state where the <code>health</code> is a negative number.</p>

<p><strong>What can we do about it?</strong></p>

<p>How could that have been avoided? -- by having the <code>health</code> field <code>private</code>.</p>

<p>Now, the only way to affect the player''s <code>health</code> would be through the <code>beDamaged</code> and <code>gainHealth</code> methods, and that''s probably the right way for the outside world to affect your player''s health.</p>

<p>Which also means this -- when you make a field <code>private</code>, that does not automatically mean that you should make getters and setters for the field.</p>

<p><strong>Private fields does not necessitate getters and setters</strong></p>

<p>Getters and setters are usually a way to directly affect a field that an object has, maybe with some validation to prevent bad input from making your object have a state that it shouldn''t, but there are going to be times where the object itself should be in charge of affecting the data, rather than an outside entity.</p>
',NULL,NULL,NULL,NULL,17172,4574479,'2011-01-01T15:45:54.337',5,NULL,NULL,17,NULL,NULL,2,17172,NULL,'2011-01-01T15:33:42.713',NULL,4574531,'2011-01-01T15:45:54.337');

