<p>As the exception hints, you cannot call both <a href="http://download.oracle.com/javaee/6/api/javax/servlet/ServletResponse.html#getOutputStream%28%29" rel="nofollow"><code>getOutputStream()</code></a> and <a href="http://download.oracle.com/javaee/6/api/javax/servlet/ServletResponse.html#getWriter%28%29" rel="nofollow"><code>getWriter()</code></a> on the same response. That''s an illegal state.</p>

<p>As the stacktrace hints, you seem to be using Freemarker which is implicitly using the <code>Writer</code> to write the response body. Whenever you delegate the response to Freemarker, you should thus ensure that you never call <code>response.getOutputStream()</code> anywhere in the code beforehand. Or, when calling it is mandatory (e.g. to write some binary content which is then to be provided as a download), then you should skip delegating the response to Freemarker.</p>
