<blockquote>
  <p>The thing is that also from what i have seen, (and it seems logical) is that using private fields, but using getters and setters to access them is also not good as it defeats the point of using private fields in the first place.</p>
</blockquote>

<p>The main problem is that many developers automatically generate getters and setters for all private fields. And if you''re going to do that, I agree, you might as well keep the field public (no, public fields are even worse).</p>

<p>For every field that you have, you should check:</p>

<p>a) does it need a Getter (do other classes need to know the value of this field)<br>
 b) does it need a Setter (do other classes need to be able to change the value of this field)<br>
 c) or does the field need to be immutable (final), if so it must be initialized during definition or in the constructor (and it can obviously have no setter)</p>

<p>But you should hardly ever (exception: value objects) assume that all private fields will have getters and setters and let your IDE generate them all.</p>
