<p><code>Float</code> says to browser, that rather than normal behaviour, <code>div</code>should be either left or right and the rest of content should flow around (think: Images in *.doc).</p>

<p>Your problem is, that you confuse english ''<strong>float</strong>'' [<em>To remain suspended within or on the surface of a fluid without sinking</em>] with css'' ''<strong>float</strong>'' [<em>stay to ''left'' or ''right'' border and flow rest of website content around</em>]</p>

<p>What you want to do is take the div out of normal flow of webpage (thus: <code>position:absolute</code>) position it.</p>

<p>Hint:
<code>absolute</code> is relative to 0;0 of first found ancestor, which is <code>relative</code> or <code>absolute</code>.   <code>Relative</code>is relative to 0;0 of what would be position in normal flow.</p>

<p>Relative divs* act as if they were on their original place , they are just rendered shifted. Absolute divs* are taken out of flow of website and position accordingly to hint above.</p>

<ul>
<li><ul>
<li>by div, I mean any styled tag</li>
</ul></li>
</ul>

<p>I apologize if you know all this and just can''t make it work.</p>

<p><strong>EDIT</strong>
In <code>position:absolute;</code> this means first found ancestor:</p>

<pre><code>&lt;body&gt;
  &lt;div id="wrapper"&gt;
    &lt;div id="innerWrapper"&gt;
      &lt;div id="content"&gt;
</code></pre>

<p>and two <code>CSS</code> cases:</p>

<p>1.</p>

<pre><code>#content { position: absolute; top: 10px; left: 20px; }
</code></pre>

<p>2.</p>

<pre><code>#innerWrapper { positon: absolute; top: 200px; left: 200px; }
#content { position: absolute; top: 10px; left: 20px; }
</code></pre>

<p>In case one, since nether <code>#wrapper</code> nor <code>#innerWrapper</code> have set position, first <code>absolute</code> or <code>relative</code> ancestor in tree is body, thus positioning of 10px;20px is made from 0;0 of body (read: viewport) - <code>#content</code> is at 10;20 of window.</p>

<p>In case two, #innerWrapper is set <code>absolute</code>, thus making 200;200 of <em>window</em> a point, which is understood as 0;0 when positioning <code>#content</code>. Therefore (absolute ancestor found), <code>content</code> will be at 210;220 of window</p>

<p>Example: <a href="http://jsfiddle.net/3dq6V/">http://jsfiddle.net/3dq6V/</a></p>
