<p>Second of all, the method <code>-respondsToSelector:</code> is not called by the runtime, it''s usually called by the user (yourself or APIs that want to know if a delegate, for example, responds to an optional method of the protocol).</p>

<p>When you send a message to an object, the runtime will look for the implementation of the method in the class of the object (through the object''s isa pointer). It''s equivalent to sending <code>-respondsToSelector:</code> although the message itself is not dispatched. If the implementation of the method is found in the class or in its superclasses, it''s called with all the arguments you passed in.</p>

<p>If not, then the runtime gives the message a second chance to be executed. It will start by sending the message <code>+ (BOOL)resolveInstanceMethod:(SEL)name</code> to the class of the object: this method allows you to add the method at runtime to the class: if this message returns YES, it means it can redispatch the message.</p>

<p>If not it gives the message a third chance to be executed, it sends <code>- (id)forwardingTargetForSelector:(SEL)aSelector</code> with the selector, this method can return another object that may be able to respond to the selector on behalf of the actual receiver, if the returned object can respond, the method is executed and the value is returned as if it was returned by the original message. (Note: This is available beginning with OS X 10.6 or iOS 4.)</p>

<p>If the returned object is nil or self (to avoid infinite loops), the runtime gives the message a fourth chance to execute the method… It sends the message <code>- (NSMethodSignature *)methodSignatureForSelector:(SEL)aSelector</code> to get a method signature in order to build an invocation. If one is provided then an invocation is sent through the message <code>- (void)forwardInvocation:(NSInvocation *)anInvocation</code>. In this method you can parse the invocation and build other messages to send to other targets in any ways you want, and then you can set the return value of the invocation… That value will act as the return value of the original message.</p>

<p>Finally, if no method signature is returned by the object, then the runtime sends the message <code>- (void)doesNotRecognizeSelector:(SEL)aSelector</code> to your object, the implementation of this method in NSObject class throws an exception.</p>
