<p>Enterprise Integration Patterns</p>

<p>It appears he''s talking about using a Message Oriented Middleware</p>

<p>Here are some things to consider</p>

<p><strong>Security</strong></p>

<p>What will prevent another rogue service from registering as a key component in your system. You will need way to validate and verify that services are who they say they are. This can be done through a PKI system. There are scenarios that you might not need to do this, if your system is hosted entirely on your intranet. IF that is the case Social Engineering and Rogue Employees will be your biggest threat.</p>

<p><strong>Contract</strong></p>

<p>What kind of contract will your clients have with the services? Will messages all be serialized as XML and sent as a TextMessage? If you use a pure byte message you''ll have to be careful about byte order if your services are to run on multiple platforms.</p>

<p><strong>Synchronization</strong></p>

<p>Most developers are not able to comprehend and utilize asynchronous messages correctly. Where possible it might be in the best interest of your design to create a way to invoke "synchronous" messages. I''ve done this in the past by creating a sendMessageAndWait() method with a timeout and a return object. Within the method you can create a temporary topic id to receive the response, register a listener for it, then use locks to wait for a message to be returned on your temporary topic.</p>

<p><strong>Unsolicited Messages</strong></p>

<p>What happens if you want to allow your service(s) to send unsolicited messages to your clients? A critical event happened in Service A and it must notify your clients or possibly a Watch Dog service. Allow for your design to register for a common communication channel for services to communicate with clients without clients initiating the conversation.</p>

<p><strong>Failover</strong></p>

<p>What happens if a critical service processing your credit cards goes down? You''ll need to implement a Failover and Watch Dog service to ensure that your key infrastructure is always up and running. You could register a list of services within your registry then your register could give out the primary service, falling back to a secondary service if your primary stops communicating. Or if your Message Oriented Middleware can handle Round Robin messaging you might be able to register all the services on the same topic. Think about creating a way to know when a service has died. Since most messages are Asynchronous it will be difficult to determine when a service has gone offline. This can be done with a Heartbeat and Watch Dog. </p>

<p>I''ve created this type of system a few times in my past for large systems that needed to communicate. If you and other developers understand the pros and cons of such a system it can be very powerful and flexible.</p>

<p>The biggest piece of advice I can give is to build a toolkit for your other developers so they don''t have to think about how to register a service, or implement failover, or respond to messages from a client. These are the sorts of things that will kill your system and have others say it is too complicated. Making it painless for them will allow your system to work the way you need it with flexibility and decoupling while not burdening your developers with understanding enterprise design patterns.</p>

<p>This is not a Ivory Tower Architect/Architecture. It would be if he said, "This is how it will do done, now go do it and don''t bother me about it because I know I''m right." If you really wanted to reference a Anti-Pattern it could be Kitchen Sink, maybe. Nah now that I think about it, it isn''t Kitchen Sink either.</p>

<p>If you can find one please post it as a comment.
<a href="http://en.wikipedia.org/wiki/Anti-pattern" rel="nofollow">Anti-Patterns</a></p>
