<p>1 - Is there a face in the picture?</p>

<p>2 - Where is the face in the picture?</p>

<p>3 - Is the face in the picture one that the NN (Neural network) recognises?</p>

<p>In each instance I would suggest you build a separate NN and train it to answer the questions posed.</p>

<p>As for the structure of the NN, that''s a bit trickier to answer as it depends on your input data and desired output. For example if you had a 100x100 px image then I suppose its feasible to have 10,000 inputs. You might want to consider doing some preprocessing before hand to say detect ovals that way you could look and see if there are a number of ovals in a predictable outline (1 for the face, 2 for the eyes, and one for the mouth possibly). If you are preprocessing the data then you might have inputs for each oval.</p>

<p>Now for the output... for question one you could just have one output to say how sure the NN is that there is a face in the input data i.e a valuer of 0.0 (defiantly no face) --> 1.0 (defiantly a face). This way you can move onto stages 2 and 3.</p>

<p>I might say at this point that this is a non-trivial problem and you might be better to have a look at some of the frameworks available e.g. <a href="http://opencv.willowgarage.com/wiki/" rel="nofollow">OpenCV</a></p>

<p>Now for the training part, you need to have a stockpile of images available to train the NN. There are a number of ways in which you <em>could</em> train the NN. One potential solution is to use a technique called back propagation <a href="http://www.seattlerobotics.org/encoder/nov98/neural.html" rel="nofollow">1</a>, <a href="http://galaxy.agh.edu.pl/~vlsi/AI/backp_t_en/backprop.html" rel="nofollow">2</a>.  In general terms, you use the NN on an image and compare it to a predetermined output. If its wrong tweak the NN to produce the desired output and repeat.</p>

<p>If you want a good book on AI, then I would highly recommend <a href="http://rads.stackoverflow.com/amzn/click/0132071487" rel="nofollow">Artificial Intelligence: A Modern Approach</a> by Russell and Norvig. Im sure that there are more appropriate Computer Vision textbooks, but the Russell &amp; Norvig book is an excellent starter. </p>
