<blockquote>
  <p>For example, it is not generally
  permissible for one thread to modify a
  Collection while another thread is
  iterating over it. In general, the
  results of the iteration are undefined
  under these circumstances. Some
  Iterator implementations (including
  those of all the general purpose
  collection implementations provided by
  the JRE) may choose to throw this
  exception if this behavior is
  detected. Iterators that do this are
  known as fail-fast iterators, as they
  fail quickly and cleanly, rather that
  risking arbitrary, non-deterministic
  behavior at an undetermined time in
  the future. </p>
  
  <p>Note that this exception does not
  always indicate that an object has
  been concurrently modified by a
  different thread. If a single thread
  issues a sequence of method
  invocations that violates the contract
  of an object, the object may throw
  this exception. For example, if a
  thread modifies a collection directly
  while it is iterating over the
  collection with a fail-fast iterator,
  the iterator will throw this
  exception.</p>
</blockquote>

<p>That is, for all collection classes in the JDK, a change to a collection invalidates all its iterators (except the one that performed the change).</p>

<p>You could work around this by using indices rather than iterators, but that requires a random access list, and linked lists do not offer efficient random access.</p>

<p>Therefore, if you really need such a data structure, you''ll have to look beyond the JDK or implement one yourself.</p>
