<p>if <code>x &gt;= 0</code> and <code>x &lt; N</code> you can check both by:</p>

<pre><code>  if Longword( x ) &lt; Longword( N ) then ...
</code></pre>

<p>This works due to the fact that negative numbers in signed numbers correspond to the largest numbers in unsigned datatypes.</p>

<p>You could extend this (when range checking is DISABLED) to:</p>

<pre><code>  if Longword( x - A ) &lt; Longword ( ( B - A ) ) then ...
</code></pre>

<p>Now you have both tests (range <code>[ A, B &gt;</code>) in a SUB and a CMP plus a single Jcc, assuming (B - A ) is precalculated. </p>

<p>I only use these kind of optimizations when <em>really</em> needed; eg they tend to make your code less readable and it only shaves off a few clock cycles per test.</p>

<p>Note to C like language readers: Longword is Delphi''s unsigned 32bit datatype.</p>
