<pre><code>NSData *packet = [NSData dataWithBytes: &amp;msg length: sizeof(PositionPacket)];
</code></pre>

<p>So if you just wanted to send an int score, you could have a sendScore method that looked like this:</p>

<pre><code>- (void) sendScore
{
    NSError *error;
    int myScore = self.score;
    NSData *packet = [NSData dataWithBytes:&amp;myScore length:sizeof(myScore)];
    [match sendDataToAllPlayers: packet withDataMode: GKMatchSendDataUnreliable error: &amp;error];
    if (error != nil)
    {
        // handle the error
    }
}
</code></pre>

<p>Typically, you''ll want a struct so that there''s some additional information that lets the receivers know what kind of data it is.  In the example, that would have been the purpose of this line:</p>

<pre><code>msg.messageKind = PositionMessage;
</code></pre>

<p>In general, you can send anything you want encapsulated in an NSData object, since it''s just a byte bucket.  You can send primitive types like ints, or structs as in the example, or even NSObjects (as long as they implement NSCoding).  You should read up on NSKeyedArchiver, NSCoding, and NSData for more information on sending and receiving NSObjects in this way. Here is Apple''s reference document on <a href="http://developer.apple.com/library/mac/#documentation/Cocoa/Conceptual/Archiving/Archiving.html">Archving</a>.</p>

<p>As for receiving, YOU don''t call the method, it gets called ON you by the Kit. It''s what''s called a "delegate method" (in Cocoa parlance) or a "callback method." You can think of it like a "phone call" that your app can receive asynchronously.  By implementing a method with the signature:</p>

<pre><code>- (void)match:(GKMatch *)match didReceiveData:(NSData *)data fromPlayer:(NSString *)playerID;
</code></pre>

<p>...you are saying "I can receive this kind of phone call."  So when the GameKit receives data on your behalf from another player, it will see that you want to receive callbacks of that kind and will then call that method -- then it''s up to you to update your internal application state based on what is received.</p>

<p>To continue with this example, if you had sent the simple "nothing but an integer" message described above, you might implement that method like this:</p>

<pre><code>- (void)match:(GKMatch *)match didReceiveData:(NSData *)data fromPlayer:(NSString *)playerID
{
    int* receivedScorePtr = (int*)[data bytes];
    int receivedScore = *receivedScorePtr;
    [self updateScore: received forPlayer: playerID];
}
</code></pre>

<p>That is, of course, assuming that you have a method called updateScore:forPlayer: that would update a table of scores.</p>

<p>You can find a more general discussion/explanation of how delegates and delegate methods work at this blog entry: <a href="http://mohrt.blogspot.com/2010/01/cocoa-and-delegates.html">http://mohrt.blogspot.com/2010/01/cocoa-and-delegates.html</a></p>

<p><strong>ADDED:</strong> Using code the asker posted, I made a few modifications and produced a version that "works" for this bare bones use case.  <a href="http://www.2shared.com/file/03YN69yE/gkTest.html">Working Version of Test App To Send One Integer Through GameCenter</a> I make no claims about the quality of the code, or its suitability for, well, anything at all. I didn''t write 99.9% of it - please don''t take my posting of it here as an endorsement of anything that appears in it.</p>

<p>One lesson learned (that I didn''t know, so I''m putting here in hopes that it helps others) is that you can''t use the Matchmaking service with the simulator.  This means that you need two development-provisioned iOS devices in order to test this scenario, and likely, for non-trivial programs, two development machines to debug both devices simultaneously. This problem cost me the most time while figuring this out.</p>
