<p>The short version:</p>

<ul>
<li>The ambiguity error is, bizarrely enough, correct.</li>
<li>The C# 4 compiler also produces a spurious error after the correct ambiguity error. That appears to be a bug in the compiler.</li>
</ul>

<p>The long version:</p>

<p>We have an overload resolution problem.  Overload resolution is extremely well specified.</p>

<p>Step one: determine the candidate set.  That''s easy. The candidates are <code>Foo(Func&lt;IEnumerable&lt;String&gt;&gt;)</code> and <code>Foo(Func&lt;String&gt;)</code>.</p>

<p>Step two: determine which members of the candidate set are <em>applicable</em>. An applicable member has every argument convertible to every parameter type.</p>

<p>Is <code>Foo(Func&lt;IEnumerable&lt;String&gt;&gt;)</code> applicable?  Well, is <code>X</code> convertible to <code>Func&lt;IEnumerable&lt;String&gt;</code>?  </p>

<p>We consult section 6.6 of the spec. This part of the specification is what we language designers call "really weird". Basically, it says that <em>a conversion can exist, but using that conversion is an error</em>.  (There are good reasons why we have this bizarre situation, mostly having to do with avoiding future breaking changes and avoiding "chicken and egg" situations, but in your case we are getting somewhat unfortunate behaviour as a result.)</p>

<p>Basically, the rule here is that a conversion from X to a delegate type with no parameters <em>exists</em> if overload resolution on a call of the form <code>X()</code> would succeed. Clearly such a call <em>would</em> succeed, and therefore a conversion exists. Actually <em>using</em> that conversion is an error because the return types don''t match, but <em>overload resolution always ignores return types</em>. </p>

<p>So, a conversion exists from <code>X</code> to <code>Func&lt;IEnumerable&lt;String&gt;</code>, and therefore that overload is an applicable candidate.</p>

<p>Obviously for the same reason the other overload is also an applicable candidate.</p>

<p>Step Three: We now have two applicable candidates. Which one is "better"?</p>

<p>The one that is "better" is the one with the <em>more specific</em> type. If you have two applicable candidates, <code>M(Animal)</code> and <code>M(Giraffe)</code> we choose the Giraffe version because a Giraffe is more specific than an Animal. We know that Giraffe is more specific because every Giraffe is an Animal, but not every Animal is a Giraffe.</p>

<p>But in your case neither type is more specific than the other. There is no conversion between the two Func types.</p>

<p>Therefore neither is better, so overload resolution reports an error.</p>

<p>The C# 4 compiler then has what appears to be a bug, where its error recovery mode picks one of the candidates anyways, and reports <em>another</em> error. It''s not clear to me why that is happening. Basically it is saying that error recovery is choosing the IEnumerable overload, and then noting that the method group conversion produces an untenable result; namely, that string is not compatible with <code>IEnumerable&lt;String&gt;</code>.</p>

<p>The whole situation is rather unfortunate; it might have been better to say that there is no method-group-to-delegate conversion if the return types do not match.  (Or, that a conversion that produces an error is always worse than a conversion that does not.) However, we''re stuck with it now. </p>

<p>An interesting fact: the conversion rules for lambdas <em>do</em> take into account return types. If you say <code>Foo(()=&gt;X())</code> then we do the right thing. The fact that lambdas and method groups have different convertibility rules is rather unfortunate.</p>

<p>So, summing up, the compiler is actually a correct implementation of the spec in this case, and this particular scenario is an unintended consequence of some arguably unfortunate spec choices.</p>
',NULL,NULL,NULL,NULL,88656,4573011,'2011-01-05T17:48:20.010',5,NULL,NULL,22,NULL,NULL,2,88656,NULL,'2011-01-01T17:33:37.810',NULL,4574930,'2011-01-05T17:48:20.010');
