<p>My idea is <code>select ... for update no wait</code> to lock the relevant rows, then offload the data into another system, then <code>rollback</code> to unlock the rows. No two <code>select ... for update</code> queries will select the same row, and the second <code>select</code> will fail immediately rather than wait and proceed.</p>

<p>But you don''t seem to mark offloaded records in any way; I don''t see why two <em>non-consecutive</em> selects won''t happily select overlapping range. So I''d still <code>update</code> the records with a flag and/or a target user name and would only select records with the flag unset.</p>
