<p>Incidentally, the concept of using a mixture of constant and mutable objects in an adventure goes back at least to 1980.  In Warren Robinett''s "Adventure" cartridge for the 2600, each object has a number of pointers stored in ROM for things like position and state, so objects which aren''t going to move (such as the castle gates or the "signature") don''t need to have their position stored in RAM, and most grabbable objects (which don''t have any state other than their position) won''t need to store a state in RAM, but animated objects like the dragons and bat can store both state and position in RAM.  On a machine with 128 bytes of RAM total, such savings were critical.</p>
