<p>The only difference you have is which programming language you need to use. On Android you have to use Java. So if an Android application is waiting for the connection your application needs to open a <a href="http://developer.android.com/reference/java/net/ServerSocket.html" rel="nofollow">ServerSocket</a> and listen of incoming connections.</p>

