<p>( Example from <a href="http://msdn.microsoft.com/en-us/library/system.windows.controls.validation.errortemplate.aspx">http://msdn.microsoft.com/en-us/library/system.windows.controls.validation.errortemplate.aspx</a> )</p>

<p>To enable/disable a button you could use something along the line of</p>

<pre><code>&lt;Button x:Name="btnOK" Content="OK" IsDefault="True" Click="btnOK_Click"&gt;
  &lt;Button.Style&gt;
    &lt;Style TargetType="{x:Type Button}"&gt;
      &lt;Setter Property="IsEnabled" Value="false" /&gt;
      &lt;Style.Triggers&gt;
        &lt;MultiDataTrigger&gt;
          &lt;MultiDataTrigger.Conditions&gt;
            &lt;Condition Binding="{Binding ElementName=txt1, Path=(Validation.HasError)}" Value="false" /&gt;
            &lt;Condition Binding="{Binding ElementName=txt2, Path=(Validation.HasError)}" Value="false" /&gt;
          &lt;/MultiDataTrigger.Conditions&gt;
          &lt;Setter Property="IsEnabled" Value="true" /&gt;
        &lt;/MultiDataTrigger&gt;
      &lt;/Style.Triggers&gt;
    &lt;/Style&gt;
  &lt;/Button.Style&gt;
&lt;/Button&gt;
</code></pre>

<p>or you could implement ICommand and use command binding.</p>

<p><strong>EDIT</strong></p>

<p>Here is a fully working example. It displays a window with two TextBoxes. The Button is enabled if and only if both TextBoxes are non-empty. Create a project called ValidationDemo and put the following files in it:</p>

<p><strong>MainWindow.xaml:</strong></p>

<pre><code>&lt;Window x:Class="ValidationDemo.MainWindow"
        xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
        xmlns:x="http://schemas.microsoft.com/winfx/2006/xaml"
        Title="MainWindow" Height="146" Width="223"&gt;
  &lt;Window.Resources&gt;
    &lt;Style TargetType="{x:Type TextBox}"&gt;
      &lt;Style.Triggers&gt;
        &lt;Trigger Property="Validation.HasError" Value="true"&gt;
          &lt;Setter Property="ToolTip" Value="{Binding RelativeSource={x:Static RelativeSource.Self}, Path=(Validation.Errors)[0].ErrorContent}"/&gt;
        &lt;/Trigger&gt;
      &lt;/Style.Triggers&gt;
    &lt;/Style&gt;
  &lt;/Window.Resources&gt;
  &lt;Grid&gt;
    &lt;Label Content="A" Height="28" HorizontalAlignment="Left" Margin="46,7,0,0" Name="label1" VerticalAlignment="Top" /&gt;
