  <p>So, does someone know, if my suspicion is right and that MinGW comes with an outdated OpenGL version?</p>
</blockquote>

<p>MinGW comes without "an OpenGL", your operating system (the graphics card driver, usually) provides OpenGL.</p>

<p>MinGW provides a header file (<code>gl.h</code>), and a corresponding library (<code>libopengl32.a</code>) which is a wrapper for <code>opengl32.dll</code>, a dynamic library which comes with Windows and contains the handles to OpenGL 1.0 an 1.1 functions... something around that, not sure about exact version numbers.</p>

<p>Then:</p>

<p>Most operating systems allow you to use the whole OpenGL in a similar way.</p>

<p>On Windows, however, in order to access the newer OpenGL functions than what''s in the header and library wrapper (which you probably do have available - depending on your GPU and driver), you have to use system calls to load the function pointers to the OpenGL calls.</p>

<p>There are libraries which do that for you and let you use OpenGL 3/4 functionality easily. I recommend <code>gl3w</code> or <code>GLEW</code>. That''s the usual way of using OpenGL on Windows.</p>
