<p>To me this sounds like selecting all <em>elements</em> that don''t have other elements as children. But then again, "text" in your example is <strong>not</strong> an element, but a text node, so I''m not really sure what do you want to select... 
Anyway, here is a solution for selecting such <em>elements</em>.</p>

<pre><code>//*[not(*)]
</code></pre>

<p>Selects all elements that don''t have an element as a child. Replace the first * with an element name if you only want to select certain elements that don''t have child elements. Also note that using <code>//</code> is generally slow since it runs through the whole document. Consider using more specific path when possible (like <code>/div/*[not(*)]</code> in this case).</p>
