<p>Here''s what you can try: the IMAP protocol requires that each message has a <em>unique identifier</em> and each mailbox has a <em>unique identifier validity value</em>. The combination of a <em>unique identifier</em> and the <em>unique identifier validity value</em> of the message''s mailbox is guaranteed to never refer to different messages. So if you use that to identify messages, you are at least guaranteed not to accidentally delete the wrong message.</p>

<p>The problem is, the <em>unique identifier validity value</em> is guaranteed to stay the same only for the duration of the IMAP session. PHP usually creates a new IMAP session with every page request and closes the session at the end of the request. On the other hand, the IMAP specification suggests, that unique identifiers stay the same even across sessions. This makes the following approach seem practical:</p>

<ol>
<li>Identify messages by unique identifier (e.g. by using them as value-attributes on checkboxes that are used to select messages.).</li>
<li>Store the <em>unique identifier validity value</em> of the mailbox as a hidden field in the form.</li>
<li>When processing form submissions, check whether the <em>unique identifier validity value</em> submitted via the form is the same as the current one.</li>
<li><em>Beware</em>: there are IMAP servers, that use a different <em>unique identifier validity value</em> for every session. You won''t be able to do anything useful if you happen to have such an implementation.</li>
</ol>

<p>You can get the current <em>unique identifier validity value</em> by calling <a href="http://www.php.net/manual/en/function.imap-mailboxmsginfo.php" rel="nofollow">imap_mailboxmsginfo</a>. Most other functions from PHP''s IMAP extension have a parameter <code>$options</code>, that you can use specify that you are using the <em>unique identifier</em> instead of the <em>message sequence number</em> (an other means to identify messages, that is even more volatile than the <em>unique identifier</em>).</p>

<p>See <a href="http://www.rfc-editor.org/rfc/rfc3501.txt" rel="nofollow">RFC 3501</a> for details about the IMAP protocol, especially <em>2.3.1 Message Numbers</em>.</p>
',NULL,NULL,NULL,NULL,534124,4574141,'2011-01-01T19:45:50.553',1,NULL,NULL,0,NULL,NULL,2,534124,NULL,'2011-01-01T19:40:09.977',NULL,4575425,'2011-01-01T19:45:50.553');

<pre><code>XElement Quota = XDocument.Descendants("traffic").Attributes("quota");
</code></pre>

<p>the result of <code>Descendants("traffic")</code> is an <code>IEnumerable</code>, not an <code>XElement</code>.  in the line above that you''re already getting <code>First</code> of that enumerable, which is the item you want, isn''t it?</p>

<p>the quota line should be:</p>

<pre><code>XElement Quota = Traffic.Attributes("quota");
</code></pre>

<p>Style wise, most people make local variables lower cased, like <code>traffic</code> and <code>quota</code> and <code>data</code> to distinguish them from class level properties and members.</p>

<p><strong>Update:</strong> it looks like <code>Attributes("quota")</code> returns <code>IEnumerable&lt;XAttribute&gt;</code>, so that quota line should be:</p>

<pre><code>XAttribute Quota = Traffic.Attributes("quota").FirstOrDefault();
</code></pre>

<p>or to simplify:</p>

<pre><code>var traffic = XDocument.Descendants("traffic").First();   
var quota = traffic.Attributes("quota").FirstOrDefault();
</code></pre>

<p>I don''t want to be <em>mean</em>, but fixing compiler errors like this should be something you shouldn''t have to come to stackoverflow for.  The compiler error itself is telling you what the problem is: the method returns a type other than what <em>you</em> said it does.  Using <code>var</code> can simplify some of that.</p>
