<p>In the WPF example the Popup and the ToggleButton (the arrow on the right) are bound with the property IsDropDownOpen:</p>

<pre><code>&lt;Popup IsOpen="{TemplateBinding IsDropDownOpen}" ...

&lt;ToggleButton IsChecked="{Binding Path=IsDropDownOpen,Mode=TwoWay,RelativeSource={RelativeSource TemplatedParent}}" ...
</code></pre>

<p>A class <code>Popup</code> has the property <code>StaysOpen</code> that isn''t specified in the standard template of a ComboBox and has a default value <code>true</code>. It follows that there is a subscription to the <code>LostFocus</code> event in the internal implementation of a ComboBox, that sets <code>IsDropDownOpen=false</code> every time when the control lose a focus.</p>

<p>Silverlight has no bindings in xaml, but you will find the same sequence if you open the assembly in .Net Reflector.</p>
