<p><code>V_out = V_ref * T_out/T_ref</code> which is equivalent to <code>T_out = T_ref * (V_out/V_ref)</code></p>

<p>So say your voltage is 2.982V at 25 degrees C or 298.15 degrees Kelvin (this is suggested in datasheet), then you can set your equation to:</p>

<p><code>T_out = (298.15 Kelvin)(V_out/2.982V)-273.15</code> </p>

<p>So assuming you already can convert an analog reading into a voltage*, just plug in the measured voltage and this should give you your temp in degrees C.</p>

<p>*The Arduino has a built-in 10-bit ADC and the maximum voltage it can read is 5v. Therefore, you can factor in 5v/1024 ADC steps = 0.00488V per ADC step. (i.e. <code>V_out = firstSensor*0.00488</code>). So plugging in for V_out, the equation becomes:</p>

<p><code>T_out = (298.15)(firstSensor*0.001637)-273.15</code> where 0.001637 = 0.00488/2.982.</p>
