<p>-</p>

<p>Anyway, I''ve boiled down the "working code" to a few lines.</p>

<pre><code>from ItemList item in myList
where status.Contains(item.status)
group item by item.ItemID into groupedItems
order by groupedItems.Key descending
let firstItem = groupedItems.First()
let routes =
  from item2 in groupedItems
  select item2.Routes.First()
from route in routes
select new
{
  TheItemList = firstItem,
  TheWayPoint = route
};
</code></pre>

<p>You need to learn how to query the result of the group by operation.  In the above code, I have extracted the first element from each group, and I have projected each element of the group, then joined on that projection.</p>

