<p>The first thing I would check is that the second input argument <code>A{1,1}</code> is of the correct form. Specifically, <code>A{1,1}</code> would have to be a <a href="http://www.mathworks.com/help/techdoc/matlab_prog/br04bw6-98.html" rel="nofollow">cell array</a> or a matrix of <a href="http://www.mathworks.com/help/techdoc/matlab_prog/f2-12135.html#f2-101310" rel="nofollow">doubles</a>. If it is of any other form, like a <a href="http://www.mathworks.com/help/techdoc/matlab_prog/br04bw6-38.html" rel="nofollow">structure</a> or a matrix of <a href="http://www.mathworks.com/help/techdoc/matlab_prog/f2-12135.html" rel="nofollow">any</a> <a href="http://www.mathworks.com/help/techdoc/matlab_prog/f2-97022.html" rel="nofollow">other</a> <a href="http://www.mathworks.com/help/techdoc/matlab_prog/f2-47856.html" rel="nofollow">class</a>, you will get the error you are seeing. Admittedly, this particular error isn''t handled very well by the subfunction <code>simargs</code>, in that it gives you some cryptic messages that don''t really tell you the basic problem, which is that your input is not in the right format.</p>

<p>Here are a couple things to check:</p>

<ul>
<li><p>Do you really mean to pass the <em>first element</em> of cell array <code>A</code> as an input argument, or do you mean to simply pass the cell array itself? If it''s the second option, just do this:</p>

<pre><code>y = sim(net,A);
</code></pre></li>
<li><p>If you <em>do</em> mean to pass the first element of <code>A</code> as an input argument, double-check it''s class using the function <a href="http://www.mathworks.com/help/techdoc/ref/class.html" rel="nofollow">CLASS</a>:</p>

<pre><code>class(A{1,1})
</code></pre>

<p>If you don''t see <code>double</code> displayed, it means the first element of <code>A</code> is not the right type. If it is a matrix, you can <a href="http://www.mathworks.com/help/techdoc/ref/double.html" rel="nofollow">convert it to double</a> before you pass it to <a href="http://www.mathworks.com/help/toolbox/nnet/sim.html" rel="nofollow">SIM</a> like so:</p>

<pre><code>y = sim(net,double(A{1,1}));
</code></pre></li>
</ul>
