<p>''<em>The LineTo function draws a line from the current position up to, but not including, the specified point.</em>''</p>

<p>Because of this, using GDI your line is drawn from (1,3)-(4,1), if you use these same coordinates in GDI+ you will see that the pixel structure of the line matches what you see in older versions of Paint, except of course that the last pixel at (5,1) is not drawn. A program like Paint would then just add the additional pixel to complete the line.</p>

<p>Using straight GDI would require that you handle the interop for creating pens, selecting object into the DC deleteing the objects etc. all very possible but ultimately inconvenient. You could rather simulate this in GDI+ by drawing a line that is one pixel short and then draw a line from that endpoint to the final endpoint, this will fill in the last pixel.</p>

<p><strong>Note:</strong> I say older versions of Paint, because if you use Paint in Windows 7 for example you will see that the line is drawn correctly.</p>

<p>For fun I thought I would quickly show how you might use classic GDI from .NET, here is some interop code.</p>

<pre><code>[DllImport("gdi32")]
static extern bool MoveToEx(IntPtr hdc, int x, int y, out Point point);

[DllImport("gdi32")]
static extern bool LineTo(IntPtr hdc, int x, int y);

[DllImport("gdi32")]
static extern IntPtr SelectObject(IntPtr hdc, IntPtr hgdiobj);

[DllImport("gdi32")]
static extern IntPtr CreatePen(int penStyle, int width, int color);

[DllImport("gdi32")]
static extern bool DeleteObject(IntPtr hgiobj);

private void Form1_Paint(object sender, PaintEventArgs e)
{
  Point ignore;
  IntPtr hdc = e.Graphics.GetHdc();
  IntPtr pen = CreatePen(1, 1, ColorTranslator.ToWin32(Color.Red));
  IntPtr oldPen = SelectObject(hdc, pen);
  MoveToEx(hdc, 1, 3, out ignore);
  LineTo(hdc, 5, 1);                
  SelectObject(hdc, oldPen);
  DeleteObject(pen);      
}
</code></pre>

<p>Notice how the line is actually one pixel short. Personally I would go with a native .NET solution using the Graphics device and just dermine the correct line coordinate to replicate the clasic GDI functionality.</p>

<p>I thought you might be interested to know why GDI leaves off the last pixel, it was common to use XOR to draw a line on the screen that would make removing the same line very simple, just redraw the line with XOR and it is removed with the original background intact. Of course this ment that you need to be careful not to draw over a pixel twice otherwise you would leave artifacts on the screen. </p>

<p>Since it is common to use draw a shape using multiple <code>LineTo</code> calls you can now call LineTo 3 time to draw a triangle for example and not be concerned that the first point of each line will overlap the last point of the previous line and cause the said artifacts when using XOR for example, susequent calls to LineTo can safely start at where the previous line ended because the last pixel of the previous line was not drawn.</p>
',NULL,NULL,NULL,NULL,314028,4573527,'2011-01-01T22:07:23.573',4,NULL,NULL,4,NULL,NULL,2,314028,NULL,'2011-01-01T21:34:04.997',NULL,4575879,'2011-01-01T22:07:23.573');

