<p>In any case this code looks suspicious. Index arrays such as your <code>y[]</code> that you''d have to cast from <code>char</code> to <code>int</code> smell of a weak type design. Indexing with <code>char</code> without taking care of the possible signedness problems is just dangerous. Index types should always be unsigned types.</p>

<p>A macro like your <code>MAX</code> that makes implicit assumptions that both expressions have the same signedness and width is also dangerous. Replace it with a function <code>intmax_t MAX(intmax_t, intmax_t)</code> or something like that.</p>

<p>Redesign the types properly and your problem will solve itself.</p>

<p>clang as a compiler is quite good for debugging macros. Other than gcc e.g he is able to keep track of the expansion of macros and is sometimes able to put your nose on a problematic macro expansion.</p>
