<p>In the JS examples you declared the object <strong>mongo</strong></p>

<pre><code>&gt; var mongo = db.things.findOne({name:"mongo"});
</code></pre>

<p>Then, you modified the <em>same</em> object to add <strong>type</strong> ...</p>

<pre><code>&gt; mongo.type = "database";
</code></pre>

<p>In the PHP example you declared TWO objects ...</p>

<pre><code>$a=array(''_id''=&gt;''test_a'',''field1''=&gt;''anything'');
$b=array(''_id''=&gt;''test_a'',''field2''=&gt;''anything else'');
</code></pre>

<p>This would be like doing the following in the JS shell ...</p>

<pre><code>&gt; var apples = db.things.findOne({name:"mongo"});
&gt; var orange = db.things.findOne({type:"database"});
</code></pre>

<p>So <strong>apples</strong> is a different object/document from <strong>oranges</strong> ... hence when you run <strong>save()</strong> and pass the NEW object it totally overwrites the old object.</p>

<p>Your <strong>update()</strong> worked fine because you searched for the object ...</p>

<pre><code>$filter=array(''_id''=&gt;''test_a'');
</code></pre>

<p>Then ran the update on <em>that object</em>; passing the new field instead of passing a <em>new object</em> to replace it ...</p>

<pre><code>$update=array(''$set''=&gt;array(''field2''=&gt;''anything else''));
$c-&gt;update($filter,$update);
</code></pre>

<p>In the JS examples you only had <em>one object</em> so it basically appended it on the update instead of replacing it.</p>

<p><strong>Correct PHP Code</strong></p>

<p>The following PHP would replicate what you were doing in the JS shell ...</p>

<pre><code>&lt;?php

$connection = new Mongo();
$db = $connection-&gt;foo;
$collection = $db-&gt;testing;

// create new object &amp; save
$a = array(''color''=&gt;''red'');
$collection-&gt;save($a);

// add type = fruit to existing object &amp; save
$a[''type''] = ''fruit'';
$collection-&gt;save($a);

// print out results.
echo "&lt;pre&gt;";
var_dump($collection-&gt;findOne(array("color" =&gt; "red")));
echo "&lt;/pre&gt;";

?&gt;
</code></pre>

<p><strong>Note</strong>: I''d <em>strongly</em> recommend you don''t set your own object <strong>_id</strong>''s and instead let the driver do it for you as I did in the example above.</p>
