<p>First, you should use insertion sort for small n, I''d say when n&lt;10, but test it out and find the sweet spot.</p>

<p>Second, as James suggested, the sorting should be done in place. The way you do this is by passing around indices in the recursive call, along with the original array. eg you have the array a and the indices 0 and 20. If the pivot is then in index 9, the recursive calls would be: partition(a, 0, 8) and partition(a, 10, 20).</p>

<p>Third, you might consider writing your own simple pseudopolynomial random number generator, instead of using the one provided by Java. However, I suggest trying the other optimizations first, as they could very well be enough.</p>
