<pre><code>from itertools import combinations

def partitions(*args):
    def helper(s, *args):
        if not args: return [[]]
        res = []
        for c in combinations(s, args[0]):
            s0 = [x for x in s if x not in c]
            for r in helper(s0, *args[1:]):
                res.append([c] + r)
        return res
    s = range(sum(args))
    return helper(s, *args)

print partitions(2, 0, 2)
</code></pre>

<p>The output is:</p>

<pre><code>[[(0, 1), (), (2, 3)], [(0, 2), (), (1, 3)], [(0, 3), (), (1, 2)], [(1, 2), (), (0, 3)], [(1, 3), (), (0, 2)], [(2, 3), (), (0, 1)]]
</code></pre>

<p>It is adequate for translating the algorithm to Lua/Java. It is basically the second idea I had.</p>

<p><br></p>

<h2>The Algorithm</h2>

<p>As I already mentionend in the question the basic idea is as follows:</p>

<p>First choose <code>n_1</code> elements of the set <code>s := {0,...,n_1+n_2+...+n_n-1}</code> and put them in the
first set of the first tuple in the resulting list (e.g. <code>[({0,1,2},...</code> if the chosen elements are <code>0,1,2</code>). Then choose <code>n_2</code> elements of the set <code>s_0 := s without the n_1 chosen elements beforehand</code> and so on. One such a tuple might be <code>({0,2},{},{1,3},{4})</code>. Of
course, every possible combination is created so <code>({0,4},{},{1,3},{2})</code> is another such tuple and so on.</p>

<h3>The Realization</h3>

<p>At first the set to work with is created (<code>s = range(sum(args))</code>). Then this set and the arguments are passed to the recursive helper function <code>helper</code>. </p>

<p><code>helper</code> does one of the following things: If all the arguments are processed return "some kind of empty value" to stop the recursion. Otherwise iterate through all the combinations of the passed set <code>s</code> of the length <code>args[0]</code> (the first argument after <code>s</code> in <code>helper</code>). In each iteration create the set <code>s0 := s without the elements in c</code> (the elements in <code>c</code> are the chosen elements from <code>s</code>), which is then used for the recursive call of <code>helper</code>.</p>

<p>So what happens with the arguments in <code>helper</code> is that they are processed one by one. <code>helper</code> may first start with <code>helper([0,1,2,3], 2, 1, 1)</code> and in the next invocation it is for example <code>helper([2,3], 1, 1)</code> and then <code>helper([3], 1)</code> and lastly <code>helper([])</code>. Of course another "tree-path" would be <code>helper([0,1,2,3], 2, 1, 1)</code>, <code>helper([1,2], 1, 1)</code>, <code>helper([2], 1)</code>, <code>helper([])</code>. All these "tree-paths" are created and thus the required solution is generated.</p>
