<blockquote>
  <p><code>svn:date</code></p>
  
  <p>Contains the UTC time the revision was created, in ISO 8601 format. The value comes from the server machine''s clock, not the client''s.</p>
</blockquote>

<p><a href="http://dotat.at/tmp/ISO_8601-2004_E.pdf" rel="nofollow">ISO 8601</a> still allows for a large number of different formats, and time zone indicators are not mandatory. However, if you take a look at the value of <code>svn:date</code> like this:</p>

<pre><code>svn propget --revprop -r HEAD http://example.com/svn
</code></pre>

<p>Then the result will be something like this:</p>

<pre><code>2010-12-23T00:45:41.552600Z
</code></pre>

<p>That <code>Z</code> at the end is the indicator for the <strong>UTC timezone</strong>, and Subversion always uses that timezone to record the commit datetime.</p>
