<p><a href="http://wiki.apache.org/httpd/InternalDummyConnection" rel="nofollow">http://wiki.apache.org/httpd/InternalDummyConnection</a></p>

<p>Theses #$!"#sh#f#ck*$! connections are making a lot of bugs around there, (cache things, no HTTP/1.1, etc). One ''simple'' solution is not having your hostname based Virtuahost serving you main application as the default virtualhost. Keep a very simple default virtualhost with the ''it works'' page, or something very simple "if you get this page you might try to get a browser with HTTP/1.1 support somewhere", as a static page. Then all HTTP/1.0 traffic or people accessing your server by IP only, will not be in your real application.</p>

<p>To be complete I''ve seen a company this year with bad proxies removing the Host header from all their outgoing HTTP traffic. But theses bad guys are dumbs, I don''t think there''s a lot of people still browsing in HTTP/1.0 without hosts.</p>
