<p>I think the <code>properties</code> property might be what you are looking for (it is left out of the new <a href="http://developers.facebook.com/docs/reference/api/post/" rel="nofollow">API reference</a> but is described <a href="http://developers.facebook.com/docs/guides/attachments" rel="nofollow">here</a>). This allows links although they might not be formatted quite how you want. Example:</p>

<pre><code>$data = array (
           ''name''       =&gt; ...,
           ''link''       =&gt; ...,
           ''properties'' =&gt; array (
                              ''Yes'' =&gt; array  (
                                        ''text'' =&gt; ''Vote'',
                                        ''href'' =&gt; ''http://www.example.com?vote=yes''
                                       ),
                              ''No'' =&gt; array  (
                                        ''text'' =&gt; ''Vote'',
                                        ''href'' =&gt; ''http://www.example.com?vote=no''
                                       )
                           ),
         ); //And whatever other properties you want
$facebook-&gt;api(''/uid/feed'', ''POST'', $data);
</code></pre>

<p>The properties will appear after beneath description in the post and come out like the following:</p>

<blockquote>
  <p>Yes: <a href="http://www.example.com?vote=yes" rel="nofollow">Vote</a></p>
</blockquote>
