<pre><code>template &lt;typename InIt1, InIt2, OutIt1, OutIt2&gt;
void foo(InIt1 in_begin, InIt2 in_end, OutIt1 out_begin, OutIt2 out_end) { }
</code></pre>

<p>then you can very easily write a <code>back_inserter_end</code> class to test against:</p>

<pre><code>class back_inserter_end 
    : std::iterator&lt;std::output_iterator_tag, void&gt;
{ };

bool operator==(back_inserter_end, back_inserter_end) { return true;  }
bool operator!=(back_inserter_end, back_inserter_end) { return false; }

template &lt;typename Container&gt;
bool operator==(const back_insert_iterator&lt;Container&gt;&amp;, back_inserter_end) { 
     return false; 
}

template &lt;typename Container&gt;
bool operator==(back_inserter_end, const back_insert_iterator&lt;Container&gt;&amp;) { 
    return false; 
}

template &lt;typename Container&gt;
bool operator!=(const back_insert_iterator&lt;Container&gt;&amp;, back_inserter_end) { 
    return true; 
}

template &lt;typename Container&gt;
bool operator!=(back_inserter_end, const back_insert_iterator&lt;Container&gt;&amp;) { 
    return true; 
}
</code></pre>

<p>You can then call your "safe" algorithm:</p>

<pre><code>foo(it, it, std::back_inserter(v), back_inserter_end());
</code></pre>

<p>Inside of your "safe" algorithm, you can test whether <code>out_it == out_end</code> before using <code>out_it</code>; since <code>out_it</code> is a <code>back_insert_iterator</code>, this test will always return <code>false</code> (which is the desired behavior).</p>
