<p>You base your view on a ViewModel as you would normally, however you copy the view model into a ''DisplayModel'' local variable that you use for display purposes.  The values in this can be set locally during the development demo stage - if no values have been supplied by the controller.</p>

<pre><code>&lt;%@ Page Language="C#" Inherits="System.Web.Mvc.ViewPage&lt;MyViewModel&gt;" %&gt;

&lt;%
  MyViewModel displayModel = MyViewModel;

  if (displayModel == null) 
  {
     displayModel = new MyViewModel {
        Property1 = "Test Value 1",
        Property2 = 100.00,
        Property3 = true
     };
  }
%&gt;

