<p>I managed to get it working. Here is a form <code>Load</code> event handler (WinForms) that causes the Web Browser control to load <a href="http://www.google.com" rel="nofollow">http://www.google.com</a> and then clicks "I''m feeling lucky" button:</p>

<pre><code>    Imports mshtml

Public Class Form1

    Private Sub Form1_Load(ByVal sender As System.Object, ByVal e As System.EventArgs) Handles MyBase.Load
        Dim clicked As Boolean = False
        Dim doc As IHTMLDocument2 = Nothing
        Dim form As IHTMLFormElement = Nothing
        Dim input As HTMLInputElement = Nothing
        Dim forms As IHTMLElementCollection = Nothing

        AxWebBrowser1.Navigate2("http://www.google.com")

        While AxWebBrowser1.ReadyState &lt;&gt; SHDocVw.tagREADYSTATE.READYSTATE_COMPLETE
            Application.DoEvents()
        End While

        doc = CType(AxWebBrowser1.Document, IHTMLDocument2)

        For i As Integer = 0 To doc.forms.length - 1
            form = CType(doc.forms.item(i, i), IHTMLFormElement)

            For j As Integer = 0 To form.length - 1
                If TypeOf (form.elements(j)) Is HTMLInputElement Then
                    input = CType(form.elements(j), HTMLInputElement)

                    If String.Compare(input.name, "btnI", StringComparison.InvariantCultureIgnoreCase) = 0 Then
                        input.click()
                        clicked = True
                        Exit For
                    End If
                End If
            Next

            If clicked Then
                Exit For
            End If
        Next
    End Sub
End Class
</code></pre>

<p>If you need to click on a link then just change <code>HTMLInputElement</code> to <code>HTMLLinkElement</code> (in declaration and cast operation). </p>

<p>I suppose you''re not using WinForms but if you do so, I''d suggest you to switch to the <a href="http://msdn.microsoft.com/en-us/library/system.windows.forms.webbrowser.aspx" rel="nofollow">.NET version of the WebBrowser control</a>.</p>

<p>Hope this will help you.</p>

<p>-- Pavel</p>
