<p>To run a python server which depends on virtualenv as daemon service with supervisord, here is the configuration I am using in a production environment.</p>

<pre><code>[program:web01]
command=/home/victorlin/tg2env/bin/paster serve production.ini ;
process_name=%(program_name)s ;
directory=/home/victorlin/ ;
user=victorlin ;
priority=999 ;
redirect_stderr=true ;
stdout_logfile=/home/victorlin/logs/web01_out.txt ;
stderr_logfile=/home/victorlin/logs/web01_err.txt ;
environment=PYTHON_EGG_CACHE=/home/victorlin/.python-eggs ;
</code></pre>

<p>You can use /path/to/virtualenv/bin/python to run your own python script in the command field. And, to run the supervisord on start-up, you can write crontab like this in your root account:</p>

<pre><code>@reboot /usr/local/bin/supervisord -c /home/root/supervisord.conf 
</code></pre>

<p>Of course, if you don''t have port numbers lower than 1024 to open, you can write this start-up crontab in a non-privilege account.</p>
