<ul>
<li>The App Engine receives email at the following address:  <em>string@appid.appspotmail.com</em></li>
</ul>

<p><a href="http://code.google.com/appengine/docs/python/mail/receivingmail.html">http://code.google.com/appengine/docs/python/mail/receivingmail.html</a></p>

<p>The problem I see with this is that you would need to have your users setup forwarding rules in their Google Accounts so that incoming mail is forwarded to your app using the above format.  This means that they would need to rely on another email service, which would beg the question of what value yours would add over top of the existing service.</p>

<p>Sending is not quite so bad.  The Google App Engine App can send mail on behalf of users logged in with their Google Account, so one could build an outbound email client using a user''s Google Account.</p>

<p><a href="http://code.google.com/appengine/docs/python/mail/sendingmail.html">http://code.google.com/appengine/docs/python/mail/sendingmail.html</a></p>

<p>For receiving mail, there are instructions here on how to do that by forwarding mail from an existing email client.  It is currently not possible to use your own domain to receive emails without forwarding:</p>

<p><a href="http://stackoverflow.com/questions/1698802/custom-incoming-mail-domain-with-google-app-engine">Custom Incoming Mail Domain With Google App Engine</a></p>

<p>In summary, to answer your question, if someone has built an email client on App Engine, they have not made it public or done enough marketing to appear in search results.  Even so, their implementation would be subject to the limitations described above.</p>
