<p>GAE blocks all incoming and outgoing RAW Socket traffic; to access the outside cloud you need to use the <a href="http://code.google.com/appengine/docs/python/urlfetch/" rel="nofollow">URLFetch API</a>, and it only allows you to access HTTP websites. So you can''t talk POP3 or IMAP from your app, nor you can listen to SMTP traffic.</p>

<p>You''d need some intermediate service that relays POP3 or IMAP through an HTTP web service running on a server outside GAE, like a VPS, EC2, Rackspace, etc.</p>
