Here is where it gets tricky. Inside the folder where you unzipped the contents of the application, you’ll find a file named classes.dex. That’s the most important file of the whole application, containing all the java files, but it’s encrypted! No worries, that can easily be solved. You’ll need two things:</p>

<ol>
<li>Dex2Jar from <a href="http://code.google.com/p/dex2jar/">http://code.google.com/p/dex2jar/</a></li>
<li>A regular Java decompiler, such as JD from <a href="http://java.decompiler.free.fr">http://java.decompiler.free.fr</a></li>
</ol>

<p>Copy classes.dex to the folder where you unzipped Dex2Jar, and run from the command line: “dex2jar.bat classes.dex”
This will produce a file, strangely named something like: “classes.dex.dex2jar.jar” If you have WinRAR installed, you can just unpack the files. If you don’t, install it.
Now go ahead and adjust it to your liking!</p>
