<pre><code>&lt;html&gt;&lt;body&gt;&lt;script type="text/javascript" src="http://connect.facebook.net/en_US/all.js"&gt;&lt;/script&gt;&lt;/body&gt;&lt;/html&gt;
</code></pre>

<p>Here''s the code to initialize the FB Javascript SDK. Put this at the very end of your HTML files, substituting in the appropriate values and URLs.</p>

<pre><code>&lt;script type="text/javascript" src="http://connect.facebook.net/en_US/all.js"&gt;&lt;/script&gt;&lt;script type="text/javascript"&gt;FB.init({appId: ''1234567890'', status: true, cookie: true, xfbml: true,channelUrl: ''http://example.com/xss_channel.htm''});&lt;/script&gt;
</code></pre>

<p>Optionally, put this in your web.config where the XSS channel file is located. This lets browsers cache the file indefinitely as recommended by Facebook.</p>

<pre><code>  &lt;?xml version="1.0" encoding="UTF-8"?&gt;
  &lt;configuration&gt;
      &lt;location path="xss_channel.htm"&gt;
          &lt;system.webServer&gt;
              &lt;httpProtocol&gt;
                  &lt;customHeaders&gt;
                      &lt;add name="Expires" value="Tue, 01 Jan 2030 16:00:00 GMT" /&gt;
                  &lt;/customHeaders&gt;
              &lt;/httpProtocol&gt;
          &lt;/system.webServer&gt;
      &lt;/location&gt;
  &lt;/configuration&gt;
</code></pre>

<p>And finally, if you''re using XFBML, place this namespace definition in your <code>&lt;html&gt;</code> to make XFBML work in IE:
<code>xmlns:fb="http://www.facebook.com/2008/fbml"</code></p>
