<p>After your derived <code>JPanel</code> class calls <code>initComponent()</code> in its constructor, it could disable any further calls to <code>setLayout()</code> with, say, <code>setAllowLayoutChange(false);</code>.</p>

<p>Put the following code in a common base class that derives from <code>JPanel</code>:</p>

<pre><code>protected boolean mAllowLayoutChange;

/** Creates new form CommonPanel */
public CommonPanel()
{
    super();
    mAllowLayoutChange=true;
}

public void setAllowLayoutChange(boolean b)
{
    mAllowLayoutChange=b;
}

@Override
public void setLayout(LayoutManager mgr)
{
    if(mAllowLayoutChange) super.setLayout(mgr);
}
</code></pre>
