<p><code>cx_freeze</code> does not copy the <code>PyQt</code> plugins directory, which contains the <code>ico</code> image reader.
Here are the steps:</p>

<ol>
<li>in <code>setup.py</code> copy the <code>PyQt4</code> plugins directory to your distribution</li>
<li>In your code write something like:</li>
</ol>

<blockquote>
<pre><code>application_path = os.path.split(os.path.abspath(sys.argv[0]))[0]
try:
   if sys.frozen:
        plugin_path = os.path.join(application_path, "qtplugins")
        app.addLibraryPath(plugin_path)
except AttributeError:
    pass
</code></pre>
</blockquote>
