<p>You can instead use the multistage extension from <a href="https://rubygems.org/gems/capistrano-ext" rel="nofollow">capistrano-ext</a> to have different stages for your two different roles.</p>

<p>If different stages doesn''t make sense for your deployment, you could write your own bundle:install task and run different commands based on roles</p>

<pre><code>run "bundle --deployment --quiet", :roles =&gt; :web
run "bundle --deployment", :roles =&gt; :app
</code></pre>

<p>As noted in the comment below, this approach, however, will raise errors if the role does not have a server defined. It will also run each command serially. To work around both those issues, use the parallel helper.</p>

<pre><code>parallel do |session|
   session.when ''in?(:web)'', "bundle --deployment --quiet"
   session.when ''in?(:app)'', "bundle --deployment"
end
</code></pre>
