                join(_PYSIDEDIR,''QtCore4.dll''),
                join(_PYSIDEDIR,''QtGui4.dll'')])
              ]
setup(
    data_files=data_files,
    options={
        "py2exe":{
            "dll_excludes":[''shiboken-python2.7.dll'',''QtCore4.dll'',''QtGui4.dll''],
