<p><strong>Ad 1, 2:</strong></p>

<p>If .NET Framework 1.0 is removed, installing only .NET Framework 1.1 also provides the system support for version 1.0, except in rare instances where an application will not run because it checks the version number of a library. [4]</p>

<ol>
<li>.NET Framework 1.1
<ul>
<li>Does not require any other .NET Framework installed</li>
<li>In my experiments, reboot was not required</li>
<li>Provides system support for .NET Framework 1.0 as well (<a href="http://en.wikipedia.org/wiki/.NET_Framework_version_history#.NET_Framework_1.1" rel="nofollow">source</a>)</li>
</ul></li>
<li>.NET Framework 1.1 Language Pack
<ul>
<li>Requires .NET Framework 1.1 installed</li>
<li>In my experiments, reboot was not required</li>
</ul></li>
<li>.NET Framework 1.1 SP 1
<ul>
<li>Requires .NET Framework 1.1 installed</li>
<li>In my experiments, reboot was required</li>
</ul></li>
<li>.NET Framework 2.0
<ul>
<li>.NET 2.0 without any Service Pack is the last version with support for Win98 and WinME</li>
</ul></li>
<li>.NET Framework 2.0 SP 2
<ul>
<li>Last version with official support for Win2000</li>
<li>Requires Win2000 SP4 (plus KB835732 or KB891861 update), WinXP SP2 or later</li>
<li>Shipped with Windows Server 2003 R2 (not installed by default)</li>
</ul></li>
<li>.NET Framework 3.0
<ul>
<li>Shipped with Windows Vista</li>
</ul></li>
<li>.NET Framework 3.5
<ul>
<li>Installs .NET 2.0 SP1 and .NET 3.0 SP1 as well</li>
</ul></li>
<li>.NET Framework 3.5 SP 1 (express install)
<ul>
<li>Does not require any .NET Framework installed</li>
<li>In my experiments, reboot was not required</li>
<li>Shipped with Win7</li>
<li>Installs .NET 2.0 SP2 and .NET 3.0 SP2 as well</li>
</ul></li>
</ol>

<p><strong>Ad 2:</strong> Reboot requirements are generally determined by installation package''s exit code 3010. I always install the packages silently and with /norestart when appropriate - don''t know if the exit code is different with different parameters.</p>

<p><strong>Ad 3</strong>: No installation package required clean install.</p>

<p><strong>Ad 4:</strong> All installation packages require administrator privileges, because they install in WINDOWS directory.</p>

<p><strong>Additional prerequisites</strong></p>

<ol>
<li>Windows Installer 3.1
<ul>
<li>Does not require any .NET Framework installed</li>
<li>In my experiments, reboot was required</li>
</ul></li>
<li>WMI
<ul>
<li>Preinstalled in Windows 2000 and newer OSs</li>
<li>Available as a download for Windows NT, Win95 and Win98.</li>
</ul></li>
</ol>
