<p>The end result of using extension methods on your Repositories will be to expose the service interface from the Repository, while defining the implementation outside of the repository (which nicely reduces the efferent coupling of your repository). A similar result can be achieved in a more "OO-Friendly" manner by defining the service methods using delegate model (in .Net 3.5 and above you can leverage <code>Func&lt;&gt;</code> and <code>Action&lt;&gt;</code>), where the delegate implementations are defined elsewhere (and can be accessed via a <a href="http://visualstudiomagazine.com/articles/2011/01/21/software-factories-2.aspx" rel="nofollow">delegate based factory</a>).</p>

<pre><code>public class MyRepository
{
    //Repository Specific Methods
    public DomainObject FindById(...)
    ...

    //"Service" Methods as Delegates
    public Func&lt;DomainObject, SomeResult&gt; ProcessDomainObjectAndGetBackSomeResult
    {
        get
        {
            return ServiceMethodFactory.ProcessDomainObjectAndGetBackSomeResult;
        }
    }
}
</code></pre>
