<p>Try using org.restlet.ext.net as your http client.
On restlet.org you are told to change clients like this:</p>

<pre><code>    Engine.getInstance().getRegisteredClients().add(new HttpClientHelper(null));
</code></pre>

<p>However i have found that it does not work unless you do:</p>

<pre><code>Engine.getInstance().getRegisteredClients().clear();
Engine.getInstance().getRegisteredClients().add(new HttpClientHelper(null));
</code></pre>

<p>Make sure to have org.restlet.ext.net.jar on your buildpath, and make sure that the HttpClientHelper you register is actually org.restlet.ext.net.HttpClientHelper.</p>

<p>This solved the issue for me when using the latest snapshot of restlet, not sure if it works on previous releases.</p>

<p>This also sorted out some other issues i had with restlet:</p>

<ul>
<li>1001 error when using HTTPS</li>
<li>Communication Error randomly when posting data</li>
</ul>
