<p>The second way to do this is to customize a ListAdapter with a <code>ViewBinder</code>.  As Pinassi wrote, it is possible to do from <code>getView()</code> however this has the drawback of not being able to easily see data and mixes generic UI code with custom UI code.  Both <a href="http://developer.android.com/reference/android/widget/SimpleAdapter.html" rel="nofollow">SimpleAdapter</a> and <a href="http://developer.android.com/reference/android/widget/SimpleCursorAdapter.html" rel="nofollow">SimpleCursorAdapter</a> have an inner class named <code>ViewBinder</code> with method <code>setViewValue</code>. Each signature is different because of the underlying data it manages. </p>

<p>Simply override <code>setViewValue</code> for only the customization you want to manually control. For example is <code>R.id.button1</code> is a simple text binding just have the method return false and the API will handle it for you but since we''re customizing <code>R.id.button2</code> we will return true.</p>

<pre><code>switch(v.getId){
case R.id.button2:
   TextView button2 = (TextView) v;
   button2.setTypeface(customTypeFace);
   // bind text here or return false to allow the API to do this for you.
break;
// other customization
}
</code></pre>

<p><code>customTypeFace</code> comes from a system <a href="http://developer.android.com/reference/android/graphics/Typeface.html" rel="nofollow">Typeface</a> or the project''s <a href="http://developer.android.com/reference/android/graphics/Typeface.html#createFromAsset%28android.content.res.AssetManager,%20java.lang.String%29" rel="nofollow">assets folder</a>. Android uses TrueType Fonts.</p>
