<p>Also, conforming programs are not allowed to add declarations and definitions to the namespace <code>std</code>.</p>

<p>Upon seeing an instantiation of <code>std::unique_ptr&lt;T&gt;</code>, the compiler knows <em>everything</em> about the behavior of this instantiation - it''s exactly that behavior which was implemented as a part of the language implementation the compiler itself is a part of and the compiler is free to perform "special optimizations" coming from the guarantees of the C++ standard.</p>

<p>As an example for something coming from the same line of thinking, GCC already does this with a number of standard C99 functions in hosted mode - it may replace standard function calls with inline insn sequence or with calls to other functions - precisely because GCC knows the exact semantics by just knowing the name of the function.</p>
