<p>However, if you could live with a subset of regex syntax, a search engine could store additional tokens to efficiently match rather complex expressions.  Solr/Lucene allows for custom tokenization, where the same word can generate multiple tokens and with various rule sets.</p>

<p>I''ll use my name as an example: "Mark marks the spot."</p>

<p>Case insensitive with stemming: (mark, mark, spot)</p>

<p>Case sensitive with no stemming: (Mark, marks, spot)</p>

<p>Case sensitive with NLP thesaurus expansion: ( [Mark, Marc], [mark, indicate, to-point], [spot, position, location, beacon, coordinate] )</p>

<p>And now evolving towards your question, case insensitive, stemming, dedupe, autocomplete prefix matching: ( [m, ma, mar, mark], [s, sp, spo, spot] )</p>

<p>And if you wanted "substring" style matching it would be: ( [m, ma, mar, mark, a, ar, ark, r, rk, k], [s, sp, spo, spot, p, po, pot, o, ot, t] )</p>

<p>A single search Index contain all of these different forms of tokens, and choose which ones to use for each type of search.</p>

<p>Let''s try the word "Missippi" with a regex style with literal tokens: [ m, m?, m+, i, i?, i+, s, ss, s+, ss+ ... ] etc.</p>

<p>The actual rules would depend on the regex subset, but hopefully the pattern is becoming clearer.  You would extend even further to match other regex fragments, and then use a form of phrase searching to locate matches.</p>

<p>Of course the index would be quite large, BUT it might be worth it, depending on the project''s requirements.  And you''d also need a query parser and application logic.</p>

<p>I realize if you''re looking for a canned engine this doesn''t do it, but in terms of theory this is how I''d approach it (assuming it''s really a requirement!).  If all somebody wanted was substring matching and flexible wildcard matching, you could get away with far fewer tokens in the index.</p>

<p>In terms of canned apps, you might check out OpenGrok, used for source code indexing, which is not full regex, but understands source code pretty well.</p>
