<p>IMO, the safer and more "rvm way" is to first <code>rvm install</code> the new ruby version, then use the <code>rvm gemset copy</code> command to copy your gemset(s) to the new ruby version, e.g. <code>rvm gemset copy 1.9.2-p0@some-gemset 1.9.2-p290@some-gemset</code>. Then you can easily switch your project to using the newly-copied gemset (I recommend using an <code>.rvmrc</code> file in your project directory) and see if your code fails. If it does, changing back to the old ruby version is just a matter of switching the gemset.</p>

<p>But even if you don''t use gemsets (though I assume you do since you tagged rails on this question), the use of <code>rvm upgrade</code> can lead to unexpected failures. And if your code breaks, now you have to reinstall the old version again. Just take a bit more time and do it the clean way.</p>
