  <p>"My understanding of Domain Services is that they perform tasks that are outside the boundaries of the related repository (CRUD related tasks)."</p>
</blockquote>

<p>Your understanding is different to mine, which is:</p>

<blockquote>
  <p>Domain Services are used to encapsulate <em>domain</em> logic that falls outside the boundary of a single aggregate/entity/value object.</p>
</blockquote>

<p>Repositories are concerned with <em>storage</em>, not domain logic, and therefore the two are VERY different things.</p>

<p>To be honest, the more I see questions on here surrounding <strong>domain</strong> services, the more I feel there is general confusion surrounding what <strong>domain</strong> services actually are. I think this may due to the ambiguity between:</p>

<ol>
<li>Application Services - <em>(what the UI calls &amp; where transactions begin)</em></li>
<li>Infrastructure Services - <em>(things like an IEmailSenderService, ICreditCardPaymentGateway)</em></li>
<li>Domain Services - <em>(provides pure domain logic, just like an aggregate/entity)</em></li>
</ol>

<p>Jimmy Bogard has written a <a href="http://lostechies.com/jimmybogard/2008/08/21/services-in-domain-driven-design/" rel="nofollow">good article</a> about their distinctive roles.</p>

<p>So to answer your question: It''s a bad idea because you''d be mixing up two very distinct concepts and would be violating the <a href="http://en.wikipedia.org/wiki/Single_responsibility_principle" rel="nofollow">SRP</a></p>
',NULL,NULL,NULL,NULL,NULL,4574125,NULL,0,NULL,NULL,2,NULL,NULL,2,254449,NULL,'2012-05-18T08:52:59.113',NULL,10649540,'2012-05-18T08:52:59.113');

<p>1) Create a form event (note it is different to System.Timers)</p>

<p><code>private System.Windows.Forms.Timer timerForMonoResponsiveness;</code></p>

<p>2) Set up the form event in the Constructor or Initialization</p>

<pre><code>// This is a fix for mono not updating messages until an event (such as movement of
// the mouse) happens
// We use an event timer to fire off an event on a regular basis.
// This calls a function that doesn''t do anything.
if (Type.GetType("Mono.Runtime") != null) // Only run if in Mono
{
    this.timerForMonoResponsiveness = new System.Windows.Forms.Timer(this.components);
    this.timerForMonoResponsiveness.Interval = 100;
    this.timerForMonoResponsiveness.Tick += new EventHandler(timertimerForMonoResponsiveness_Tick);
    this.timerForMonoResponsiveness.Start();
}
</code></pre>

<p>NOTE: the "<strong>this.components</strong>" is defined in the <strong>Form.designer.cs</strong> of the form (should be done automatically) mine looks like this:</p>

<pre><code>private System.ComponentModel.IContainer components = null;
</code></pre>

<p>It is initialized as:</p>

<pre><code>this.components = new System.ComponentModel.Container();
</code></pre>

<p>3) Create the tick function for the timer</p>

<pre><code>// This function executes a Tick event so the UI updates on Mono
// This is a Mono bug workaround as the message processing was not being processed
// and was waiting on invoke which on Mono only runs when a UI element is changed (or  
// the mouse is moved). This function therefore runs regularly to mitigate this issue 
// it is called within a Mono check and will not run on Windows
// The function is SUPPOSED TO DO NOTHING.

private void timerForMonoResponsiveness_Tick(object sender, EventArgs e)
{
    this.timerMonoEventForMessagesToBeUpdated.Stop();
    // This doesn''t need to do anything, just call the event
    this.timerMonoEventForMessagesToBeUpdated.Start();          
}
</code></pre>

<p>Hope this helps.</p>
