<ul>
<li>Legacy REST</li>
<li>FQL</li>
<li>Graph API</li>
</ul>

<p>The Legacy REST API is in the process of being deprecated, while the Graph API is the most current, so if you''re unsure of which one to use, your best bet is to go with that one.</p>

<p>As you suggested, the Graph API, just like the Legacy REST API, is in fact a <a href="http://en.wikipedia.org/wiki/Representational_State_Transfer#Guiding_principles_of_the_interface" rel="nofollow">RESTful</a> API. It is my understanding that they now refer to their earlier REST API as the "Legacy REST" API in order to minimize confusion and distinguish it from the newer RESTful API (the Graph API).</p>
