<p>Or this answer on how to symbolicate manually: <a href="http://stackoverflow.com/questions/13574933/ios-crash-reports-atos-not-working-as-expected/13576028#13576028">iOS crash reports: atos not working as expected</a></p>

<p>Addition to the general problem:</p>

<p>If the application has special characters like spaces or apostrophe''s in it, the default Apple toolchain will not be able to symbolicate it. The reason is that the tool <code>otool</code>, which being used in the toolchain, can''t handle that. No matter how you pass the filename. So to fix this, you have to do the following:</p>

<ol>
<li>Rename the dSYM package and remove all special chars, e.g. from <code>My App''s.app.dSYM</code> to <code>MyApps.app.dSYM</code></li>
<li>Open the content inside the package and navigate down to <code>Contents/Resources/DWARF</code></li>
<li>Rename the file in there as you did above</li>
</ol>

<p>Now try again. Best way to avoid all this: NEVER use special chars in your apps name. If you want the adjust the name that appears on the screen, use CFBundleDisplayName or the corresponding plist entries.</p>
