<p>Today with multiple levels of distributed and local store the problem is larger, not smaller. Data can be spread from process memory to local shared memory to local disk stores which may be an arbitrary mix of SSD and HD and from there to distributed memory (e.g., memcache) and remote possibly replicated stores.  Not to mention mobile, local, cloud.  </p>

<p>THe problem that ORM is made to solve is deeper and wider today.  </p>

<p>I wrote my first ORM in 1987 from Objective C to a relational database core (file level).  I then worked for an object database company a few years interfacing languages to their ODBMS. Even with an object database there was some mismatch and need for language specific powerful but transparent interfaces. </p>
