<pre><code> +---+---+---+---+---+
 | H | e | l | p | A |
 +---+---+---+---+---+
 0   1   2   3   4   5
</code></pre>

<p>What this illustrates is that you can think of the indices as pointing BETWEEN the elements. So in this illustration, if specifying a slice <code>[1:1]</code>, you are actually referring to the space between <code>H</code> and <code>e</code>, but not including them.</p>

<p>If you wanted to overwrite <code>H</code> and <code>e</code>, you would specify the slice <code>[0:2]</code>.</p>
