<pre><code>rvm get stable
</code></pre>

<p>Then update your Ruby version:</p>

<pre><code>rvm upgrade 2.0.0
</code></pre>

<p>Choose yes for all the questions:</p>

<pre><code>Are you sure you wish to upgrade from ruby-2.0.0-p195 to ruby-2.0.0-p247? (Y/n): Y
Are you sure you wish to MOVE gems from ruby-2.0.0-p195 to ruby-2.0.0-p247?
This will overwrite existing gems in ruby-2.0.0-p247 and remove them from ruby-2.0.0-p195 (Y/n): Y
Do you wish to move over aliases? (Y/n): Y
Do you wish to move over wrappers? (Y/n): Y
Do you also wish to completely remove ruby-2.0.0-p195 (inc. archive)? (Y/n): Y
</code></pre>

<p>If you wish to update your gems to the latest versions, you can do:</p>

<pre><code>rvm all do gem update
</code></pre>

<p>EDIT: I just did this today for the latest version of ruby 2.0.0 (I updated from ruby-2.0.0-p195 to ruby-2.0.0-p353). After that, I was getting segmentation fault when I tried to update gems. This happens because the gems were installed for ruby-2.0.0-p195 and some of them are incompatible with p353.</p>

<p>Now you can go and try to find the gems that are incompatible, but the easiest solution was to remove all installed gems and install them again. I simply removed <code>gems/ruby-2.0.0-p353</code> directory that was located in <code>/usr/local/rvm</code>. It could be somewhere else for you.</p>

<p>Then I ran <code>gem install bundler</code> and for each of my rails apps I did <code>bundle install</code>.</p>
