<pre><code>public class Sorters {
    public static List&lt;Integer&gt; mergeSort(List&lt;Integer&gt; l) {
        if (l.size() &lt; 2) return l;
        int h = l.size();
        int m = h / 2;
        return merge(mergeSort(l.subList(0, m)), mergeSort(l.subList(m, h)));
    }

    private static List&lt;Integer&gt; merge(List&lt;Integer&gt; a, List&lt;Integer&gt; b) {
        if (a.size() == 0) return b;
        if (b.size() == 0) return a;
        int a0 = a.get(0);
        int b0 = b.get(0);
        List&lt;Integer&gt; res = new ArrayList&lt;Integer&gt;();
        if (a0 &lt; b0) {
            res.add(a0);
            res.addAll(merge(a.subList(1, a.size()), b));
        }
        else {
            res.add(b0);
            res.addAll(merge(a, b.subList(1, b.size())));
        }
        return res;
    }
</code></pre>

