<p>On the other hand, If you split by space (<code>line.split(" ")</code>), the code will fail if you try to read a file with a different whitespace delimiter. If <code>split()</code> expects you to write a regular expression, and it does matching anyway, use <code>split("\\s")</code> instead, that matches a "bit" more whitespace than just a space character.</p>

