<ul>
<li>You have a chain of constraints on <code>a</code></li>
<li>If <code>a</code> breaks any of them, try another <code>a</code> and push that through the chain.</li>
</ul>

<p>That is, <code>a.Change()</code> should be separated from the constraint checking loop, also adhering to the CQS principle:</p>

<pre><code>while (!MeetsConstraints(a))
{
    a.Change();
}

bool MeetsConstraints(Thing a)
{
    return Constraints.All(c =&gt; c.Allows(a));
}
</code></pre>

<p>No goto, no ugly loops, just simple and clean. &lt;/self-back-slapping&gt;</p>
