<p>The main questions are:</p>

<ul>
<li><p>Where will you get the information about the exp. (manual input in your program, or available on-line as open data)?</p></li>
<li><p>Will you put your lvl in the app, or will you use the Runescape highscores API (<a href="http://services.runescape.com/m=rswiki/en/Hiscores_APIs" rel="nofollow">Runescape Highscores API</a>) and just give your UserId?</p></li>
<li><p>Will you get the data on the fly, or will you load them once (e.g. startup of your application). What will you do if your application runs for a long time?</p></li>
<li><p>How will you calculate the result you want? Are there error margins?</p></li>
</ul>

<p>Afterward, you should start thinking about your UI.</p>

<ul>
<li><p>Will this application be transported to different platforms?</p></li>
<li><p>Will you use only a text interface or something more graphical?</p></li>
</ul>

<p>An now is the time to make the choice for the development architecture (what part of the code will run where: server, client, web-based, etc...). Once this choice is made, you can make a choice of development language or languages.</p>

<p>Visual Studio Express seems a good choice, since it permits you to choose a number of development options: client/Server, client, web application, database application, choice of development language (C, C++, C#, F), ...</p>

<p>Now is the time to do what Steve V. advises you to do.</p>

<p>As already said above: your question is general, so I could not get into more detail.</p>

<p>Good luck !</p>
