<ol>
<li>If your schemas refer to schemas hosted in the internet, the <code>Schema</code> object will try to fetch them during runtime. As long as I''m aware, the default <code>Schema</code> implementation does not cache those schemas. The W3C <a href="http://www.w3.org/blog/systeam/2008/02/08/w3c_s_excessive_dtd_traffic/" rel="nofollow" title="W3C’s Excessive DTD Traffic">already reported</a> on bad coding practices resulting in de-facto DDoS to their website (up to 130M dtd requests per day!).</li>
<li>If you are going to validate external uncontrolled xml files, then you are also exposed to the <code>Schema</code> trying to fetch other schemas from "possibly bad intended" xml sources.</li>
</ol>

<p>For more evil attack vectors, take a look into <a href="http://stackoverflow.com/a/4576153/413020" title="sign&#39;s answer">sign''s previous answer</a></p>

<p>To avoid this pitfall, you can store all external resources locally and use the <a href="http://docs.oracle.com/javase/7/docs/api/javax/xml/validation/SchemaFactory.html#setResourceResolver(org.w3c.dom.ls.LSResourceResolver)" rel="nofollow" title="SchemaFactory.setResourceResolver API">SchemaFactory.setResourceResolver</a> method to instruct the <code>Schema</code> how to fetch them.</p>
