INSERT INTO posts VALUES('<p>The callback is invoked <strong>asynchronously</strong>.  There''s "nobody home" listening for exceptions when the callback is called.  The browser invokes the callback in response to the asynchronous event of the HTTP request completing. Your <code>try ... catch</code> block is a static construct, and as such it won''t play any role in the handling of exceptions thrown by your callback function.  The <code>try ... catch</code> is executed synchronously, and it''s a thing of the past by the time the callback function happens. Thus, you can''t catch an exception that way; it just doesn''t make any sense.</p>
