INSERT INTO posts VALUES('<p>I would approach this by hiding all the actual iterators to the list within a wrapper class, and hiding the list itself in its own wrapper.  The list''s wrapper would know about all of the iterator wrappers; on <code>add()</code>, it would need to force each iterator wrapper to record the current position, delete the inside iterator, then perform the actual add (which would avoid the ConcurrentModificationException, because all the actual iterator had been destroyed), then have all the iterator wrappers re-create their iterators and set them to the necessary position.  Since you seem to be adding only to the end of the list, no fancy indexing will be necessary, but you will have to figure out what happens to iterators that had already advanced to the end - are they at the end, or at their original position in the list?  Some of them, of course, may have already told their callers that <code>hasNext()</code> is false...  One more thing: <code>add()</code> and <code>get()</code> should I think be <code>synchronized</code>.</p>
