INSERT INTO posts VALUES('<p>One advantage not yet mentioned for avoiding public fields: if there aren''t any public fields, one may define an interface that includes all the public features of the class, have the class implement that interface, and then have everyplace that uses the class use the interface instead.  If that is done, one may later design a class which has completely different methods and fields, but which implements the same interface, and use that class interchangeably with the original.  If this is done, it may be useful to have the class implement a static factory method in addition to the constructor, and have the factory return an object of the interface type.  Doing that would allow later versions of the factory to return an object of some other type.  For example, one may come up with a low-cost version of the object in which many properties return constants; the factory could see if such an object would be suitable, and if so return one instead of the normal object.</p>
