INSERT INTO posts VALUES('<p>I''m a bit late to this post, but I tend to use JdbcTemplate over ORM.  I know SQL (pretty well) and really don''t want to be "abstracted" away from my DB.  I find most of the time, my apps are using DB views where I push most business logic up to.  I have properly layered DAOs that have JdbcTemplate implementations.  It feels "clean" and most boilerplate code is hidden by JdbcTemplate (and it''s online documentation seems MUCH better then ORM stuff).  The limited time I''ve used something like Hibernate, I found when it worked, it save me some time...but when it wasn''t working properly, it cost me days of "WTF" debugging.  I''ve never had to spend more then 20 minutes debugging JdbcTemplate DAO impls.  I think the key, as others noted, is how comfortable you are with SQL / Schema Design</p>
